(1, 5, 'March Potluck', 'Potluck at the Rochester Public Library.  Meeting Room B. 2nd Floor.<br>Please bring a dish to share.  If you do not have time to make dish, you are still welcome, but please donate $5 to VIGOR at the door to help cover the cost of the room rental.', '2003-03-19 00:00:00', '1899-12-30 18:30:00', '1899-12-30 20:30:00', 'Rochester Public Library Room B (2nd Floor)', 'Andy Denny', '', '', 'The Rochester Public Library is Located on 2nd Street SE Between Broadway and Civic Center Drive/3rs Street SE.', '', 'FOOD or $5', 'http://www.rochesterpubliclibrary.org', 1, NULL, NULL),
(2, 6, 'Food Roadtrip to Ecopolitan', 'Join us for a fun filled friday evening.  Enjoy the company of VIGOR members as you try the exoctic cuisine of the Ecopolitan Restaurant (100% Raw Foods Vegan).   Carpool will be available.', '2003-03-28 00:00:00', '1899-12-30 17:45:00', '1899-12-30 23:00:00', 'Ecopolitan Restaurant in Minneapolis', 'Christopher Luick', '(507) 252-1888', 'chrisluick@prodigy.net', 'Take HWY 52N to 62W toards Minneapolis.  Exit 35W North.  Follow 35W North to Lake Street Exit.  Make a left onto Lake Street.  Follow Lake Street to Lyndale Ave.  Make a Right on Lyndale and continue for 1.5 miles.  The Ecopolitan is on the right hand side of the street.', 'http://ecopolitan.com/gethere.php', 'TBD', 'http://ecopolitan.com/', 1, NULL, NULL),
(3, 1, 'Howard Lyman: The Reformation of a Mad Cowboy', 'Don?t miss this opportunity.  Howard Lyman is a treasure in the vegetarian movement.  He is a wonderful storyteller and powerful persuader, inspiring all who hear him to live better lives and be better people.  <br>	He became famous when he caused Oprah Winfrey to say, ?I?m stopped. I?ll never eat another burger.? and was subsequently sued by the cattle industry.  He is the author of Mad Cowboy: Plain Truth From a Cattle Rancher Who Won?t Eat Meat, and a national spokesperson for vegetarian living and the organic movement. <br>', '2003-03-21 00:00:00', '1899-12-30 19:00:00', '1899-12-30 20:00:00', 'Dodge Center Seventh Day Adventist Church', '', '', '', 'Dodge Center Seventh-day Adventist Church Central Avenue & Highway Street in Dodge Center,<br>MN<br>', '', 'Free Community Event', '', 1, NULL, NULL),
(4, 1, 'Howard Lyman: Saving the World One Bite at a Time', 'Don?t miss this opportunity.  Howard Lyman is a treasure in the vegetarian movement.  He is a wonderful storyteller and powerful persuader, inspiring all who hear him to live better lives and be better people.  <br>	He became famous when he caused Oprah Winfrey to say, ?I?m stopped. I?ll never eat another burger.? and was subsequently sued by the cattle industry.  He is the author of Mad Cowboy: Plain Truth From a Cattle Rancher Who Won?t Eat Meat, and a national spokesperson for vegetarian living and the organic movement. <br>', '2003-03-22 00:00:00', '1899-12-30 19:00:00', '1899-12-30 20:00:00', 'Dodge Center Seventh Day Adventist Church', '', '', '', 'Dodge Center Seventh-day Adventist Church Central Avenue & Highway Street in Dodge Center, MN<br>', '', 'Free Community Event', '', 1, NULL, NULL),
(5, 1, 'Commumity Ed. Class: Tofu for Today', 'From breakfast to dinner, snacks and desserts, discover the range of uses for this versatile product that goes back thousands of years.  Tofu is a healthy, low fat, cholesterol-free alternative to meats, dairy products and even eggs.  Sample a variety of foods in this demonstration class.  Take home recipes, ideas and information.  <br>Instructors: Kati Poier and Heather Holtan<br>', '2003-03-15 00:00:00', '1899-12-30 10:00:00', '1899-12-30 12:00:00', 'Century High School, Facs Lab H-231', 'Adult Community Education', '285-8646', '', '', '', '$15, Class Code: 7838.741', '', 1, NULL, NULL),
(6, 1, 'Community Ed. Class: Quick & Easy Healthy Alternatives', 'Learn how to prepare healthy, quick and delicious vegetarian dishes such as mock vegan chicken pasta salad, meatless riblets and no-egg salad.  This is a demonstration class on how to make the dishes.  Come hungry and bring containers for leftovers.  The students will have an opportunity to sample all the dishes.  A complimentary vegetarian starter kit from the Physicians Committee for Responsible Medicine and other educational material about the benefits of a plant-based diet will be handed out.<br>', '2003-04-09 00:00:00', '1899-12-30 19:00:00', '1899-12-30 21:00:00', 'John Marshall High School, Facs Lab 2-207', 'Adult Community Education', '285-8646', '', '', '', '$15, Class Code: 7855.741', '', 1, NULL, NULL),
