(92, 5, 'FYI...4-H Animal Rights display', 'I was at the Olmsted County Fair in Rochester, MN and was walking through the 4-H building and there were 2 displays about the controversy of animal circuses.  Both displays represented the animal rights side very well! Then both displays had an animal welfare side which really represented the arguments of circus staff.<br> <br>And there was also a 4-H display about the controversy of animal research which was very well done. The display had very graphic pictures of animal experiments. The 4-her had the animal rights view and then the animal welfare views which really were the animal experimenters arguments. If anyone would like pictures of the displays let me know. This information is brought to you by the group(RAPS).', '2003-08-08 00:00:00', '1899-12-30 01:00:00', '1899-12-30 13:00:00', 'Olmsted County Fair, Rochester, MN', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', '', '', '', '', 1, NULL, NULL),
