(111, 1, 'Tofu for Today', 'From breakfast to dinner, snacks, and desserts, discover the range of uses for this versatile product that goes back thousands of years. Tofu is a healthy, low fat, cholesterol-free alternative to meats, dairy products and even eggs. Sample a variety of foods in this demonstration class. Take home recipes, ideas, and information.', '2003-10-25 00:00:00', '1899-12-30 10:00:00', '1899-12-30 12:00:00', 'Century-Facs Lab H-231', 'Kati', '536-0227', 'katie_poier@hotmail.com', 'Register by calling 507-285-8646 or 507-285-8350. Mail in registration and ask for class code 7838.141 Adult Enrichment Northrop Education Center 201 8th ST. NW Rochester, MN 55901<br>', '', '$15', '', 1, NULL, NULL),
(112, 1, 'The Power of a Plant-Based Diet', 'We will be using recipes from the Mediterranean, the Far East, and the Midwest''s (Mayo-trained Cardiologist, Dr. Richard Collins. Come prepare and sample foods using fresh fruits and vegetables, whole grains,beans and soy products. Diets high in plant fiber have been shown to lower the risk of heart disease.', '2003-10-30 00:00:00', '1899-12-30 18:30:00', '1899-12-30 20:30:00', 'John Marshall-Facs Lab 2-207', 'Julie Eyrich', '536-0227', 'JULIE_EYRICH@msn.com', 'Register by calling 285-8646 or 285-8350. Mail in registration and ask for class code 7849.141 Adult Enrichment Northrop Education Center 201 8th ST. NW Rochester, MN 55901<br>', '', '$15.00', '', 1, NULL, NULL),
(113, 3, 'Peace Plaza', 'VIGOR will be having an information table set-up at the Rochester Peace Plaza. Activists will be promoting vegetariansm and how it is good for your health, the environment and the animals. For more information visit: www.goveg.com', '2003-09-10 00:00:00', '1899-12-30 11:30:00', '1899-12-30 13:00:00', 'Galleria downtown', 'Julie Eyrich', '536-0227', 'JULIE_EYRICH@msn.com', '', '', 'Free', '', 1, NULL, NULL);
