(114, 2, 'VIGOR Planning Meeting', 'Help shape and organize VIGOR''s future events!<br>', '2003-10-08 00:00:00', '1899-12-30 19:30:00', '1899-12-30 20:30:00', 'Private house', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'Contact for directions.', '', 'free', '', 1, NULL, NULL),
(115, 3, 'Rochester Womens Fall Expo', 'VIGOR will be tabling at this huge event. We will be promotiong vegetarianism by distributing vegetarian starter kits from the Physicians Committee for Responsible Medicine and other educational material about the benefits of a plant-based diet.<br>', '2003-10-25 00:00:00', '1899-12-30 09:00:00', '1899-12-30 17:00:00', 'Mayo Civic Center', 'Julie', '536-0824', 'JULIE_EYRICH@msn.com', 'VIGOR has to pay $450. dollars to be part of this expo. Econo Foods donated VIGOR a spot in the year 2001 and handed out a 1000 pieces of  information. If you would like to help cover the cost... Please make out checks to VIGOR and write Women''s expo in the memo and send checks to PO Box 253,Rochester, MN 55903 VIGOR is 501(c)(3) non-profit so your donation is a tax-write off.<br> Thanks!', '', 'free', '', 1, NULL, NULL),
(116, 1, 'Vegetarian Nutrition Lecture', 'Vegan nutritionist Brenda Davis, RD will give a presentation on optimizing plant-based eating patterns. Brenda is a past Chair of the Vegetarian Nutrition Dietetic Association, and author of the books Becoming Vegetarian, Becoming Vegan, and Dairy Free and Delicious. To be followed by a presentation at 4:00pm by environmentalist Anthony Marr.', '2003-09-14 00:00:00', '1899-12-30 14:00:00', '1899-12-30 18:00:00', 'University of MN East Bank', 'Julie', '507-536-0824', 'JULIE_EYRICH@msn.com', 'University of MN East Bank, Cofffman Memorial Union 3rd floor, President''s Room<br>For more infromationcontact Compassionate Action for Animals<br>www.ca4a.org', '', 'Free!', '', 1, NULL, NULL),
(117, 3, 'National Day of Lealfeting', '4th National Day of Leafleting Schools<br>Tuesday, October 14, 2003<br>Sponsored by Animal Rights International, Viva!, and Vegan Outreach.<br>Actvisits will be leafleting at the University Center Rochester. We will be distributing material about vegetariansim. <br>', '2003-10-14 00:00:00', '1899-12-30 10:00:00', '1899-12-30 11:30:00', 'University Center Rochester', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', '', '', 'Free!', '', 1, NULL, NULL),
(118, 3, 'VIGOR is Spotlighted on KTTC News!', 'VIGOR is going to be featured for 3 minutes on KTTC news for the segment "Fit for Friday." KTTC''s newscaster, Tom Overlie attended  Vigor''s potluck September 17 and interviewed a few of the VIGOR members about plant-based diet. Watch for the segment September 26, Friday on KTTC at 6:00pm.', '2003-10-03 00:00:00', '1899-12-30 18:00:00', '1899-12-30 18:30:00', 'KTTC News 6:00pm', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', '', '', 'Free!', '', 1, NULL, NULL),
(119, 1, 'Freedom of Access to all Healing Options', 'Attorney Diane Miller is a leading spokesperson for healthcare freedom of access. Miller founded the National Health Freedom Society of Homopaths and the American Holistic Medical Association, among others. Miller has been featured in sereral leading national magazines.', '2003-10-07 00:00:00', '1899-12-30 07:00:00', '1899-12-30 21:00:00', 'Peoples Co-op Office', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'Traveling east on Highway 14, continue past the stoplight for Rochester community & Technical college. Go almost one mile more and turn left by the Peoples Cooperative Services building.', '', 'Free!', '', 1, NULL, NULL),
(120, 1, 'Vegetarian Cooking School', 'Cooking Tofu with Dr. Mary Ann McNeilus. This event is sponsored by th Dodge Center Seventh-day Adventist Church.', '2003-10-14 00:00:00', '1899-12-30 18:30:00', '1899-12-30 20:30:00', 'Dodge Center Seventh-day Advendist Church', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', '', '', 'FREE!!!', '', 1, NULL, NULL),
