(122, 1, 'Eating', '"Eating" produced by Michael Anderson will be aired on Public Access channel 10, every Wednesday at 4:00pm for the whole month of November. This video is pro-vegan!', '2003-11-05 00:00:00', '1899-12-30 16:00:00', '1899-12-30 17:00:00', 'Public Access channel 10', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'Michael Anderson wants to show Americans how their dietary choices were affecting their health, their enviroment, and the animals they used for food. For more information about the video visit:http://www.beacondv.org/promo1.htm', '', 'Free!', '', 1, NULL, NULL),
(123, 4, '3rd Annual Thanksgiving Feast!', 'The last two Thanksgiving Dinners, VIGOR served a 100 people!<br>It is our big fundraiser. 100% of the money goes to community outreach about vegetarianism.<br>Featuring:Tofurkey, Holiday Loaf, Mashed Potatoes, Stuffing, Gravy, Cranberry Sauce, Corn, Broccoli Salad, Bread, Pumkin Pie, & Apple Crisp. Seating is limited. Buy your ticket early. Cost:$12, VIGOR members: $10 Kids 6-12:$5,Under 5 are free. The day of the event and at the door $15.<br>', '2003-11-16 00:00:00', '1899-12-30 17:30:00', '1899-12-30 19:00:00', 'Seventh Day Adventist Church', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'Seventh Day Adventist Church<br>1100 37th ST NW<br>Rochester, MN 55901', '', '$12', '', 1, NULL, NULL),
