(126, 3, 'KFC Demo', 'As part of a nationwide campaign started by PETA to pressure KFC restaurants to adopt more humane animal welfare stndards and as part of World Farm Animals Week,the Coalition for Animal Rights Education is organizing a demo.', '2003-10-05 00:00:00', '1899-12-30 10:00:00', '1899-12-30 12:00:00', '1089 University Ave. W. St. Paul, MN', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'If you would like to help and need a ride contact Julie Eyrich.   Previous campaigns to better the living conditions for the animals targeted towards major fast food chains McDonalds, Burger King, and<br>Wendy''s have all been surprisingly successful. Let''s not let KFC get away with its cruel and violent business any longer!<br>for more info visit www.KFCcruelty.org.com', '', 'Free', '', 1, NULL, NULL),
(127, 1, 'Animal Suffering,Factory Farming, Vegansim', 'Local activist and educator Freeman Wicklund will be coming to campus to speak about Animal Suffering, Factory Farming, ans Veganism. Freman will speak of first hand experience that he had while visiting battery-cage facilities and other factory farms in MN.', '2003-10-09 00:00:00', '1899-12-30 16:00:00', '1899-12-30 18:00:00', 'Room 303 of Appleby Hall', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'For more information contact: Greg Oschwald email: osch0001@umn.edu<br>or visit Uof M Compassionate Action for Animals website: www.ca4.org/umntc', '', 'Free', '', 1, NULL, NULL),
(128, 6, 'Multicultural Vegetarian Feast', 'We are ending Vegetarian Awareness Month with a multicultural feast,<br>at which vegetarian foods from all sorts of ethnic and cultural<br>backgrounds will be represented. If you are interested in<br>participating in this or know a student group that would be willing tohelp out, please contact us at umntc-info@ca4a.org immediately!<br>Time: 5:30 pm on Monday, October 27<br>Location: Mississippi room on the third floor of Coffman', '2003-10-27 00:00:00', '1899-12-30 17:30:00', '1899-12-30 19:30:00', 'Mississippi room', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', '', '', '', '', 1, NULL, NULL),
(129, 1, 'Speaker:Professor Julie Andrzejewski', '10-29-03 - Animal Rights, Human Rights, and the Earth:<br>Indivisible Issues - Julie Andrzejewski<br>Want to learn how social justice and protection of the planet are<br>related to animal rights? Come hear Julie Andrzejewski, Professor of<br>Human Relations at St. Cloud State, demonstrate how interrelated these<br>issues really are.<br>Time: 4pm on Wednesday, October 29<br>Location: TBA <br>--', '2003-10-29 00:00:00', '1899-12-30 16:00:00', '1899-12-30 18:00:00', 'U of M', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'For more info contact Greg Oschwald email: osch0001@umn.edu<br>', '', '', '', 1, NULL, NULL),
(130, 3, 'Leafleting vegetarianism at a Christian conference', 'We need activists to leaflet at the Minneapolis Convetion Center Sunday Oct 12, 9:30am for a conference titled "A God-Entranced Vision of All Things" We will be distributing Christian vegetarian information that relates to the reasons why Christians should oppose cruelty to animals.this event is sponsored by the Rochester Animal Protection Society  www.mnraps.org', '2003-10-12 00:00:00', '1899-12-30 07:00:00', '1899-12-30 11:00:00', 'Minneapolis Convention Center', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'If you like to help and need a ride contact Julie Eyrich.', '', 'Free', '', 1, NULL, NULL),
