(141, 5, 'Turkey-free Thanksgiving hosted by Compassionate Action for Animals', '1. Turkey-free Thanksgiving Dinner - Sat., Nov. 15, 2pm, Coffman 307<br><br>Everyone is welcome at our first annual Turkey-free Thanksgiving<br>Dinner!  Come celebrate the fall harvest by enjoying a delicious<br>vegetarian Thanksgiving meal on Saturday, November 15, at 2pm in<br>Coffman''s Board Room (room 307).  Please consider bringing a<br>vegetarian or vegan dish or drink to share, along with eating<br>utensils.  For those who need to warm up their dish, we will have<br>Coffman''s Student Organization Kitchen available beforehand for this<br>purpose.  Hope to see you there!', '2003-11-15 00:00:00', '1899-12-30 14:00:00', '1899-12-30 16:00:00', 'Minneapolis, MN at the University of MN', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', '<br>300 Washington Ave SE<br>Minneapolis, MN 55455<br>visit: http://www.ca4a.org/umntc  for more details.<br>', '', '', '', 1, NULL, NULL),
(142, 6, 'Backroom Deli', 'HOURS:     Restaurant Monday - Friday <br> 11:00 AM - 7:00 PM <br> <br>         Deli case Monday - Friday <br> 9:00 AM - 9:00 PM <br> <br>         Saturday <br> 9:00 AM - 7:00 PM <br> <br>         Sunday <br> 9:00 AM - 6:00 PM <br> <br> CATEGORY:  FULLY VEGAN.  <br> <br>     CUISINE:  Soup and sandwiches.  <br> <br>     SPECIALTIES:  The best vegan burger you''ll ever eat. Different soups daily. A lunch special once a week.  <br> <br>     FEATURES:  Gourmet food at a reasonable price. Both chefs are vegan with 38 combined years of restaurant experience. Not only for vegans, most of our food is gluten-free and about 80% organic.  <br> <br>     SERVICE:  Full Service, Counter and Take-out.<br>This is great place to eat if you have never tried vegan food before. I find myself there at least twice a week!  <br>', '2003-11-03 00:00:00', '1899-12-30 11:00:00', '1899-12-30 19:00:00', '1001 6th St. NW', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', '1001 6th Street NW <br>Rochester, MN  USA <br>Phone: 507-289-9061', '', '', '', 1, NULL, NULL),
(143, 3, 'Fur-Free Friday sponsored by RAPS', 'This event is sponsored by the Rochester Animals Protection Society visit www.mnraps.org.<br>Please join activists from several local animal groups for a Fur-Free Friday silent vigil against Neiman Marcus.  The vigil will be held next Friday, November 28th, from 12 noon to 1:30 pm at the Neiman Marcus on 5th and Nicollett Ave.  Signs will be provided, but feel free to make your own as well.  If you have any questions or are interested in attending please contact Gil at 612-296-9020 or schw0753@umn.edu.  For more information on the cruelties involved in the fur industry please check out www.FurIsDead.com.  Thank you for all that you do for animals!', '2003-11-28 00:00:00', '1899-12-30 10:00:00', '1899-12-30 13:30:00', 'Neiman Marcus, Minneapolis MN', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'If you need a ride contact Julie Eyrich.', '', 'Free', '', 1, NULL, NULL),
(144, 3, 'VIGOR Library Display', 'VIGOR has a library display set-up at the Winona Public Library about vegetariansim. The display will be up from July30- Dec 31.<br>', '2003-11-01 00:00:00', '1899-12-30 13:00:00', '1899-12-30 01:00:00', 'Winona Public Library', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', '', '', '', '', 1, NULL, NULL),
