(146, 6, 'Backroom Deli', 'HOURS: Restaurant Monday - Friday 11:00 AM - 7:00 PM Deli case Monday - Friday 9:00 AM - 9:00 PM Saturday 9:00 AM - 7:00 PM Sunday 9:00 AM - 6:00 PM CATEGORY: FULLY VEGAN. CUISINE: Soup and sandwiches. SPECIALTIES: The best vegan burger you''ll ever eat. Different soups daily. A lunch special once a week. FEATURES: Gourmet food at a reasonable price. Both chefs are vegan with 38 combined years of restaurant experience. Not only for vegans, most of our food is gluten-free and about 80% organic. SERVICE: Full Service, Counter and Take-out. This is great place to eat if you have never tried vegan food before. I find myself there at least twice a week!', '2003-12-01 00:00:00', '1899-12-30 11:00:00', '1899-12-30 19:00:00', '1001 6th St. NW', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', '1001 6th Street NW Rochester, MN USA Phone: 507-289-9061<br>', '', '', '', 1, NULL, NULL),
