(159, 3, 'Vegan Food Giveaway', 'Vegan Food Giveaway - Sat., Dec 13, Uptown Transit Station, Minnepolis, MN.<br><br>Want to sample delicious vegetarian hot dogs or indulgent-tasting Silk<br>Nog?  Stop by the Uptown Transit Station on Saturday, December 13,<br>between 1 pm and 4 pm to taste these and get information on other<br>decadent vegan food!  If you have friends that doubt vegan food can<br>taste good, send them our way, and the taste will be enough to<br>convince them that you have a compassionate diet while still enjoying<br>the finer things in life!<br><br>Time: 1 pm to 4 pm, Sat., Dec. 13<br>Location: outside of the Uptown Transit Station (Hennepin Ave. north<br>of Lagoon Ave.)<br>This event is sponsored by: Compassionate Action for Animals visit: www.ca4a.org/umntc for more details.', '2003-12-13 00:00:00', '1899-12-30 13:00:00', '1899-12-30 16:00:00', 'Minneapolis,MN', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'Location: outside of the Uptown Transit Station (Hennepin Ave. north', '', 'Free!', '', 1, NULL, NULL),
