(163, 3, 'Tofurky Giveaway', 'Hello, my name is William and I?m a campaign coordinator for People for the Ethical Treatment of Animals (PETA). I?m writing to invite you to join PETA and Minneapolis-based animal rights group, Animal  Rights Coalition in a  Tofurky Giveaway.  Along with ?Santa?  we  will hand out free Tofurky?a soy-based roast that includes savory stuffing?in downtown  Minneapolis as part of PETA?s  Midwest tour to promote a vegetarian holiday. PETA?s ? Santa? hopes to reach people?s hearts through their stomachs and is urging consumers to stay true to the holiday spirit by giving  animals  something to be thankful for.<br><br> <br><br>Our demonstration will take place this Friday, December 19th, at Nicollet Avenue and 7th Street, in Minneapolis from 12 noon sharp to 1PM. We?ll have posters for you to hold and leaflets for you to distribute?all you need to bring is yourself, and please plan to arrive about 10 minutes early. We hope to have a great turnout of folks speaking out for the animals.<br>', '2003-12-19 00:00:00', '1899-12-30 10:00:00', '1899-12-30 13:00:00', 'Nicollet Avenue and 7th St. Minnepolis, MN', 'Julie Eyrich', '536-0824', 'JULIE_EYRICH@msn.com', 'If you would like to help and need a ride, contact Julie Eyrich.', '', 'Free', '', 1, NULL, NULL),
(164, 3, 'Leafleting vegetarianism at a Youth Encounter Convention', 'We need activists to leaflet at the Youth Encounter Event at the Hyatt Regency Hotel located at 1300 Nicollet Mall. We will be distributing Christian vegetarian information that relates to the reasons why Christians should oppose cruelty to animals. Activists should meet at the front entrance of the hotel at 5:30 pm sharp. This event is sponsored by the Rochester Animal Protection Society www.mnraps.org', '2003-12-28 00:00:00', '1899-12-30 15:00:00', '1899-12-30 20:30:00', '1300 Nicollet Mall,  Minneapolis, MN', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'Contact Julie eyrich if you need ride and would like to help.', '', 'Free', '', 1, NULL, NULL),
(165, 3, 'It is MAD to Eat Meat Demo', 'The first U.S. case of Mad Cow Disease has been detected in a dairy cow in Washington state. As a result, we are urging activists to take this opportunity to hand out our free "emergency vegetarian starter kits" and hold "Its Mad to Eat Meat--Go Veg" posters outside grocery stores and meaty restaurants around the country.<br>We will be meeting at the Peace Plaza at 11:30 AM, and then storming the streets with Veggie kits and PCRM MAD Cow disease factsheet.', '2004-01-07 00:00:00', '1899-12-30 11:30:00', '1899-12-30 13:00:00', 'Peace Plaza, downtown Rochester', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', '', '', 'Free', '', 1, NULL, NULL),
