(168, 3, 'Fur Demo sponsored by RAPS', '(for background and facts on fur, see www.FurIsDead.com)<br> <br><br>To all of you who haven''t heard the news!<br> <br>The TV show "Queer Eye for the Straight Guy" is doing some gig in the metro area.<br>Unfortunately they decided to JAZZ up some guy by getting him a fur<br>coat at RIBNICKS on sat am at 11-<br> The media will be there... so shall we!<br>anyway... it''s your chance to give them the attention they crave...<br>signs provided...<br>10:30-12  Sat 17th...<br>be there if you can.<br>', '2004-01-17 00:00:00', '1899-12-30 08:00:00', '1899-12-30 12:00:00', 'Ribnicks 224 First ST. Minneapolis MN', 'Julie Eyrich', '507-536-0824', 'JULIE_EYRICH@msn.com', 'Contact Julie Eyrich if you would like to help and need a ride.', '', 'Free', '', 1, NULL, NULL),
