(177, 3, 'Leafleting vegetarianism at the Target Center', 'There is a wonderful opportunity to leaflet to Christian concert goers about vegetarianiam on Saturday night.  On Feb 13, Fri & 14 Sat, Acquire the Fire is appearing at the Target center in Minneapolis. This is not listed on the Target web-site, but the information is at 1-800-329-FIRE. On Saturday night, the event lets out at 9:00pm. So we are planning to meet at 8pm across the street from Target Center at the Starbucks in Block E (that allows us to watch the exit doors for when people start leaving.  We catch them on their way out and last year we were able to give out nearly 2,000 fliers....these are pretty nice people).<br>Due to the huge volume of people who will be exiting from various doors, we need at least 10 leafleters.  This will take less than two hours.  Please come and bring a friend. We REALLY need you!', '2004-02-14 00:00:00', '1899-12-30 17:30:00', '1899-12-30 21:30:00', 'Target Center, Minneapolis, MN', 'Julie Eyrich', '507-536-0824', 'julie_eyrich@msn.com', 'If you would like to help and need a ride contact Julie Eyrich.', '', '', '', 1, NULL, NULL),
(182, 5, 'Meatout Potluck', 'Vegetarian Meatout potluck at the Rochester Public Library in meeting room B. Meeting room B is upstairs and to your left on the far wall. Bring a vegetarian dish to pass or $5.00.<br>VIGOR will be celebrating<br>''The Great American Meatout. Rochester Mayor Ardell Brede signed a proclamation declaring March 20th, 2004 "The Great American Meatout in Rochester, and encourage our citizens to explore a wholesome diet of whole grains, vegetables and fresh fruits."<br><br>?Meatout? is a national diet education campaign active in over 2,000 communities in all 50 states, and several foreign countries sponsored by FARM, Farm Animal Reform Movement (www.meatout.org).<br><br>The community is invited to join in and explore a wholesome, nonviolent diet of grains, legumes, vegetables and fruit. An information table will be set-up with tools to help you get started on a plant-based diet that is good for your health, the environment, and the animals.<br>', '2004-03-17 00:00:00', '1899-12-30 18:45:00', '1899-12-30 21:00:00', 'Rochester Public Library, Room: B', 'Julie Eyrich', '507-536-0824', 'julie_eyrich@msn.com', '', '', '', '', 1, NULL, NULL),
(183, 3, 'Adopt a College', 'We need activists to help distribute ''Why Vegan" booklets at Mankato State campus. Mission is to educate students and instructors that the best way to help protect our planet, our health and decrease suffering and exploitation among animals is to adopt a plant-based diet!<br>', '2004-03-03 00:00:00', '1899-12-30 08:30:00', '1899-12-30 12:15:00', 'Winona State in Winona, MN', 'Julie Eyrich', '507-536-0824', 'julie_eyrich@msn.com', 'If you would like to help but need a ride contact Julie Eyrich.', '', 'Free', '', 1, NULL, NULL),
(184, 3, 'Leafleting vegetarianism at the Mayo Civic Center', 'We need activists to leaflet at the Mayo Civic Center at a Christian seminar. We will be distributing Christian vegetarian information that relates to the reasons why Christians should oppose cruelty to animals.This event is sponsored by the Rochester Animal Protection Society www.mnraps.org<br>We will be meeting in the skyway that leads into the Civic Center.', '2004-02-27 00:00:00', '1899-12-30 21:00:00', '1899-12-30 22:15:00', 'Rochester Mayo Civic Center', 'Julie Eyrich', '507-536-0824', 'julie_eyrich@msn.com', '', '', '', '', 1, NULL, NULL),
(185, 3, 'Rochester Mayor signs Meatout proclamation', 'Rochester Mayor Ardell Brede signed a proclamation declaring March 20th, 2004"The Great American Meatout in Rochester, and encourage our sitizens to explore a wholesome diet of whole grains, vegetables and fesh fruits." Mayor Brede joins with other mayors across the country in this FARM (Farm Animal Reform Movement) sponosred event to promote the benefits of plant-based diets. For more info visit:www.meatout.org', '2004-03-20 00:00:00', '1899-12-30 01:00:00', '1899-12-30 13:00:00', 'Rochester, MN', 'Julie Eyrich', '507-536-0824', 'julie_eyrich@msn.com', '', '', '', '', 1, NULL, NULL),
