(187, 3, 'KFC demo in the Twin Cities, MN', 'As part of a nationwide campaign started by People for the Ethical Treatment of Animals (PETA) to pressure Kentucky Fried Chicken restaurants to adopt more humane animal welfare standards and the ?March KFC Month of Action,? the Coalition for Animal Rights Education (CARE) is organizing 2 ?mini? protests locally (see below for detailed info). Please join us in this worthwhile effort! <br><br>WHEN? Saturday, March 6th <br>TIME? 12-12:45pm & 1-2pm<br>WHERE? The first protest will be at the KFC on 2918 Chicago Ave in Minneapolis (near Uptown) and the second protest will be on 1089 University Ave W. in St Paul (near Midway) (Go to www.mapquest.com for directions)<br><br>Because KFC employees are required to report any protest activities to their managers, which will in turn be reported to the KFC headquarters we are staging 2 protests to give KFC the impression that there is a lot of pressure for them to change. Our first protest will be 45 minutes after which we?ll carpool to the next location in St Paul to conclude the second protest. <br><br>Tell your family and friends to come stand in solidarity with the animals. Be sure to dress appropriately for the weather!<br><br>Previous campaigns to better the living conditions for the animals targeted towards major fast food chains McDonalds, Burger King, and Wendy?s have all been surprisingly successful. Let''s not let KFC get away with its cruel and violent business any longer! <br><br>For more info on the KFC campaign check out www.KentuckyFriedCruelty.com. <br><br>For additional info on the protests call 612-296-9020 or email schw0753@umn.edu <br>', '2004-03-06 00:00:00', '1899-12-30 12:00:00', '1899-12-30 14:00:00', '2918 Chicago Ave, Minneapolis, MN', 'Julie Eyrich', '507-536-0824', 'julie_eyrich@msn.com', '', '', '', '', 1, NULL, NULL),
