(196, 1, 'Tom Regan Speaks at  University of MN', 'Tom Regan to speak at the University of Minnesota - Twin Cities<br><br>Philosophical catalyst of the modern animal rights movement, author,<br>and activist Tom Regan will speak at the University of Minnesota at<br>5:00 PM on Tuesday, April 6, in room 100 of Smith Hall.  The topic of<br>his talk will be "Empty Cages: Facing the Challenge of the Animal<br>Rights Movement."<br><br>Our moral obligation to non-human animals is one of the most pressing<br>issues of our time.  While philosophers have debated the status of<br>animals for hundreds of years, it has only been in the last thirty<br>years, through the combination of both empirical evidence and<br>philosophic inquiry, that this issue has received serious<br>consideration.  Tom Regan, PhD, Emeritus Professor of Philosophy at<br>North Carolina State University, is well-known for being the founder<br>of a philosophical theory, Animal Rights, that has sparked the animal<br>rights movement, one of the fastest growing social movements today.<br><br>The presentation is free and open to the public, and it will be<br>followed by a public reception. Smith Hall (207 Pleasant Street SE) is<br>on the East Bank campus of the University of Minnesota - Twin Cities.<br>Please visit http://onestop.umn.edu/Maps/SmithH/index.html for a map.<br>For further information, call 612-270-5696 or e-mail<br>info@ExploreVeg.org<br><br>Date: Tuesday, April 6<br>Time: 5 p.m.<br>Place: Smith Hall 100 on the East Bank of the University of Minnesota<br><br>Sponsored by the University of Minnesota chapter of Compassionate<br>Action for Animals and the Student Philosophical Association.  This<br>event has been made possible in part by the GAPSA Academic Initiatives<br>Grant, SAO Grant, and the MSA DEF Grant.', '2004-04-06 00:00:00', '1899-12-30 17:00:00', '1899-12-30 20:00:00', 'University of Minnesota', 'Julie Eyrich', '507-536-0824', 'julie_eyrich@msn.com', '', '', 'Free', '', 1, NULL, NULL),
