(201, 6, 'Vegan Cooking Demo at the Uof M', 'Vegan Cooking Demonstration <br>Want to learn how to make delicious and simple vegan food? Come watch our own chef extraordinaire, Joe Yocom, demonstrate how to make mouth-watering BBQ mock duck sandwiches and good ol'' southern chili dogs. All the food will be vegan, easy to make, and, most importantly, absolutely delicious! If you like food, this is not an event to miss! <br>Time: 5pm on Thursday, March 25 <br>Location: the Student Org Kitchen on the 2nd floor of Coffman <br>For more information: call 612-270-5696 or e-mail info@ExploreVeg.org', '2004-03-25 00:00:00', '1899-12-30 17:00:00', '1899-12-30 20:00:00', 'U of M campus in the Twin Cities', 'Julie Eyrich', '507-536-0824', 'julie_eyrich@msn.com', '', '', '', '', 1, NULL, NULL),
(202, 1, 'Environmental And Body Pollution', 'The next meeting for the Rochester Integrated Health Care Advocacy Group is scheduled for Tuesday, April 6 at 7:00 p.m at Peoples Co-op Building, 3935 Hwy 14 E. Rochester, MN. <br> <br>Due to allergies, please refrain from wearing scented products including essential oils. Thanks.<br> <br>Our featured speaker is Dr. Joseph Sevlie.  His topic is - Environmental and Body Pollution - Detoxify and Live.  Dr. Sevlie is the founder and health director of Sevlie Chiropractic Health and Wellness Center in Red Wing, Minnesota. For the past 21 years, Dr. Sevlie has provided natural health care options in a Christian setting for southeastern Minnesota and Wisconsin.  Doctor Sevlie will be discussing how low level, long term exposure to toxins such as heavy metals (e.g. lead, mercury, cadmium, pesticides, and industrial compounds) is associated with many chronic health conditions.', '2004-04-06 00:00:00', '1899-12-30 19:00:00', '1899-12-30 21:00:00', 'Peoples Co-op Building, 3935 Hwy 14 E. Rochester, MN.', 'Julie Eyrich', '507-536-0824', 'julie_eyrich@msn.com', '', 'Free', '', '', 1, NULL, NULL),
