(229, 3, 'Leafleting Vegetarianism at Luis Palau', 'Hello!!<br>We have an awesome opportunity this weekend to get 100,000 people to consider vegetarianism.  The Luis Palau festival is at the State Capital in St. Paul Saturday and Sunday, August 7 and 8.  <br>See: http://www.twincitiesfestival.org.<br>It is a Christian festival and we have special brochures (see www.ChristianVeg.com) that focus on why Christians should consider vegetarianism.  These pamphlets are very well done and these types of crowds have been very receptive to receiving them.  Even if you are not Christian or religious in any way, this is a fantastic opportunity to get a huge group of people to reconsider their treatment of animals.  <br> <br>At many other events, we end up either preaching to the choir or ranting against people who refuse to hear us.  This event is a chance to get our message into the hands of people who might actually read, listen and care about the issue.  In other words, much more bang for efforts.<br> <br>In addition, Black Beauty will attend and play videos of why vegetarianism is the way to go.  <br> <br>We will notify everyone of when and where to meet, but we anticipate needing leafleters from 7-10pm both Saturday and Sunday nights.  Please consider spending these weekend evenings with us.  The animals need you.<br> this event is sponsored by the Rochester Animal Protection Society', '2004-08-07 00:00:00', '1899-12-30 15:00:00', '1899-12-30 23:00:00', 'St. Paul Capitol', 'Julie Eyrich', '507-536-0824', 'julie_eyrich@msn.com', 'If you would like to help and need a ride contact Julie Eyrich', '', 'Free', '', 1, NULL, NULL),
(230, 3, 'Leafleting Vegetarianism at Luis Palau', 'Hello!!<br> <br>We have an awesome opportunity this weekend to get 100,000 people to consider vegetarianism.  The Luis Palau festival is at the State Capital in St. Paul Saturday and Sunday, August 7 and 8.  <br>See: http://www.twincitiesfestival.org.<br>It is a Christian festival and we have special brochures (see www.ChristianVeg.com) that focus on why Christians should consider vegetarianism.  These pamphlets are very well done and these types of crowds have been very receptive to receiving them.  Even if you are not Christian or religious in any way, this is a fantastic opportunity to get a huge group of people to reconsider their treatment of animals.  <br> <br>At many other events, we end up either preaching to the choir or ranting against people who refuse to hear us.  This event is a chance to get our message into the hands of people who might actually read, listen and care about the issue.  In other words, much more bang for efforts.<br> <br>In addition, Black Beauty will attend and play videos of why vegetarianism is the way to go.  <br> <br>We will notify everyone of when and where to meet, but we anticipate needing leafleters from 7-10pm both Saturday and Sunday nights.  Please consider spending these weekend evenings with us.  The animals need you.<br> This event is sponsored by the Rochester Animal Protection Society', '2004-08-08 00:00:00', '1899-12-30 15:00:00', '1899-12-30 23:00:00', 'St. Paul Capitol', 'Julie Eyrich', '507-536-0824', 'julie_eyrich@msn.com', 'If you need a ride and would like to help, contact Julie Eyrich.', '', '', '', 1, NULL, NULL),
