(301, 5, 'Vegetarian Potluck', 'Participants are asked to bring a vegetarians dish, place setting, a beverage and the recipe for the dish. The group request no meat, chicken or fish and encourages dairy-free and egg-free dishes.', '2006-10-18 00:00:00', '1899-12-30 18:45:00', '1899-12-30 20:30:00', 'Rochester Public Library Meeting Room B', 'Julie Eyrich', '507-254-8349', '<a href="mailto:julie_eyrich@msn.com">julie_eyrich@msn.com</a>', '', '<a href="http://www.rochesterpubliclibrary.org/>Rochester Public Library</a>', 'FREE', '', 1, NULL, NULL),
(302, 1, 'Dr. Greger, Bird Flu talk', 'Dr. Greger is a wonderful speaker.  We had 100 people enjoy his talk on nutrition and cancer last year. This year he will be speaking on Bird Flu. Please visit his website for more information - http://www.drgreger.org/', '2006-11-06 00:00:00', '1899-12-30 19:00:00', '1899-12-30 20:45:00', 'Rochester Public Library Auditorium', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '', '', 'Free', 'http://www.drgreger.org/', 1, NULL, NULL),
