(307, 5, 'Raw Vegan Potluck', 'Please bring a raw dish to share or a $5.00 donation.  An ingredient that has never been exposed to temperatures above 118 degrees farenheit is generally considered raw. You will find many raw food recipes make exceptions for certain ingredients in small quantities such as maple syrup, unroasted cashews, dried herbs, etc; so that''s acceptable at this potluck as well.  Please refer to the resources below for more information including recipes.<br><br><br><br>Resources:<br><br><br><a href="http://www.rawfoods.com">Living and Raw Foods</a><br><br><br><a href="http://www.alissacohen.com/raw.html">Alissa Cohen</a><br><br><br><a href="http://www.sunfood.com">Nature''s First Law Online Superstore</a><br><br><br><br><br><br><br>', '2007-01-17 00:00:00', '1899-12-30 18:45:00', '1899-12-30 20:30:00', 'Rochester Public Library Meeting Room B', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '', '', 'Free', '', 1, NULL, NULL),
