(311, 1, 'Tofu Today Cooking class', 'From Breakfast to dinner, snacks, and desserts, discover the range for this versatile product that goes back thousands of years. tofu is a healthy, low fat, cholesterol alterative to meats, dairy products and even eggs. Sample a versatile of foods in this demonstration class. Take home recipes, ideas, and information.<br>', '2007-02-24 00:00:00', '1899-12-30 18:30:00', '1899-12-30 20:00:00', 'John Adams Rm 114', 'Rochester Community Education', '285-8646', '', 'Instructor: Kati Berg<br>Where: John Adams Rm 114<br>Class Code 7838.241, Fee $15.00<br>To Register for this class, call 285-8646', '', '$15.00', '', 1, NULL, NULL),
