(356, 4, 'Join us for a VIGOR Thanksgiving Potluck & Celebration!', '<pre>&nbsp; <p>We''re doing something new this year and hope you can join us. </p><p>&nbsp;</p><p>Instead of our usual dinner of selling tickets and making the full meal, <br />this year we will just be making the fundamentals:&nbsp; <br />the Tofurkey &amp; cranberry sauce, and the potatoes &amp; gravy.&nbsp;&nbsp; <br />We''re asking you to bring a side dish, salad, dessert or $5.00.&nbsp; </p><p>&nbsp;</p><p>We are also looking for volunteers to help in the kitchen at this event. Let us know if you want to help.</p><p><br />This is a great opportunity for members to invite non-vegetarian friends or family members <br />to sample great tasting plant-based foods!</p><p>&nbsp;</p><p>Seventh Day Adventist Church</p><p>1100 37th St. NW Rochester, MN</p><p>Open to the public, but seating is limited.</p><p>Please RSVP Julie at 254-8349 or at Julie_Eyrich@msn.com</p><p>&nbsp;</p></pre>', '2008-11-16 00:00:00', '2000-01-01 17:30:00', '2000-01-01 19:00:00', 'Seventh Day Adventist Church', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '', '', 'pass a dish or $5.00', 'www.vigr.org', 1, '2008-10-12 17:09:43', '2008-10-21 11:06:56'),
