(360, 6, 'Vote for Vegan School Lunches', '<div style="text-align: center; width: 211px">&nbsp;</div><div style="text-align: center; width: 211px">&nbsp;</div><div style="text-align: center; width: 211px">&nbsp;</div><img style="visibility: hidden; width: 0px; height: 0px" src="http://counters.gigya.com/wildfire/IMP/CXNID=2000002.0NXC/bT*xJmx*PTEyMzE5NDc3ODcwMDAmcHQ9MTIzMTk*ODQ*MjAzMSZwPTQzMjMwMyZkPSZnPTEmdD*mbz1jMmY3NTU2OGUwYjE*NWRjOTNjZWI5YWMwMmQ*MDdmOQ==.gif" border="0" alt="" width="0" height="0" />On January 16th, Change.org will co-host an event at the National Press Club in Washington, DC to announce the top 10 rated ideas and our plans for supporting the formation of a national advocacy campaign behind each idea in collaboration with their nonprofit partners. <br />', '2009-01-16 00:00:00', '2000-01-01 00:00:00', '2000-01-01 00:00:00', 'https://www.change.org/ideas/view/vegan_school_lunch_options#', '', '', '', 'Go to <a href="https://www.change.org/ideas/view/vegan_school_lunch_options#">Change.org</a> and create and click the vote icon on the upper left corner.&nbsp; Create an account.&nbsp; Verify your account at your mail and then sign in at Change.org.&nbsp; Then place your vote by clicking on the icon again at <a href="https://www.change.org/ideas/view/vegan_school_lunch_options#">https://www.change.org/ideas/view/vegan_school_lunch_options#</a>', '', 'free', 'https://www.change.org/ideas/view/vegan_school_lunch_options#', 1, '2009-01-14 09:02:08', '2009-01-14 09:02:08'),
