(364, 5, '''New Location'' April Potluck at QHNC ', '<p>Please join us for a potluck in the Quarry Room at Quarry Hill Nature Center.&nbsp;</p><p>We encourage you to bring a vegan dish and a place setting. We are now designating a section of the potluck table for raw/living and gluten free food.</p><p>Note, we typically start eating at 7:00 p.m., but begin gathering around 6:45.</p><p>Progam topic:&nbsp; Sprouting 101. Keith Anderson will demonstrate the basics of growing your own home-made sprouts.&nbsp; This demonstration will show and discuss the basic equipment and process required for alfalfa sprouts and mixed bean sprouts.&nbsp; Most of the equipment required for basic sprouting is already available in your home.&nbsp; After the demonstration you will be able to successfully grown your own sprouts at home.</p>', '2009-04-15 00:00:00', '2000-01-01 18:45:00', '2000-01-01 20:45:00', 'Quarry Hill Nature Center, Quarry Room', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p>&nbsp;Driving directions to the Quarry Hill Nature Center are available at the map =&gt;</p>', 'http://www.qhnc.org/maps-directions.html', 'Bring a dish to share or $5.00', 'http://www.qhnc.org/', 1, '2009-02-04 06:05:23', '2009-04-13 08:43:18'),
(365, 5, 'May Potluck at QHNC ', '<p>Please join us for a potluck in the Quarry Room at Quarry Hill Nature Center.&nbsp;</p><p>We encourage you to bring a vegan dish and a place setting. We are now designating a section of the potluck table for raw/living and gluten free food.</p><p>Note, we typically start eating at 7:00 p.m., but begin gathering around 6:45. </p>', '1999-01-01 00:00:00', '2000-01-01 18:45:00', '2000-01-01 20:45:00', 'Quarry Hill Nature Center, Quarry Room', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p>&nbsp;Driving directions to the Quarry Hill Nature Center are available at the map =&gt;</p>', 'http://www.qhnc.org/maps-directions.html', 'Bring a dish to share or $5.00', 'http://www.qhnc.org/', 0, '2009-02-04 06:10:42', '2009-02-04 18:44:58'),
(366, 5, 'May Potluck at QHNC ', '<p>Please join us for a potluck in the Quarry Room at Quarry Hill Nature Center.&nbsp;</p><p>We encourage you to bring a vegan dish and a place setting. We are now designating a section of the potluck table for raw/living and gluten free food.</p><p>Note, we typically start eating at 7:00 p.m., but begin gathering around 6:45.</p><p>Progam topic:&nbsp; Green Smoothies</p>', '2009-05-20 00:00:00', '2000-01-01 18:45:00', '2000-01-01 20:45:00', 'Quarry Hill Nature Center, Quarry Room', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p>&nbsp;Driving directions to the Quarry Hill Nature Center are available at the map =&gt;</p>', 'http://www.qhnc.org/maps-directions.html', 'Bring a dish to share or $5.00', 'http://www.qhnc.org/', 1, '2009-02-04 18:37:23', '2009-02-26 06:04:24'),
(367, 5, 'September Potluck at QHNC ', '<p>Please join us for a potluck in the Quarry Room at Quarry Hill Nature Center.&nbsp;</p><p>We encourage you to bring a vegan dish and a place setting. We are now designating a section of the potluck table for raw/living and gluten free food.</p><p>Note, we typically start eating at 7:00 p.m., but begin gathering around 6:45.</p><p>Progam topic:&nbsp; Using Tofu for Stir Fries, Sandwiches, and Hot Dishes: The Patient (But Easy) Art of Frying or Grilling Tofu.&nbsp; Having trouble making sense of Tofu?&nbsp; Kati Berg will demonstrate how to successfully use tofu for Asian or American dishes.&nbsp; You and your family will soon be buying tofu in bulk and using it all the time!&nbsp; Stay tuned for additional demos on tofu at future potlucks-tofu can be used for desserts, breakfast, lunch or dinner.&nbsp; Kati has taught a Community Ed. cooking class called &quot;Tofu for Today&quot;.&nbsp; She has been vegan for nine years and was a vegetarian eight years before that.</p>', '2009-09-16 00:00:00', '2000-01-01 18:45:00', '2000-01-01 20:45:00', 'Quarry Hill Nature Center, Quarry Room', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p>&nbsp;Driving directions to the Quarry Hill Nature Center are available at the map =&gt;</p>', 'http://www.qhnc.org/maps-directions.html', 'Bring a dish to share or $5.00', 'http://www.qhnc.org/', 1, '2009-02-04 18:38:17', '2009-02-26 06:01:04'),
(368, 5, 'October Potluck at QHNC ', '<p>Please join us for a potluck in the Quarry Room at Quarry Hill Nature Center.&nbsp;</p><p>We encourage you to bring a vegan dish and a place setting. We are now designating a section of the potluck table for raw/living and gluten free food.</p><p>Note, we typically start eating at 7:00 p.m., but begin gathering around 6:45.</p><p>Progam topic:&nbsp; Dosa</p>', '2009-10-21 00:00:00', '2000-01-01 18:45:00', '2000-01-01 20:45:00', 'Quarry Hill Nature Center, Quarry Room', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p>&nbsp;Driving directions to the Quarry Hill Nature Center are available at the map =&gt;</p>', 'http://www.qhnc.org/maps-directions.html', 'Bring a dish to share or $5.00', 'http://www.qhnc.org/', 1, '2009-02-04 18:39:00', '2009-07-13 09:25:45'),
(369, 5, 'December Potluck at QHNC ', '<p>Please join us for a potluck in the Quarry Room at Quarry Hill Nature Center.&nbsp;</p><p>We encourage you to bring a vegan dish and a place setting. We are now designating a section of the potluck table for raw/living and gluten free food.</p><p>Note, we typically start eating at 7:00 p.m., but begin gathering around 6:45.</p><p>Progam topic:&nbsp; Using Tofu for Stir Fries, Sandwiches, and Hot Dishes: The Patient (But Easy) Art of Frying or Grilling Tofu.&nbsp; Having trouble making sense of Tofu?&nbsp; Kati Berg will demonstrate how to successfully use tofu for Asian or American dishes.&nbsp; You and your family will soon be buying tofu in bulk and using it all the time!&nbsp; Stay tuned for additional demos on tofu at future potlucks-tofu can be used for desserts, breakfast, lunch or dinner.&nbsp; Kati has taught a Community Ed. cooking class called &quot;Tofu for Today&quot;.</p>', '2009-12-16 00:00:00', '2000-01-01 18:45:00', '2000-01-01 20:45:00', 'Quarry Hill Nature Center, Quarry Room', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p>&nbsp;Driving directions to the Quarry Hill Nature Center are available at the map =&gt;</p>', 'http://www.qhnc.org/maps-directions.html', 'Bring a dish to share', 'http://www.qhnc.org/', 1, '2009-02-04 18:39:42', '2009-11-04 08:13:01'),
(370, 5, 'January Potluck at QHNC ', '<p>Please join us for a potluck in the Quarry Room at Quarry Hill Nature Center.&nbsp;</p><p>Please&nbsp;bring a vegetarian or vegan dish, a small note with the ingredients or the recipe,&nbsp;and a place setting. We are now designating a section of the potluck table for raw/living and gluten free food.</p><p>Note, we typically start eating at 6:45 p.m., but begin gathering at 6:30.</p><p>Progam topic:&nbsp; TBD</p>', '2010-01-19 00:00:00', '2000-01-01 18:30:00', '2000-01-01 20:30:00', 'Quarry Hill Nature Center, Quarry Room', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p>&nbsp;Driving directions to the Quarry Hill Nature Center are available at the map =&gt;</p>', 'http://www.qhnc.org/maps-directions.html', 'Bring a dish to share', 'http://www.qhnc.org/', 1, '2009-02-04 18:40:15', '2009-11-04 08:18:57'),
(371, 5, 'Emerging Women of Rochester Vegan Speaker', '<font size="4"><strong>Clarification!</strong></font> (This event is sponsored by: Emerging Women Organization. This in NOT a VIGOR event. Please read carefully the location and this event is for women only, sorry guys.) Sue Askildson, from Good Food Store Coop, will be Emerging Women guest speaker at the March general meeting of the Emerging Women of Rochester group. She will speak on &quot;Health &amp; Healing Through Nutrition&quot;. Susan will focus on raw &amp; vegan dishes that are simple and easy to make, just right for the warmer weather that will be coming soon. Using fresh organic produce, nuts, and seeds we will get to sample her Tomato Basil Soup, Onion Crackers, and Chocolate Cake. <p>This event is for women only and is free!</p><p>Join the Emerging Women of Rochester Wednesday, March 4th at 6:00 for this healthy living event. </p><p>Please join us for an evening of fun and friendship.</p><p>Quarry Ridge Clubhouse, 1823 Quarry Ridge Pl NW</p><p>&quot;For Women of all Ages in All Stages of Life&quot;</p><p>Go to the Emerging Women website for more information: http://www.ewofrochester.com/ </p>', '2009-03-04 00:00:00', '2000-01-01 18:00:00', '2000-01-01 20:00:00', 'Quarry Ridge Clubhouse, 1823 Quarry Ridge Pl NW', 'Sharon Bradley', '(507) 535-1524', 'SMBradley@merchantsbank.com ', '', '', '', 'http://www.ewofrochester.com/', 1, '2009-02-25 10:59:49', '2009-03-02 09:37:00'),
(372, 4, 'VIGOR Grill at Rochesterfest! June 22-27', '<font size="3"><strong>VIGOR is setting up a vegan&nbsp;food booth at Rochesterfest( <a href="http://www.rochesterfest.com/">http://www.rochesterfest.com/</a>)&nbsp;for the 6th year in a row with strong support from donors and a menu filled with wholesome, organic ingredients! </strong></font><font size="3"><strong><p>The Backroom Deli will be catering our&nbsp;menu:&nbsp;</p><p>Portobella burger <br />Oatpecan burger&nbsp;<br />Cajun Wrap&nbsp;<br />&nbsp;<br />Pakora fries &amp; chutney&nbsp;&nbsp;<br />SW bean salad<br />Potato salad<br />Box lunch: (veggie-burger or wrap +&nbsp;bean salad or,&nbsp;potato salad&nbsp;+ corn chips or India pakora fries)</p><p>&nbsp;We are a non-profit organization, and this operation depends on volunteers for its success. All proceeds will go to VIGOR and used to promote vegetarianism. It''s a great place to get involved with a community interested in health and vegetarianism. It is an inspiration to sell so many tofu sandwiches and healthy salads along side a street full of turkey legs and cheese curds.&nbsp; If you would like to help contact, Jaben Kitson, jaben_kitson@yahoo.com or (507)273-5806.</p><p>&nbsp;</p></strong></font><p><font size="3">&nbsp; </font></p>', '2009-06-22 00:00:00', '2000-01-01 09:30:00', '2000-01-01 10:30:00', '3rd Ave just east of Broadway between 1st St NE to 2nd St SE', 'Jaben Kitson', '(507)273-5806', 'jaben_kitson@yahoo.com', '<p>&nbsp;</p><p>&nbsp;</p>', '', '', '', 1, '2009-05-20 14:02:38', '2009-06-21 17:27:00'),
(373, 4, 'Thursday''s on First (30th, NOT the 23rd)', '<p>Due to a sidewalk sale we will&nbsp;<strong>NOT be setting up at Thursdays on the 23rd</strong>.&nbsp; We will be on the site plan however for the following 7 Thursdays (July 30 - Sept 10).&nbsp; </p><p>Thanks to great whether, a string of serendipitous events, hard work and talent of the Backroom Deli and our own VIGOR volunteers, we had an excellent turn out our first Thursday, selling 500 oat pecan burgers&nbsp;and&nbsp;Blue Sky soda!&nbsp; We will feature a new&nbsp;Blue Sky flavor&nbsp;and the improved oat pecan burger (grilled)&nbsp;on the 30th.&nbsp; This time the Bread Baker&nbsp;buns will be toasted warm on a&nbsp;grill&nbsp;so they''re softer and lighter.&nbsp; The price will be $1.00 as it was the first week.</p>', '2009-07-30 00:00:00', '2000-01-01 11:00:00', '2000-01-01 20:30:00', '1st ave SW between 2nd and 3rd streets by the south stage', '', '', 'jaben_kitson@yahoo.com', '', 'http://maps.google.com/maps?f=q&source=s_q&hl=en&q=&vps=5&jsv=168d&sll=44.020657,-92.464542&sspn=0.011758,0.024633&g=210+1st+Ave+SW+rochester+mn&ie=UTF8&geocode=Fb6znwIdhRp9-g&split=0', 'Pay what you want', 'http://www.downtownrochestermn.com/', 1, '2009-07-22 20:12:59', '2009-07-22 20:17:48');
INSERT INTO `events` (`id`, `ecat`, `etitle`, `einfo`, `edate`, `etimestart`, `etimeend`, `elocation`, `econtactname`, `econtactphone`, `econtactemail`, `edirections`, `emaps`, `ecost`, `elinkmoreinfo`, `active`, `created_at`, `updated_at`) VALUES
(374, 4, 'Calling for Volunteers Aug 13th!', '<p>VIGOR needs your help Aug 13 at Thursdays on First and Third! If you can spare a few hours, please contact Julie if you would like to volunteer. It''s very inspiring to have so many people wanting to eat our delicious food for a buck! </p><p><strong><font size="3">Times we need your help!</font></strong></p><p><font size="3">11am-1pm</font></p><p><font size="3">1pm-3pm</font></p><p><font size="3">3pm-5pm</font></p><p><font size="3">5:00pm-7pm</font></p><p><font size="3">7pm-8:30pm</font></p>', NULL, '2000-01-01 14:00:00', '2000-01-01 09:30:00', 'Thursday on First & Third', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '', '', '', '', 1, '2009-07-31 07:59:33', '2009-08-09 19:31:03'),
(375, 4, 'Calling for Volunteers Aug 13th!', '<p>If you have a few spare hours to help out at Thurs on first and third, contact Julie. It''s very inspiring to serve&nbsp;mainstream people yummy&nbsp;veggie food for a buck!</p><p><strong><font size="3">Times need:</font></strong></p><p>11am-1pm</p><p>1pm-3pm</p><p>4pm-6pm</p><p>5-pm-7pm</p><p>7pm-8:30pm</p>', '2009-08-13 00:00:00', '2000-01-01 11:00:00', '2000-01-01 20:30:00', 'Thursday on First & Third', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '', '', '', '', 1, '2009-08-09 19:48:41', '2009-08-09 19:54:27'),
(376, 4, 'Calling all Volunteers, Aug 27th', '<p>If you have a few spare hours to help out at Thursdays on first and third, contact Julie. We have changed our strategy to FREE or donation to try to attract more people to try the Rochester&nbsp;award winning oat pecan burger and organic soda! It''s very inspiring to serve&nbsp;mainstream people yummy&nbsp;veggie food. We are very short in the evening, so if you could help our that would be great!</p><p><strong><font size="2">Times need:</font></strong></p><p><font size="2">1:30pm-4:30pm</font></p><p><font size="2">5pm-7pm</font></p><p><font size="2">5pm-8pm</font></p><p><font size="2">8pm-10pm (help close)</font></p>', '2009-08-27 00:00:00', '2000-01-01 17:00:00', '2000-01-01 22:00:00', 'Thursdays on First & Third', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '', '', 'FREE!', '', 1, '2009-08-24 07:33:38', '2009-08-24 07:43:12'),
(377, 4, 'Free Vegan Food at War Kids Relief Festival', '<p>VIGOR will be serving the following catered by HYVEE Barlow.&nbsp; Please stop by and enjoy a meal on us.<br /><br /><strong>Menu<br /></strong>Boca &quot;Chick&quot; Pattis on Rudi''s Organic buns served with lettuce and choice of condiments<br />Organic Watermelon Slices<br />Organic Blue Sky soda<br />Potato Chips<br /><br />View the Festival Flyer at <a href="http://www.vigr.org/uploads/WKRFestival.pdf">http://www.vigr.org/uploads/WKRFestival.pdf</a></p>', '2009-09-20 00:00:00', '2000-01-01 13:00:00', '2000-01-01 17:00:00', 'Rochester Art Center', 'Jaben Kitson', '507 273 5806', 'jaben_kitson@yahoo.com', '<p>40 Civic Center Drive SE, Rochester, MN 55904</p>', '<iframe width="425" height="350" frameborder="0" scrolling="no" marginheight="0" marginwidth="0" src="http://maps.google.com/maps?f=q&amp;source=s_q&amp;hl=en&amp;geocode=&amp;q=40+Civic+Center+Drive+SE,+Rochester,+MN+55904&amp;sll=37.0625,-95.677068&amp;sspn=38.41771,53.789062&amp;ie=UTF8&amp;ll=44.032444,-92.455959&amp;spn=0.008532,0.013132&amp;z=14&amp;iwloc=A&amp;output=embed"></iframe><br /><small><a href="http://maps.google.com/maps?f=q&amp;source=embed&amp;hl=en&amp;geocode=&amp;q=40+Civic+Center+Drive+SE,+Rochester,+MN+55904&amp;sll=37.0625,-95.677068&amp;sspn=38.41771,53.789062&amp;ie=UTF8&amp;ll=44.032444,-92.455959&amp;spn=0.008532,0.013132&amp;z=14&amp;iwloc=A" style="color:#0000FF;text-align:left">View Larger Map</a></small>', '', 'http://www.warkidsrelief.org/march', 1, '2009-09-14 16:49:53', '2009-09-14 16:53:43'),
(378, 5, 'Thanksgiving Potluck', '<p>Please join us for a Thanksgiving potluck at Rochester Seventy-day Adventist.&nbsp;</p><p>Please&nbsp;bring a vegetarian or vegan dish along with a small card with the ingredients/recipe.</p><p>We''ll start eating at 5:30, but begin gathering around 5:15.</p>', '2009-11-15 00:00:00', '2000-01-01 17:30:00', '2000-01-01 19:00:00', 'Rochester Seventh-day Adventist Church', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p>&nbsp;1100 37th St NW, Rochester:&nbsp;Here is the mapquest.com map =&gt;</p>', 'http://www.mapquest.com/maps?city=Rochester&state=MN&address=1100+37th+Street&zipcode=55901', 'Please bring a dish to share', '', 1, '2009-11-04 08:10:45', '2009-11-04 08:10:45'),
(379, 5, '(New Time and Location)February Potluck & Food Demo', '<p>Please join us for a potluck at the Rochester Public Library downtown (meeting room B on second floor). </p><p>If you bring a dish to share, please ensure it is entirely plant based (vegan). </p><p>Doors open at 6:15 and we eat at 6:30.</p><p>Progam topic:&nbsp; Blending cashews makes a great cream sauce demonstration by Kati Berg</p>', '2010-02-24 00:00:00', '2000-01-01 18:30:00', '2000-01-01 20:30:00', 'Library Meeting Room B', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p><a href="http://maps.google.com/maps/place?f=q&amp;hl=en&amp;sspn=40.001301,59.589844&amp;q=rochester+public++library,+rochester,+mn+55901&amp;fb=1&amp;cid=10387732323243321720">http://maps.google.com/maps/place?f=q&amp;hl=en&amp;sspn=40.001301,59.589844&amp;q=rochester+public++library,+rochester,+mn+55901&amp;fb=1&amp;cid=10387732323243321720</a></p>', '', 'Bring a dish to share', 'http://www.rochesterpubliclibrary.org/', 1, '2009-11-04 08:19:25', '2010-02-21 07:45:49'),
(388, 5, 'August Potluck at QHNC ', '<p>Please join us for a potluck in the Outside Pavilion by the Pond at Quarry Hill Nature Center. </p><p>If you bring a dish to share, please ensure it is entirely plant based (vegan).</p><p>Doors open at 6:15 and we eat at 6:30.</p><p>Progam topic:&nbsp; TBD</p>', '2010-08-25 00:00:00', '2000-01-01 18:30:00', '2000-01-01 20:30:00', 'Quarry Hill Nature Center, Outside Pavilion by the Pond', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p>&nbsp;Driving directions to the Quarry Hill Nature Center are available at the map =&gt;</p>', 'http://www.qhnc.org/maps-directions.html', 'Bring a dish to share', 'http://www.qhnc.org/', 1, '2009-11-04 08:24:37', '2010-02-19 15:11:49'),
(389, 5, 'March Potluck and Chia Seed Superfood Demo', '<p>Please join us for a potluck at the Rochester Public Library downtown (meeting room B on second floor). </p><p>If you bring a dish to share, please ensure it is entirely plant based (vegan). </p><p>Doors open at 6:15 and we eat at 6:30.</p><strong>Progam topic:</strong>&nbsp;<strong>Chia Seed SuperFood!</strong><strong> <p>This seed is the richest natural source of pure omega-3! The seeds have <strong>five times the calcium of milk and</strong>&nbsp;<strong>twice the protein</strong> of any other seed or grain! An exceptional food for <strong>Diabetics </strong>as it <strong>slows the conversion of carbohydrates to sugar</strong> which stabilizes blood sugar and regulates the body''s absorption of fluids. Incorporating chia seeds into your daily diet will enhance the <strong>nutrient absorption of all foods</strong>, including nutritional supplements. As an Aid in GERD, Ulcers, Gastritis and Irritable Bowel Syndrome. Chia seeds are readily available and inexpensive to buy and easy to use! (Free Samples will be given out!)</p></strong>', '2010-03-24 00:00:00', '2000-01-01 18:30:00', '2000-01-01 20:30:00', 'Library Meeting Room B', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p><a href="http://maps.google.com/maps/place?f=q&amp;hl=en&amp;sspn=40.001301,59.589844&amp;q=rochester+public++library,+rochester,+mn+55901&amp;fb=1&amp;cid=10387732323243321720">http://maps.google.com/maps/place?f=q&amp;hl=en&amp;sspn=40.001301,59.589844&amp;q=rochester+public++library,+rochester,+mn+55901&amp;fb=1&amp;cid=10387732323243321720</a></p>', '', 'Bring a dish to share', 'http://www.rochesterpubliclibrary.org/', 1, '2010-02-19 15:01:42', '2010-03-22 10:12:25'),
(390, 5, 'April Potluck and Food Demo (New  Time and Location)', '<p>Please join us for a potluck at the Rochester Public Library downtown (meeting room B on second floor). </p><p>If you bring a dish to share, please ensure it is entirely plant based (vegan). </p><p>Doors open at 6:15 and we eat at 6:30.</p><p>Progam topic:&nbsp; Get ready for spring greens with a green smoothie demonstration by Jaben Kitson</p>', '2010-04-07 00:00:00', '2000-01-01 18:30:00', '2000-01-01 20:30:00', 'Library Meeting Room B', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p><a href="http://maps.google.com/maps/place?f=q&amp;hl=en&amp;sspn=40.001301,59.589844&amp;q=rochester+public++library,+rochester,+mn+55901&amp;fb=1&amp;cid=10387732323243321720">http://maps.google.com/maps/place?f=q&amp;hl=en&amp;sspn=40.001301,59.589844&amp;q=rochester+public++library,+rochester,+mn+55901&amp;fb=1&amp;cid=10387732323243321720</a></p>', '', 'Bring a dish to share', 'http://www.rochesterpubliclibrary.org/', 1, '2010-02-19 15:02:41', '2010-02-19 15:08:28'),
(391, 5, 'May Potluck (Back outside at Quarry Hill for the Summer)', '<p>Please join us for a potluck in the Outside Pavilion by the Pond at Quarry Hill Nature Center. </p><p>If you bring a dish to share, please ensure it is entirely plant based (vegan).</p><p>Doors open at 6:15 and we eat at 6:30.</p><p>Progam topic:&nbsp; TBD</p>', '2010-05-26 00:00:00', '2000-01-01 18:30:00', '2000-01-01 20:30:00', 'Quarry Hill Nature Center, Outside Pavilion by the Pond', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '<p>&nbsp;Driving directions to the Quarry Hill Nature Center are available at the map =&gt;</p>', 'http://www.qhnc.org/maps-directions.html', 'Bring a dish to share', 'http://www.qhnc.org/', 1, '2010-02-19 15:13:37', '2010-02-19 15:16:25'),
