(394, 4, 'FREE Vegetarian Taste Extravaganza -', '<p>Try&nbsp; over 20 veggie dishes for free. Talk with the cooks &amp;&nbsp;recipes will be given out too! There will be a speaker at 1:30 talking about the health benefits of a plant-based diet.</p>', '2010-04-18 00:00:00', '2000-01-01 12:00:00', '2000-01-01 14:00:00', 'Rochester Seventh-day Adventist church', 'Julie Eyrich', '254-8349', '', '', '', '', '', 1, '2010-04-16 15:52:06', '2010-04-16 15:55:07'),
(395, 4, 'Think Green Fair', 'The Think Green Fair is coming up on Saturday, June 26th from 10am-9pm at the Olmsted County Fairgrounds. The fair is free and open to the public! \r\n\r\nCome check out the 2 story earth balloon, local food vendors, crafts and art produced by local artisans, a free raffle of sustainable prizes, and music by Minnesota artists, the fair is committed to showcasing green businesses and organizations dedicated to bringing sustainable services, products and visions to southeastern Minnesota.\r\n\r\nVIGOR WILL HAVE A BOOTH AND NEEDS VOLUNTEERS!  WE WILL BE GIVING AWAY SIMPLE VEGAN FOOD AND HANDING OUT VEGETARIAN INFORMATION.  CALL OR EMAIL KATI AT 259-1490 OR KATIBERG@KW.COM TO HELP!', '2010-06-26 00:00:00', '2000-01-01 10:00:00', '2000-01-01 09:00:00', 'Olmsted County Fair Grounds, Rochester', 'Kati Berg', '259-1490', 'katiberg@kw.com', '', '', 'Free', 'www.rneighbors.org', 1, '2010-06-17 18:50:00', '2010-06-17 18:53:53'),
(396, 5, 'Calling for Volunteers Aug 12th!', 'VIGOR needs additional volunteer help for our stand at Thursday''s on First&nbsp; 8/12.&nbsp; We will be selling herb pots and giving vouchers for $4.00 toward a vegan sandwich from the GFS.&nbsp;We really need someone for setup from 8:30 am until 11:00 am, if this doesn''t happen we will be cancelling the event. &nbsp;We need assistance explaining and helping people fill out the form for the voucher from 11am - 3pm and 4pm - 8pm.&nbsp; If you can help any subset of that time frame please let us know.&nbsp; ', '2010-08-12 00:00:00', '2000-01-01 08:30:00', '2000-01-01 20:30:00', '', '', '', 'julie_eyrich@msn.com', '', '', '', '', 1, '2010-08-05 08:31:01', '2010-08-05 08:31:51'),
(397, 5, 'September Potluck at Rochester Public Library', '<p>Please join us for a vegetarian potluck in the Rochester Public Library, Meeting Room A (on the main floor). </p><p>Bring a dish to share, please ensure it is entirely plant based (vegan).</p><p>6:30 pm.</p><p>&nbsp;</p>', '2010-09-22 00:00:00', '2000-01-01 18:30:00', '2000-01-01 20:30:00', 'Rochester Public Library, downtown Rochester', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '', 'http://www.rochesterpubliclibrary.org/info/directions.html', 'Bring a dish to share', 'www.vigr.org', 1, '2010-09-08 08:27:06', '2010-09-20 12:57:28'),
(398, 5, 'October 27 Vegetarian Potluck at Rochester Public Library', '<p>Please join us for a potluck in the Rochester Public Library, Meeting Room B (on the second floor). </p><p>Bring a dish to share, please ensure it is entirely plant based (vegan).</p><p>6:30 pm start time</p><p>NEW! Nov-Jan potlucks have been scheduled!</p><p>Nov. 17th, Dec. 15th and Jan. 26th&nbsp; All Wednesdays, All at 6:30pm, All at the Rochester Public Library Meeting Rm B.</p>', '2010-10-27 00:00:00', '2000-01-01 18:30:00', '2000-01-01 20:30:00', 'Rochester Public Library, downtown Rochester', 'Julie Eyrich', '507-254-8349', 'julie_eyrich@msn.com', '', 'http://www.rochesterpubliclibrary.org/info/directions.html', 'Bring a dish to share', '', 1, '2010-09-08 08:28:25', '2010-10-25 11:01:21'),
(399, 5, 'Macrobiotic Potluck', 'A potluck to share macrobiotic food and learn about macrobiotics. If you can, bring a macrobiotic, vegan, whole foods, or raw dish. If you can''t, don''t worry, we will learn together. Please try to&nbsp;avoid animal products.', '2010-11-03 00:00:00', '2000-01-01 18:30:00', '2000-01-01 20:00:00', '430 5th St. SW Apt # 5, Rochester MN 55902', 'Amin', '', 'ameen1983@yahoo.com', 'Two blocks across (south) of the Mayo Building. On the south East corner of 5th st SW and 5th ave SW. South of the United Methodist Church.', '', 'free', '', 1, '2010-10-21 12:34:51', '2010-10-21 12:38:55'),
