(405, 4, 'VIGOR Sponsoring Food for Z-Day', '2PM - LEARN\r\nLearn about an alternative and sustainable direction for our society followed by an engaging group discussion\r\n\r\n5PM - EAT\r\nSocialize in a casual setting over food, while listening to live music from open mic participants\r\n\r\nTasty Vegan food from Nupa and ONeil''s Pizza sponsored by VIGOR of Rochester\r\n\r\n7PM - ROCK\r\nlive music from Go Amelia!, Adja Gildersleve, a Special Performance from the Rochester Zeitgeist Movement, and a Group Drum Circle', '2011-03-12 00:00:00', '2000-01-01 14:00:00', '2000-01-01 19:00:00', 'U Turn Cafe', '', '', '', 'U-Turn Cafe\r\n5 11 1/2 Street Southeast\r\nRochester, MN', '', 'Free', 'http://www.facebook.com/event.php?eid=173479062698750', 1, '2011-03-11 20:02:05', '2011-03-11 20:02:05'),
