(407, 5, 'India Curry House Restaurant Gathering, May 25th, 6:30pm', '<p>Instead of a potluck this month we will meet at the Indian Curry House located at 1647 South Broadway<br />Rochester, MN 55904, ph: 507-288-5001</p><p>Ask for the VIGOR party.</p><p>Please join us.&nbsp; Each person will pay for their own meal.</p><p>Summer Potlucks will resume at the Quarry Hil Nature Center, 6:30pm on the 4th Wednesdays of the month.</p><p>For questions call Kati at 259-1490.</p>', '2011-05-25 00:00:00', '2000-01-01 06:30:00', '2000-01-01 07:30:00', 'India Curry House, 1647 South Broadway, Rochester, MN ', 'Kati Berg', '507-259-1490', 'katiberg@kw.com', '', '', '$$', 'http://indiacurryhousemn.com/', 1, '2011-05-16 13:31:15', '2011-05-16 13:31:55'),
