(413, 5, 'Minneapolis, Let''s Get America Vegucated!', '<p><strong>Join&nbsp;VIGOR at Riverview Theater in Minneapolis on Monday Nov 9 at 7:00pm to watch a new&nbsp;documentary&nbsp;on becoming a vegan.&nbsp;</strong></p><p><strong>Preview of this award winning documentary</strong>: <a rel="nofollow" href="http://www.youtube.com/watch?feature=player_embedded&amp;v=GKzng1_byMY" target="_blank">http://www.youtube.com/watch?feature=player_embedded&amp;v=GKzng1_byMY</a></p><p>Tickets can be purchased on-line at&nbsp;<a id="yui_3_2_0_1_1319487101257727" rel="nofollow" href="http://www.brownpapertickets.com/event/203823" target="_blank">http://www.brownpapertickets.com/event/203823</a></p>', '2011-11-09 00:00:00', '2000-01-01 19:00:00', '2000-01-01 21:00:00', 'Riverview Theater, 3800 42nd Avenue South, Minneapolis, MN 55406', 'Julie Eyrich', '2548349', 'julie_eyrich@msn.com', '', 'http://maps.google.com/maps?oe=UTF-8&gfns=1&q=3800+42nd+Avenue+South,+Minneapolis,+MN+55406&um=1&ie=UTF-8&hq=&hnear=0x87f629b67ec19eff:0xec3074c1368a8443,3800+42nd+Ave+S,+Minneapolis,+MN+55406&gl=us&ei=hEqoToOnB6ersALJh82zDw&sa=X&oi=geocode_result&ct=title&resnum=1&ved=0CB4Q8gEwAA', '', 'http://www.getvegucated.com/', 1, '2011-10-26 11:57:42', '2011-10-26 14:55:01'),
