(417, 4, 'Really Really Free Market', '<p align="left">&nbsp;</p><p align="left"><strong>&nbsp;Bring something to give away. Take&nbsp;anything&nbsp;&nbsp;for free. It''s that simple!</strong><strong><br /></strong></p><ul><li><div align="left"><strong>Bring used items or baked/canned goods to</strong><strong> give away.<li><strong>Provide services including personal care,</strong><strong> arts/crafts, repair, lessons and entertainment.</strong></li><li>P<strong>romote your organization with information</strong><strong> and samples. </strong></li></strong></div></li></ul><strong><p align="left">Everything is free! Invite your friends! This is the type of event that brings communities together.</p><p align="left">&nbsp;If you have old clothes, CD''s, electronics, household items, food...etc. bring them down to the Free Market. Once the event is over, any remaining items will be donated to one of the local second-hand outlets.&nbsp; Please DO NOT bring itemslike TV''s, old stereo equipment, or baby strollers. Thank You.</p><ul><p align="left">Please check here <a href="http://www.timetraderrochester.blogspot.com/" title="http://www.timetraderrochester.blogspot.com/">http://www.timetraderrochester.blogspot.com/</a> for cancellations before coming.</p></ul></strong><p>Sponsored by Time Trader, VIGOR, and The Zeitgeist Movement.</p>', '2011-12-10 00:00:00', '2000-01-01 10:00:00', '2000-01-01 15:00:00', 'Cornerstone EF Church 2810 40th Ave S.E. Off Marion Road (Not handicap accessible)', 'Aleea Dugstad', '', 'adugstad@yahoo.com', '', 'http://mapserver.superpages.com//mapbasedsearch/?&spheader=true&SRC=bpo&EG=2&C=Cornerstone+Evangelical+Free&LID=2063337380&map.x=212&map.y=125&level=8&lat=043981541&lng=-092398671&POI1lat=043981541&POI1lng=-092398671&POI1name=Cornerstone+Evangelical+Free&streetaddress=2810+40th+Ave+SE&city=Rochester&state=MN&zip=55904&PGID=yp410.8081.1323017122688.21412803993&spad=yes&TR=50', 'Free', '', 1, '2011-12-04 09:34:49', '2011-12-04 09:46:54'),
(418, 4, 'January Free Market', '<img src="http://tinyurl.com/73mkqsq" alt="Jan 29 RRFM" width="650" height="841" />', '2012-01-29 00:00:00', '2000-01-01 15:00:00', '2000-01-01 18:00:00', 'Barlow Event Center 1151 NW Civic Center Dr', 'Aleea Dugstad', '', 'adugstad@yahoo.com', '', 'http://maps.google.com/maps?q=1151+civic+center+dr&oe=utf-8&rls=org.mozilla:en-US:official&client=firefox-a&um=1&ie=UTF-8&hq=&hnear=0x87f75f0b2cc8c6ed:0x960a95147b0f92c2,1151+Civic+Center+Dr+NW,+Rochester,+MN+55901&gl=us&ei=X20QT7bvD6iLsgLI7M3rAw&sa=X&oi=geocode_result&ct=title&resnum=1&ved=0CCAQ8gEwAA', 'FREE!!', 'www.barlowplaza.com', 1, '2012-01-13 10:44:45', '2012-01-13 10:54:25'),
(419, 5, 'Seitan Demo & Vegetarian Potluck, March 28th at the Rochester Public Library', '<p>Wed.&nbsp;March 28th,&nbsp;6:30pm</p><p>Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>Kati Berg will demonstrate how to make &quot;wheat meat&quot; aka &quot;seitan&quot; from scratch.&nbsp; Our Asian neighbors have been making it for centuries.&nbsp; Save a ton by making it at home.&nbsp; It''s so easy!</p><p>See you there!</p><p>P.S.&nbsp;April and May potlucks will also&nbsp;be at the library the 4th Wednesday of the month at 6:30pm. March&nbsp;is in Meeting Room A, but all others in Meeting Room B.&nbsp;</p>', '2012-03-28 00:00:00', '2000-01-01 18:30:00', '2000-01-01 19:30:00', 'Rochester Public Library, Meeting Room A (on the first floor)', 'Kati Berg', '507-259-1490', 'katiberg@kw.com', '', '', 'Free', '', 1, '2012-02-21 18:56:55', '2012-03-07 09:05:55'),
(420, 4, 'March Free Market', '<p>A ''Free Market'' is a community gathering where participants donate clean &amp; usable items, servic...es, and information absolutely free. &quot;Give what you can--take what you need!&quot; Bring clean/usable old clothes, CD''s, electronics, household items, canned food, etc. Once the event is over, any remaining items will be donated to one of the local second-hand outlets.<br /><br />This months ''Free Market'' will feature:<br />--Live music from Phil Francis and his band. Check them out here: <br /><a rel="nofollow nofollow" href="http://tinyurl.com/6lk89yr" target="_blank" onmousedown="UntrustedLink.bootstrap($(this), ">http://tinyurl.com/6lk89yr</a><br />--Time Trader''s ''time banking'' orientation. Learn more here: <br /><a rel="nofollow nofollow" href="http://www.familyservicerochester.org/timetrader.html" target="_blank" onmousedown="UntrustedLink.bootstrap($(this), ">http://www.familyservicerochester.org/timetrader.html</a><br />--Free Haircuts from Julie''s Hair Care Salon: <br /><a rel="nofollow nofollow" href="http://tinyurl.com/7llvcbl" target="_blank" onmousedown="UntrustedLink.bootstrap($(this), ">http://tinyurl.com/7llvcbl</a><br /><br />Please take a minute to RSVP&nbsp;on Facebook and invite your friends at:<br /><a href="http://www.facebook.com/#!/events/234651989959084/" title="http://www.facebook.com/#!/events/234651989959084/">http://www.facebook.com/#!/events/234651989959084/<br /></a><br />To be notified of future events please join our facebook group:<br /><a rel="nofollow" href="https://www.facebook.com/groups/365100186834821/" target="_blank">https://www.facebook.com/groups/365100186834821/</a><br /><br />*** PLEASE DO NOT BRING ANY BROKEN, UNUSABLE JUNK ***<br />-No completely worn out clothing or shoes with holes, stains, etc.<br />-No non-working electronics<br />-No expired food items<br />-etc.</p>', '2012-03-04 00:00:00', '2000-01-01 15:00:00', '2000-01-01 18:00:00', 'Barlow Event Center 1151 NW Civic Center Dr', 'Free Market - Rochester MN', '', 'fmrochmn@gmail.com', '', 'http://maps.google.com/maps?q=1151+civic+center+dr&oe=utf-8&rls=org.mozilla:en-US:official&client=firefox-a&um=1&ie=UTF-8&hq=&hnear=0x87f75f0b2cc8c6ed:0x960a95147b0f92c2,1151+Civic+Center+Dr+NW,+Rochester,+MN+55901&gl=us&ei=X20QT7bvD6iLsgLI7M3rAw&sa=X&oi=geocode_result&ct=title&resnum=1&ved=0CCAQ8gEwAA', 'FREE!!', 'https://www.facebook.com/groups/365100186834821/', 1, '2012-02-24 15:05:32', '2012-02-24 15:05:32'),
(421, 5, 'Vegetarian Potluck, April 25th at the Rochester Public Library', '<p>Wed.&nbsp;April 25th,&nbsp;6:30pm</p><p>Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>See you there!</p>', '2012-04-25 00:00:00', '2000-01-01 18:30:00', '2000-01-01 19:30:00', 'Rochester Public Library, Meeting Room B (on the second floor)', 'Kati Berg', '507-259-1490', 'katiberg@kw.com', '', '', 'Free', '', 1, '2012-03-07 09:07:20', '2012-03-07 09:09:01'),
(422, 5, 'Vegetarian Potluck, May 23rd at the Rochester Public Library', '<p>Wed.&nbsp;May 23rd,&nbsp;6:30pm</p><p>Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>&nbsp;JUNE &amp; JULY POTLUCKS WILL BE AT <u>QUARRY HILL NATURE CENTER</u> 6:30PM 4TH WEDNESDAY OF EACH MONTH.&nbsp; </p><p>See you there!</p>', '2012-05-23 00:00:00', '2000-01-01 18:30:00', '2000-01-01 19:30:00', 'Rochester Public Library, Meeting Room B (on the second floor)', 'Kati Berg', '507-259-1490', 'katiberg@kw.com', '', '', 'Free', '', 1, '2012-03-07 09:08:30', '2012-05-21 09:51:49'),
(423, 4, 'Healthy Green Living Show', '<p>Volunteers Needed!&nbsp; Please man our booth for a couple hours Saturday or Sunday.&nbsp; Hand out Vegetarian Information, give out veggie samples, answer questions about vegetarianism.</p>', '2012-03-24 00:00:00', '2000-01-01 10:00:00', '2000-01-01 05:00:00', 'Rochester Mayo Civic Center', 'Kati Berg', '259-1490', 'katiberg@kw.com', '', '', 'Free when you print out the guest pass posted on our website, www.vigr.org.  Otherwise $3 or $2 with a food donation to Channel One.', '', 1, '2012-03-07 09:19:39', '2012-03-18 20:15:17'),
(424, 4, 'Healthy Green Living Show', '', '2012-03-25 00:00:00', '2000-01-01 10:00:00', '2000-01-01 05:00:00', 'Rochester Mayo Civic Center', 'Kati Berg', '259-1490', 'katiberg@kw.com', '', '', 'Free when you print out guest pass.  Otherwise $3 or $2 with a food donation to Channel One.', '', 1, '2012-03-07 09:20:12', '2012-03-07 09:20:12'),
(425, 4, 'April Free Market (Live Music and Refreshments)', 'This ''Free Market'' is a community gathering where anyone brings whatever they want to give away for free or just come see what you can find. Participants donate clean & usable items, services, and information absolutely free. Bring clean/usable old clothes, CD''s, electronics, household items, canned food, etc. Once the event is over, any remaining items will be donated to one of the local second-hand outlets.</br></br>\r\n\r\nThis months ''Free Market'' will feature:</br>\r\n- LIVE MUSIC by Ellen Thomes http://www.myspace.com/ellenthomes</br>\r\n- Time Trader Orientation at 3:30 http://www.familyservicerochester.org/timetrader.html\r\n</br></br>\r\nSpring has sprung! Bring your perennial offshoots and indoor starter seedlings.\r\n\r\n</br></br>\r\nFind this event on Facebook:</br>\r\nhttp://www.facebook.com/events/283465421729498/\r\n</br></br>\r\nTo see pictures and be notified of updates join our facebook page:</br>\r\nhttp://www.facebook.com/FreeMarketRochesterMn\r\n</br></br>\r\n*** PLEASE DO NOT BRING ANY BROKEN, UNUSABLE JUNK ***</br>\r\n-No completely worn out clothing or shoes with holes, stains, etc.</br>\r\n-No non-working electronics</br>\r\n-No expired food items</br>\r\n-etc. </br>', '2012-04-15 00:00:00', '2000-01-01 15:00:00', '2000-01-01 18:00:00', 'Barlow Event Center 1151 NW Civic Center Dr', 'Free Market - Rochester, MN', '', 'fmrochmn@gmail.com', '', '', 'Free', 'http://www.facebook.com/events/283465421729498/', 1, '2012-04-10 09:29:01', '2012-04-10 09:34:15'),
(426, 4, 'May 6th Free Market (Live Music)', 'This ''Free Market'' is a community gathering where anyone brings whatever they want to give away for free or just come see what you can find. Participants donate clean &amp; usable items, services, and information absolutely free. Bring clean/usable old clothes, CD''s, electronics, household items, canned food, etc. Once the event is over, any remaining items will be donated to one of the local second-hand outlets.<br /><br />This months ''Free Market'' will feature:<br />- LIVE MUSIC Thomas and the Rain -&nbsp;http://www.facebook.com/#!/thomasandtherain<br />- Time Trader Orientation at 3:30 http://www.familyservicerochester.org/timetrader.html <br /><br />Spring has sprung! Bring your perennial offshoots and indoor starter seedlings. <br /><br />Find this event on Facebook:<br /><a href="http://www.facebook.com/#!/events/446896815326242/">http://www.facebook.com/#!/events/446896815326242/</a><br /><br />To see pictures and be notified of updates join our facebook page:<br />http://www.facebook.com/FreeMarketRochesterMn <br /><br />*** PLEASE DO NOT BRING ANY BROKEN, UNUSABLE JUNK ***<br />-No completely worn out clothing or shoes with holes, stains, etc.<br />-No non-working electronics<br />-No expired food items<br />-etc. ', '2012-05-06 00:00:00', '2000-01-01 15:00:00', '2000-01-01 18:00:00', 'Barlow Event Center 1151 NW Civic Center Dr', 'Free Market - Rochester, MN', '', 'fmrochmn@gmail.com', '', '', 'Free', 'http://www.facebook.com/#!/events/446896815326242/', 1, '2012-04-30 19:26:56', '2012-04-30 19:26:56'),
(427, 5, 'Summer Veg Potluck at Quarry Hill Park Pavillion, June 27', '<p>Wed. June 27th,&nbsp;6:30pm</p><p>June and July Potlucks will be at Quarry Hill Park the 4th Wednesday of the month at 6:30.&nbsp; We''ll eat at the Pavillion just next to the Nature Center.</p><p>Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>See you there!</p>', '2012-06-27 00:00:00', '2000-01-01 18:30:00', '2000-01-01 19:30:00', 'Quarry Hill Nature Center, Outdoor Pavillion', 'Kati Berg', '507-259-1490', 'katiberg@kw.com', '', '', 'Free', '', 1, '2012-05-21 09:44:43', '2012-05-21 09:44:59'),
(428, 5, 'Summer Veg Potluck at Quarry Hill Park Pavillion, July 25', '<p>Wed. July 25th,&nbsp;6:30pm</p><p>June and July Potlucks will be at Quarry Hill Park the 4th Wednesday of the month at 6:30.&nbsp; We''ll eat at the Pavillion just next to the Nature Center.</p><p>Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>See you there!</p>', '2012-07-25 00:00:00', '2000-01-01 18:30:00', '2000-01-01 19:30:00', 'Quarry Hill Nature Center, Outdoor Pavillion', 'Kati Berg', '507-259-1490', 'katiberg@kw.com', '', '', 'Free', '', 1, '2012-05-21 09:46:25', '2012-05-21 09:46:25'),
(429, 5, 'Vegetarian Potluck, Aug. 22 at the Rochester Public Library', '<p>Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>6:30PM 4th Wednesday of the month, at the&nbsp;Library, Aug. 22, Sept. 26, Oct. 24th.&nbsp;&nbsp; (Usually we''re in Meeting Room B on the second floor, but sometimes if that is occupied we''re in Meeting Room A on the main level.)</p><p>Parking on the street or in the ramp are both FREE after 5pm. </p><p>See you there!</p><p>&nbsp;</p>', '2012-08-22 00:00:00', '2000-01-01 18:30:00', '2000-01-01 19:30:00', 'Rochester Public Library, Meeting Room B (on the second floor)', 'Kati Berg', '507-259-1490', 'katiberg@kw.com', '', '', 'Free', '', 1, '2012-07-25 14:53:20', '2012-07-25 14:54:59'),
(430, 5, 'Vegetarian Potluck, Sept. 26 at the Rochester Public Library', '<p>Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>6:30PM 4th Wednesday of the month, at the&nbsp;Library, Sept. 26, Oct. 24th.&nbsp;&nbsp; (Usually we''re in Meeting Room B on the second floor, but sometimes if that is occupied we''re in Meeting Room A on the main level.)</p><p>Parking on the street or in the ramp are both FREE after 5pm. </p><p>See you there!</p><p>&nbsp;</p>', '2012-09-26 00:00:00', '2000-01-01 18:30:00', '2000-01-01 19:30:00', 'Rochester Public Library, Meeting Room A (on the first floor)', 'Kati Berg', '507-259-1490', 'katiberg@kw.com', '', '', 'Free', '', 1, '2012-07-25 14:56:02', '2012-07-25 14:56:38'),
(431, 5, 'Vegetarian Potluck, Oct. 24 at the Rochester Public Library', '<p>Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>6:30PM 4th Wednesday of the month, at the&nbsp;Library, Oct. 24th.&nbsp;&nbsp; (Usually we''re in Meeting Room B on the second floor, but sometimes if that is occupied we''re in Meeting Room A on the main level.)</p><p>Parking on the street or in the ramp are both FREE after 5pm. </p><p>See you there!</p><p>&nbsp;</p>', '2012-10-24 00:00:00', '2000-01-01 18:30:00', '2000-01-01 19:30:00', 'Rochester Public Library, Meeting Room B (on the second floor)', 'Kati Berg', '507-259-1490', 'katiberg@kw.com', '', '', 'Free', '', 1, '2012-07-25 14:57:56', '2012-07-25 14:57:56'),
