(433, 5, 'Vegetarian Potluck, Nov. 28, at the Rochester Public Library', '<p>\r\nHappy Thanksgiving!  Join us after your family celebrations for our monthly Wed. night potlucks.  Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>6:30PM 4th Wednesday of the month, at the&nbsp;Library, <p>Parking on the street or in the ramp are both FREE after 5pm. </p><p>See you there!\r\n\r\nPlease note: There will be no potluck in December.  ', '2012-11-28 00:00:00', '2000-01-01 18:30:00', '2000-01-01 19:30:00', 'Rochester Public Library, Meeting Room A (on the first floor)', 'Kati Berg', '507-259-1490', 'katiberg@kw.com', '', '', 'Free', '', 1, '2012-10-25 20:01:58', '2012-11-19 17:44:00'),
(434, 5, 'Vegetarian Potluck, Jan. 30, at the Rochester Public Library', '<p>\r\nHappy New Year!  Join us this last Wed. of January for a vegetarian potluck. Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>6:30PM at the&nbsp;Library, Meeting Room B on the second floor. <p>Parking on the street or in the ramp are both FREE after 5pm. </p><p>See you there!\r\n\r\nFebruary potluck will resume on the 4th Wed. of the month, Feb. 27th 6:30pm. \r\n\r\n', '2013-01-30 00:00:00', '2000-01-01 18:30:00', '2000-01-01 19:30:00', 'Rochester Public Library, Meeting Room B (on the second floor)', 'Kati Berg', '507-259-1490', 'katiannberg@gmail.com', '', '', 'Free', '', 1, '2012-12-13 07:11:10', '2012-12-13 07:11:54'),
(435, 5, 'Vegetarian Potluck, Feb. 27, at the Rochester Public Library', '<p>\r\nJoin us for a vegetarian potluck. Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>6:30PM at the&nbsp;Library, Meeting Room B on the second floor. <p>Parking on the street or in the ramp are both FREE after 5pm. </p><p>See you there!\r\n\r\n\r\n', '2013-02-27 00:00:00', '2000-01-01 18:30:00', '2000-01-01 19:30:00', 'Rochester Public Library, Meeting Room B (on the second floor)', 'Kati Berg', '507-259-1490', 'katiannberg@gmail.com', '', '', 'Free', '', 1, '2012-12-13 07:13:58', '2012-12-13 07:13:58');
