INSERT INTO `posts` (`id`, `title`, `body`, `created_at`, `updated_at`, `author_id`) VALUES
(1, 'VIGOR Grill Year 5 Rochester Fest 2008 ', '<p><font size="2">VIGOR sets up a six day&nbsp;food vending booth at Rochester''s Beginning of Summer Celebration.&nbsp; We offer a healthy, wholesome and compassionate option to the festival.</font></p><p><font size="2">Vigor Grill was featured on <a href="http://www.kttc.com/Global/story.asp?s=8543901">KTTC </a>this year</font><font size="2">.&nbsp;</font></p><p><font size="2">Take a look at our <a href="../../uploads/vigor%20grill.pdf">2008 brochure</a>.&nbsp;&nbsp;</font> </p><p><font size="2"><strong>2008 Rochesterfest&nbsp;Our Best Year Yet!</strong> VIGOR increased their sales by 42%!&nbsp;We had a very successful&nbsp;2008&nbsp;with many thanks to the Good Food Store and the Backroom Deli, Rudi''s Organic Bakery, Food for Life, Turtle Mountain,&nbsp;HyVee and Whole Grain Milling for donations.<br /></font></p><p><a href="http://www.rochesterfest.com"><font size="2">Rochesterfest Website</font></a></p><strong><font size="3">On the 2008&nbsp;Vegan Menu<br /></font></strong><blockquote style="background-color: #ffffff"><p><font size="2" color="#000000">Portobello Burgers<br />India Pakora Fries<br />Cajun Tofu Wraps<br />Ezekiel Bean Burritos<br />Garden Salads<br />SW Black Bean Salads<br />Rootbeer Floats<br /></font></p></blockquote><p><font size="2">We are a 501(c)3 non-profit organization, and this operation depends on sponsors and volutneers for its success.&nbsp; All proceeds will go to VIGOR and used to promote vegetarianism.&nbsp;</font></p><p><font size="2"><strong>To Volunteer please contact:</strong><br />Jaben Kitson</font><br /><font size="2"><a href="mailto:jaben_kitson@yahoo.com">jaben_kitson@yahoo.com</a><br />(507)273-5806</font></p><p><font size="2"><a href="http://www2.snapfish.com/thumbnailshare/AlbumID=172034056/a=100952670/t_=100952670" target="_blank" title="2007 Pictures (Monday)"><br /></a></font></p>', '2008-05-30 08:20:00', '2008-07-30 09:53:59', NULL),
(3, 'Rochester''s Best', '<font size="2"><strong>Rochester Magazine''s 2007 Best of Restaurant''s contest results are in.</strong></font><p><font size="2">Thanks to the people of <a href="http://www.rochestermn.com/">Rochester Magazine</a> for holding the contest of Rochester''s Favorite Restaurants of 2007.</font></p><p><font size="2">The <a href="http://www.backroomdeli.com">Backroom Deli</a> of the Good Food Store Co-op was voted the Best Health Food and Best Vegetarian Selection again!</font></p><p><font size="2">The Backroom Deli features daily soups and posts them on their website every morning for your convenience.   A variety of <strong>gluten free</strong> deli salads (including gluten free pasta), wraps and soups are available as well.   Even those who are not into Vegan or Vegetarian food will be surprised how delicious and satisfying the Deli''s Oat Pecan Burger or Cajun Tofu sandwhich are.</font></p><p><font size="2">Enjoy the new experience, dine at the deli voted Best Health Food and Vegetarian Selection for 2007.   Thanks for everyone who voted and if you would like to vote for next years selection stay tuned in November for details.<br />References</font></p><p>    * <a href="http://www.backroomdeli.com">The Backroom Deli</a><br />    * <a href="http://www.rochestermn.com/">RochesterMN.com</a></p>', '2007-02-18 08:08:00', '2008-06-13 08:18:00', NULL),
(4, 'Health Benefits of a Plant based diet', '<font size="2"><strong>According to studies outlined in PCRM (Physicians Committee for Responsible Medicine) avoiding animal products in the diet has many health benefits.</strong></font><p><font size="2">According to studies outlined in PCRM article Vegetarian Foods: Powerful for Health vegetarians are about 40 percent less likely to develop cancer compared to meat-eaters. Japanese women who adapt a western diet are more likely to develop breast cancer. Vegetarian''s contain more white blood cells than meat- eaters.</font></p><p><font size="2">Cholesterol cannot be found in a plant based diet. As long as trans fatty acids from hydrogenated oils are avoided, a vegetarian diet will not cause cholesterol buildup in the arteries. In fact a vegan diet can actually help reverse atherosclerosis and lower blood pressure.</font></p><p><font size="2">A vegan diet has also been effective in regulating blood sugars helping in prevention and reversing of diabetes.</font></p><p><font size="2">A diet high in protein causes the body to excrete large amounts of calcium and other minerals that can lead to osteoporosis, kidney stones and gallstones.</font></p><p><font size="2">Asthma has also been shown to be higher in people not eating vegan diets.</font></p><p><font size="2"><strong>What''s Wrong with Dairy Products?</strong><br />The high cholesterol content in dairy increases risk of cardiovascular disease.</font></p><p><font size="2">Dairy may contain calcium but it has been linked to the onset of osteoporosis. The calcium in dairy is not absorbed and utilized as the calcium in spinach, kale, almonds or wheat grass is. And, the high protein level can lead to the depletion of calcium in your body. D toxicity from milk can also increase the outflow of calcium.</font></p><p><font size="2">Consumption of dairy has been directly linked to the ineffectiveness of insulin and the onset of Type one diabetes.</font></p><p><font size="2">Dairy consumption has been shown to triple a women''s likely hood of developing breast cancer.</font></p><p><font size="2">Mothers who drink milk pass cow antibodies along to their nursing infants through their breast milk. These antibodies can cause colic.</font></p><p><font size="2">Dairy contains lactose which is a problem for those who are lactose intolerant. Specifically it causes gastrointestinal distress, diarrhea, and flatulence. 95 percent of Asian Americans, 74 percent of Native Americans, 70 percent of African Americans, 53 percent of Mexican Americans, and 15 percent of Caucasians are lactose intolerant.</font></p><p><font size="2">Milk is often contaminated in factory farming because cows are fed hormones to increase production. This can result in mastitis, enlarged and infected utters, that is often treated with antibiotics that make it into the milk along with pesticides and other drugs.<br />References</font></p><p>    * <a href="http://www.pcrm.org/">Physicians Committee for responsible medicine</a><br />    * <a href="http://www.pcrm.org/health/veginfo/vegetarian_foods.html">Vegetarian Foods: Powerful for Health</a><br />    * <a href="http://www.pcrm.org/health/veginfo/dairy.html">What''s Wrong with Dairy Products?</a></p>', '2006-05-12 08:28:00', '2008-06-13 08:34:14', NULL),
(5, 'Label Reader''s Guide', '<strong>A quick guide for ensuring that a meal is completely plant based and healthy</strong><p>The best way to ensure that your food is plant based is to only eat things that come in their own package like an avocado, almond or pomegranate. And to make sure it''s healthy buy organic, or better yet get to know your local organic farmer.</p><p>However this is not entirely realistic for most of us at present. Luckily food is required to be labeled. If you see <a href="http://www.rawdc.org/food/veglogo.html">Vegan labels and logos</a> this ensures that it is completely plant based.</p><p>We need to read the ingredient list for those products without vegan labels. Obvious red light items are anything with the word milk, butter, egg, stock or lard on the label.</p><p>Watch for animal derived ingredients such as whey, lactose, casein, Worcestershire sauce, caramel and mayonnaise. To the novice these might easily be mistaken for vegan ingredients when in fact they are not. Most soy cheese products contain whey or casein in them. Honey is not considered to be vegan. Caramel may be made from sugar, butter, cream or milk, and flavoring.</p><p>Natural flavors can be basically anything that wasn''t synthetically produced, so you may have to call the company to make certain natural flavors are not animal derived</p><p>Check the label for nutritional information. If cholesterol is not 0, it contains animal fat. Cholesterol is not found in plant based products, not even coconuts. Although TFAs (trans fatty acids) found in hydrogenated oils will cause blood cholesterol to build up.</p><p>Marshmallows are actually not vegetarian. They are made from cartilage The same goes for gelatin and Jello brand desserts.</p><p>What about chocolate? Cocoa butter is made from the cocoa bean, so it is vegan. However most chocolate has animal products added to it. Look for ingredients such as whey, milk, or milk fat on the package. These are all animal derived.</p><p>Like Chinese or East Asian food? Hoi sin or duck sauce does not have animal products in it so you''re safe there, but fish sauce and oyster sauce do contain fish and other creatures of the sea.</p><p>What about beer? You might be surprised to find that some beers are filtered through products derived from animals such as isinglass and gelatin. See <a href="http://www.veganvanguard.com/vegism/beer.html">VeganVanguard</a> for more information...</p><p>Quick List of common ingredients that contain or may contain animal products:<br />Milk, Butter, Eggs, Chicken or beef stock or broth, Lard, Beef fat, Whey, Lactose, Casein, Worcestershire sauce, Mayonnaise, Calcium lactate, Caramel, Gelatin, Marshmallows, Fish sauce, Oyster Sauce, Cholesterol, Glycerin, Honey</p><p><a href="http://www.peta.org/">PETA</a> has a <a href="http://www.caringconsumer.com/resources_ingredients.asp">list of animal products</a> to avoid in your diet and in products such as shampoo. This is a pretty comprehensive list, but it is missing a few items that may or may not be animal based. For example calcium lactate may be animal derived. Glycerin or cellulose may or may not be vegetarian as well.</p><p>If you are concerned about GMOs, you should know that products with GMO ingredients are not required to be labeled as so. Corn, soy and canola (rapeseed) are the most likely of foods to be GMO. The only way to make sure they are not is to buy certified organic. If you have ever had a soda which contains corn syrup, you have most likely consumed GMO corn. Many processed foods contain soy lecithin, corn syrup or canola oil in them. For more information on GMOs and organic certification see the article titled monkeys choose organic.<br />References</p><p>    * <a href="http://www.rawdc.org/food/veglogo.html">Vegan labels and logos</a><br />    * <a href="http://www.veganvanguard.com/vegism/beer.html">VeganVanguard</a><br />    * <a href="http://www.peta.org/">PETA</a><br />    * <a href="http://www.caringconsumer.com/resources_ingredients.asp">list of animal products</a></p>', '2006-05-12 09:06:00', '2008-06-13 09:15:17', NULL),
(6, 'VIGOR in the News', 'Rochester''s Post Bulletin journalist, D.A. Loeser Small, has a GreenSpace column in the paper.&nbsp;&nbsp; She recently featured VIGOR in her column - <a href="http://www.postbulletin.com/newsmanager/templates/localnews_story.asp?z=51&amp;a=353995">Promoting the ''most eco-friendly diet'' with VIGOR</a>', '2008-07-30 09:40:00', '2008-07-30 09:57:54', NULL),
(7, 'Veg Friendly Restaurants in Rochester', '<font size="2">We''ve had many requests from vegetarians new to the Rochester area or visiting inquire about the vegetarian options at restaurants in Rochester.<br /><br /></font><p><font size="2">Most restaurants, especially the ones with waitresses and chef''s in the back are very happy and sometimes excited to come up with vegetarian or vegan customized specials. So do not be shy to ask for vegan options. If they don''t know the word vegan, I dare you to ask which items don''t contain something chopped off or squeezed out of an animal ;) On second thought maybe tactful and compassionate is better. </font></p><p><font size="2">Here is a quick list of favorites amongs the VIGOR board members. We do plan to expand upon this list with indepth interviews from select restaurants as well as with entries in a new reviews database currently under construction.</font></p><p><font size="2">I''ve split the list into two categories. Fast means relatively fast, at least a good option for lunch hour. <br />Slow refers to a restaurant with a wait staff where you sit first and then order at your table.</font></p><p><font size="2">*****<br />FAST <br />*****</font></p><p>&nbsp;</p><p><font size="2">---------------------------------------------------<br />The Good Food Store Backroom Deli<br />---------------------------------------------------<br />Phone: 507-289-9061<br />1001 6th St NW<br /><a href="http://www.backroomdeli.com">www.backroomdeli.com</a></font></p><p><font size="2">Many vegan home grown recipes and mostly organic. Located in the Good Food Co/op. Great for lunch or for takehome salads, soups and burgers.</font></p><p><font size="2">--------------------------------------------------<br />Clay Oven<br />--------------------------------------------------<br />Suite 200 , 2711 Commerce Drive NW Rochester. <br />507-208-4300 <br />clayovenrochester.com</font></p><p><font size="2">Clay Oven restaurant has a number of vegan dishes available at their restaurant and the daily lunch buffet typically has several items which are vegan. </font></p><p><font size="2">It is a small boutique type restaurant . They open for lunch M-Sat 11 am-2 pm and for dinner from 5pm-9pm.</font></p><p><font size="2">All items are cooked fresh.</font></p><p>&nbsp;</p><p><font size="2">---------------------------------------------------</font></p><p><font size="2">India Curry House Downtown lunch buffet<br />---------------------------------------------------<br />(507) 288-5001<br />10am-3pm<br />They cater downtown in the Breckenridge skyway (by shops at University Square) between the galleria and 2nd Street SW. <br />It is buffet style with somosas, pakora, naan and a few curries and rices. <br />The prices are very reasonable and they always have vegetarian options.</font></p><p><font size="2">---------------------------------------------------<br />Noodles &amp; Co. <br />---------------------------------------------------<br />3944 Marketplace Dr NW Rochester, MN 55901 (507)285-1111<br />4607 Maine Ave SE Rochester, MN 55904 (507)393-6996<br /><a href="http://www.noodles.com">www.noodles.com</a></font></p><p><font size="2">All entrees are vegetarian, most vegan. Tofu or meat are available as add ons.</font></p><p><font size="2">---------------------------------------------------<br />Z Pizza<br />---------------------------------------------------<br />(507) 424-0440<br /><a href="http://www.zpizza.com">www.zpizza.com</a><br />111 S Broadway<br />Rochester, MN 55904</font></p><p><font size="2">Z pizza has vegan cheese. They also have veggie burger crumbles and many veggie options like avocados and artichoke for example. <br />The mexican style with veggie burger instead of chicken is great. They''re pizzas are light on the tomato sauce, but good. Expect $10 per person. <br />They also have salads and Calzones. As far as pizza goes, it''s not Pizza Luce but it is vegetarian friendly.</font></p><p><font size="2">---------------------------------------------------<br />Panera Bread Co. (2Locations)<br />---------------------------------------------------<br />Market Place Drive <br />3780 Market Place Drive NW<br />Rochester, MN 55901<br />(507) 280-9185 | phone<br />(507) 280-9186 | fax<br />free Wi-Fi hotspot<br /><br />Crossroads Drive<br />460 Crossroads Drive SW<br />Rochester, MN 55902<br />(507) 285-5800 | phone<br />(507) 285-5900 | fax<br />free Wi-Fi hotspot</font> </p><p><a href="http://www.panerabread.com"><font size="2">www.panerabread.com</font></a></p><p><font size="2">Always has a soup or two that''s vegan. Black bean and garden vegetable. They have additional vegetarian soups as well.<br /><br />Their dutch apple bagel and blueberry bagel ingredient list appears to be vegan. They have avocados and also soy milk.<br /><br />They do not have vegan cream cheese, but the South location is next door to HyVee which sells vegan tofutti cream cheese.</font></p><p><font size="2">---------------------------------------------------<br />Chipolte Mexican Grill (2 Locations)<br />---------------------------------------------------<br />1201 S Broadway, Rochester - (507) 529-5484<br />3780 Marketplace Dr NW, Rochester - (507) 288-9171<br /><a href="http://www.chipotle.com">www.chipotle.com</a></font></p><p><font size="2">The black bean burrito with salsas and guacamole is vegan and (caution) easily habbit forming.</font></p><p><font size="2">---------------------------------------------------<br />China Star<br />---------------------------------------------------<br />405 1st Ave SW, Rochester - (507) 281-0014<br />2808 41st St NW, Rochester - (507) 281-3905<br />1505 Highway 14 E, Rochester - (507) 285-5924</font></p><p><font size="2">The Schezuan Tofu is VIGOR President Kati''s favorite on the menu, but they have other vegan options as well.</font></p><p><font size="2">---------------------------------------------------<br />Taco Bell<br />---------------------------------------------------<br />516 N Broadway, Rochester - (507) 282-1868<br />215 Apache Mall, Rochester - (507) 282-1650<br /><a href="http://www.tacobell.com">www.tacobell.com</a></font></p><p><font size="2">4000 Marketplace Dr NW, Rochester - (507) 292-1863<br />Order anything substitute beans for meat and make fresco style. If you order fresco style they automatically remove all dairy items and add pico de gallo! <br /><br />It''s pretty cool to be able to order something on the menu without asking for weird substitutes. <br />Just say: <br />- 7-layer burrito fresco style, add quacamole. <br />- Bean burrito fresco style.</font></p><p><font size="2">************************************<br />SLOW FOOD (Sit down and be waited on)<br />************************************</font></p><p><font size="2">--------------------------------------<br /></font><font size="2">O''Neill''s Pizza &amp; Pub<br />--------------------------------------<br />1201 S. Broadway<br />507-529-1200  </font></p><p><font size="2">O''neill''s has vegan dough and vegan cheese for a fullfilling dine ine vegan pizza experience.&nbsp; They also have a vegan bake at home to go menu.&nbsp; The dough balls freeze well for your convenience making it easy to create vegan pizza creations at home.</font></p><p><font size="2">Salad Dressing- pint   $4.00<br />Pasta Sauce-    pint    $4.00<br />Pizza Sauce-    pint    $4.00<br />Dough Balls-    small    $1.25                     <br />                     large   $1.50<br />Sheeted Dough- small  $1.75                       <br />                      large   $2.25<br />Cucumber Sauce/Dip- pint $4.50  </font> </p><p>&nbsp;</p><p><font size="2">---------------------------------------------------<br />India Curry House<br />---------------------------------------------------<br />507-288-5001<br />1647 South Broadway<br />Rochester, MN 55904</font></p><p><font size="2">South &amp; North Indai Cuisine,India Curry House is a fine dining restaurant to visit for delicious authentic North <br />and South Indian cuisine. <br />---------------------------------------------------<br />Prescott''s <br />---------------------------------------------------<br />507-536-7775<br />Crossroads Shopping Center<br />1201 South Broadway<br />Rochester, MN 55904<br /><a href="http://www.prescottsgrill.com">www.prescottsgrill.com</a></font></p><p><font size="2">Has a vegetarian chef and they have great vegan options actually on the menu. <br />Super fancy meal (i.e. $20 a plate plus) </font></p><p><font size="2">---------------------------------------------------<br />India Garden <br />---------------------------------------------------<br />(507) 288-6280<br />1107 N Broadway, Rochester, MN 55906</font></p><p><font size="2">India Garden has been in town for over a decade and have many vegan options and a nice lunch buffet.</font></p><p><font size="2">---------------------------------------------------<br />Vietnamese Caf&eacute;<br />---------------------------------------------------<br />507-281-3242<br />1014 N Broadway </font></p><p><font size="2">Offers 16 vegetarian dishes</font></p><p><font size="2">---------------------------------------------------<br />Phoa Hoa<br />---------------------------------------------------<br />(507) 281-9993 <br />1726 37th St NW, Rochester, MN 55901<a href="http://www.phohoa.com"><br /></a></font></p><p><font size="2">If you like TVP (texturized vegetable protein) and an inexpensive meal, you''ll love Phoa Hoa. </font></p><p><font size="2">---------------------------------------------------<br />Fiesta Mexicana (Fiesta Caf&eacute;) <br />---------------------------------------------------<br />(507) 288-1116<br />1645 N Broadway, Rochester, MN 55906</font></p><p><font size="2">Has a vegetarian section in the menu with chimichanga de papas and a fiesta burrito as well as a few others. <br />Note, the rice has chicken broth in it, but you can substitute with salad or fries.</font></p><p><font size="2">---------------------------------------------------<br />Dos Amigos <br />---------------------------------------------------<br />(507) 536-4527<br />1611 North Highway 52, Rochester, MN 55901</font></p><p><font size="2">(507) 282-3300<br />20 4th Street SE, Rochester, MN 55904</font></p><p><font size="2"><a href="http://dosamigosminnesota.com">dosamigosminnesota.com</a></font></p><p><font size="2">Dos Amigos has a few vegan options.&nbsp; The veggie fajitas are good.<br /><br />---------------------------------------------------<br />Zorbas Greek Restaurant<br />---------------------------------------------------<br />(507) 281-1540<br />924 7th St Nw, Rochester, MN 55901<br /><br />A Greek sit down restaurant with good food. It''s a quiet place that serves wine and typical greek entrees and desserts with several vegetarian and vegan options.</font></p><p><font size="2">---------------------------------------------------<br />McGoon''s Taxi Co. / Goonies Comedy Club<br />---------------------------------------------------<br />(507) 288-8130<br />7 2nd St SW<br />Rochester, MN 55902<br /><a href="http://mcgoonstaxi.com">mcgoonstaxi.com</a></font></p><p><font size="2">McGoons has an awesome vegetarian sandwich and it is great vegan too, just ask them to hold the cheese please.</font></p><p><br /><font size="2">---------------------------------------------------<br />Hu Hot<br />---------------------------------------------------<br />(507) 206-4422<br />102 Apache Mall<br />Rochester, MN 55902<br /><a href="http://www.huhot.com">www.huhot.com</a></font></p><p><font size="2">It is a Mongolian grill where you pick your own uncooked veggies and sauces out and bring it to the grill for them to grill it up in front of you. If you don''t mind a little cross contamination, this can be a fun and filling (all you can eat) occasion.&nbsp; They will clean a section of the grill off for you if you tell them you''re vegetarian.<br /></font></p>', '2008-08-27 07:59:00', '2011-01-21 14:12:15', NULL),
(8, 'United Nations Agree!', '<p>The top climate scientist of the United Nations says people should consider eating less meat as a way of combating global warming.&nbsp;&nbsp; </p><p><a href="http://news.bbc.co.uk/2/hi/science/nature/7600005.stm">http://news.bbc.co.uk/2/hi/science/nature/7600005.stm</a></p>', '2008-09-07 10:59:00', '2008-09-10 09:02:17', NULL),
(9, 'O''Neill''s Pizza & Pub reaches out to the vegan community', '<p><img src="../../images/oneills.jpg" alt="" width="269" height="178" align="left" /><font size="2">Believe it&nbsp;or not O''Neill''s Pizzeria called&nbsp;VIGOR asking for a couple of practicing&nbsp;vegans to try their vegan options to get our feedback!&nbsp; Four&nbsp;VIGOR members took O''Neill''s up on their challenge.&nbsp; We tried 3 different vegan&nbsp;pizzas &amp; bread sticks&nbsp;with our choice of&nbsp;Tzatziki Sauce, Greek Dressing, or Pizza Sauce.&nbsp; Their pizza is a simple homemade style thin pizza crust with a light spread of zesty pizza sauce topped with basic toppings.&nbsp; Everything was tasty especially with one of their many microbrew beers on tap. </font></p><p><font size="2">Currently vegan cheese, fresh gormet toppings and organic or gluten free options are unavailable but they do have tofu and co-owner of this family owned restaurant, Shannon O''neill, is actively working on developing new vegan toppings.&nbsp; If we can provide patronage they will be happy to work with us to provide more vegan options.&nbsp; So please visit O''neill''s and mention this article.&nbsp;</font> </p><p><font size="2"><strong>Ideas for dining in:</strong></font></p><p><font size="2">Ask for the vegan crust, dough made with soy milk.&nbsp; Otherwise they use cow''s milk. <br /></font></p><p><font size="2">Greek Pizza - Try their greek special but substitute crumbled tofu instead of feta and add greek peppers (mild yellow peppers).&nbsp; Ask for tzatziki sauce on the side.&nbsp; They use tofu instead of yogurt to make this vegan. </font></p><p><font size="2">Veggie - mushrooms, green bell pepper, onions, olives, tomatoes and optionally add pineapple.&nbsp; Ask for herb salad dressing (olive oil, garlic and oregano) on the side to pour over the pizza for additional flavor.<br /></font></p><p><font size="2">Mexican - tomatoes, onions, black olives, lettuce and taco sauce.&nbsp; Add sport peppers for a kick. </font></p><p><font size="2">The breadsticks are good too and if you have a sweet tooth, ask for vegan cinnamon rolls. </font></p><p><font size="2"><strong>Vegan To Go Menu:</strong></font></p><p><font size="2">If you would like to bake your own vegan pizza creations at home O''Neill''s has dough and sauces to go.&nbsp; </font><font size="2">The following is delicious: Gimmee lean sausage, sliced fresh garlic, sliced heirloom tomatoes, fresh broccoli and diced fresh (not dried) fig.&nbsp; Let the dough rise for an hour or so first in a warm location (100 - 120 degrees F).&nbsp; You can place the bag in hot water from the tap straight from the fridge.&nbsp; Note, put the sauce on thin in the middle or the crust will be too soft in the middle after baking.&nbsp; Bake at 500 degrees for about 10 minutes on a preheated pan or pizza stone. </font></p><p><font size="2">O''neill''s is located in Cross Roads at 1201 S. Broadway (507-529-1200). &nbsp; </font></p><p><font size="2">Salad Dressing&nbsp;&nbsp; (pint) &nbsp;&nbsp;&nbsp; $4.00 <br />Pasta Sauce&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (pint) &nbsp;&nbsp;&nbsp; $4.00 <br />Pizza Sauce&nbsp;&nbsp; &nbsp;&nbsp; (pint)&nbsp; &nbsp;&nbsp; $4.00 <br />Dough Balls&nbsp; &nbsp; &nbsp; (small) &nbsp;&nbsp; $1.25 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; <br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; &nbsp; (large) &nbsp;&nbsp;&nbsp; $1.50 <br />Sheeted Dough&nbsp;&nbsp; (small)&nbsp;&nbsp; $1.75 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; &nbsp;&nbsp; (large) &nbsp;&nbsp; $2.25 <br />Cucumber Sauce/Dip (pint) $4.50</font>&nbsp;&nbsp;</p>', '2008-09-14 18:58:00', '2008-09-18 11:17:06', NULL),
(10, 'Veganism spotlighted on super mainstream TV shows: Oprah, Ellen, Extra!', '<p>&nbsp;</p><p><a href="http://www.oprah.com/community/thread/90800"><strong><font color="#000000">Lisa Ling Reports: How We Treat the Animals We Eat</font></strong></a><strong><font color="#000000">&nbsp;<u>on Oprah</u></font></strong></p><p>Tuesday, October 14, Oprah&nbsp;covered &quot;How We Treat the Animals We Eat.&quot; Go to <a href="http://www.oprah.com/index">http://www.oprah.com/index</a> . On the screen on the rights side of your screen, click on &quot;Tue&quot; to see the promo video. You''ll see footage of horrendous battery cages and sow gestation crates, and hear HSUS''s Wayne Pacelle saying &quot;The issue is the decency toward the animals.&quot; He is no doubt talking about California''s Proposition 2, which would ban some of the most heinous caging. To read more; <a href="http://www.oprah.com/dated/oprahshow/oprahshow_20081008_animals">http://www.oprah.com/dated/oprahshow/oprahshow_20081008_animals</a>&nbsp;</p><p>The disscussion board already has over 700 post!<br /><a href="http://www.oprah.com/community/threads/90800?numResults=15&amp;filter=newest">http://www.oprah.com/community/threads/90800?numResults=15&amp;filter=newest</a></p><p><strong><u>Ellen Degeneres goes Vegan!</u>&nbsp;<br /></strong><br />Along with Oprah and millions of people across the country, Ellen read all about a healthy, compassionate diet in the popular book, <em>Skinny Bitch</em>. She then began inviting vegan chefs, featuring vegan menus, and interviewing vegan writers and activists on her daytime talk show. Then she had a full vegan wedding! Now, after hosting a benefit party for Proposition 2 in California to eliminate caging animals raised for food, Ellen announced her conversion to veganism! </p><p>With big celebrities like Oprah and Ellen being more food conscious, more and more people are learning about the treatment of farmed animals and delicious vegan alternatives. One by one, compassionate individuals are becoming inspired to make changes for the better. Congratulations to all of you for making a difference in this world!</p><p>Read more: <a href="http://www.ecorazzi.com/2008/10/02/its-official-ellen-degeneres-has-finally-gone-vegan">http://www.ecorazzi.com/2008/10/02/its-official-ellen-degeneres-has-finally-gone-vegan</a></p><p><strong><u>PCRM spotlighted on Extra&nbsp;<br /></u></strong><br />How wonderful to see mainstream media starting to really focus on what we should be eating and why. Dr Neal Barnard, founder of the wonderful Physicians Committee for Responsible Medicine (<a href="http://www.pcrm.org/">http://www.pcrm.org/</a> ) was on Extra on Friday talking about the benefits of vegan diets. You can watch the fun little segment here:<br /><a href="http://extratv.warnerbros.com/2008/10/goodbye_meat_hello_healthy.php">http://extratv.warnerbros.com/2008/10/goodbye_meat_hello_healthy.php</a>&nbsp;<br /><br /><br />&nbsp;<br />&nbsp;<br />&nbsp;</p>', '2008-10-14 21:38:00', '2008-10-14 22:06:41', NULL),
(11, 'Mayo Clinic Vegetarian Diet Info', '<p>Here is a link to the Vegetarian information that the Mayo Clinic has.</p><p><a href="http://www.mayoclinic.com/health/vegetarian-diet/HQ01596">http://www.mayoclinic.com/health/vegetarian-diet/HQ01596</a></p><p>&nbsp;</p>', '2009-01-04 17:24:00', '2009-01-04 17:28:10', NULL),
(12, 'Plant-based Diet Key to Longevity?', '<p>Here is a link to research that&nbsp;CNN''s Sanjay Gupta reported about on December 30th, 2008.</p><p>The center of the intersecting circles indicates that a plant-based diet may be&nbsp;a key to longevity.</p><p><a href="http://quest.bluezones.com/live-longer-better/longevity-secrets/">http://quest.bluezones.com/live-longer-better/longevity-secrets/</a></p><p>&nbsp;</p><p>&nbsp;</p>', '2009-01-04 17:42:00', '2009-01-04 17:45:26', NULL),
(13, 'Is There a Vegan In the White House? PETA, Rejoice!', '<p><font size="2">President Barack Obama </font><a href="http://online.wsj.com/article/SB123138051682263203.html"><font size="2">has appointed animal advocate Cass Sunstein</font></a><font size="2"> to head the relatively obscure, yet powerful Office of Information and Regulatory Affairs.</font></p><p>&nbsp;</p><p><font size="2">The regulatory czar, as the position is generally called, is responsible for every regulatory agency in the country, such as the EPA, and will oversee all administration rules. To Read more:</font></p><p><a href="http://planetsave.com/blog/2009/01/19/is-there-a-vegan-in-the-white-house-peta-rejoice/">http://planetsave.com/blog/2009/01/19/is-there-a-vegan-in-the-white-house-peta-rejoice/</a> </p>', '2009-01-21 13:18:00', '2009-01-22 14:37:50', NULL),
(14, 'Emerging Woman of Rochester Event', '<p>&nbsp;</p><p><font size="2">Sue Askildson, from Good Food Store Coop, will be&nbsp;Emerging Women guest speaker at the March general meeting of the Emerging Women of Rochester group.&nbsp; She will speak on &quot;Health &amp; Healing Through Nutrition&quot;.&nbsp;Susan will focus on raw &amp; vegan dishes that are simple and easy to make, just right for the warmer weather that will be coming soon.&nbsp; Using&nbsp; fresh organic produce, nuts, and seeds we will get to sample her Tomato Basil Soup, Onion Crackers, and Chocolate Cake.&nbsp; </font></p><p><font size="2">This event is for women only and is free!</font></p><p><font size="2">Join the Emerging Women of Rochester Wednesday, March 4th at 6:00 for this&nbsp;healthy living&nbsp;event.&nbsp;&nbsp;</font></p><p><font size="2">Please join us for an evening of fun and friendship. </font></p><p><font size="2">Quarry Ridge Clubhouse, 1823 Quarry Ridge Pl NW</font></p><p>&nbsp;</p><p><font size="2"><em><strong>&quot;For Women of all Ages in All Stages of Life&quot;</strong></em> </font></p><p><strong><em><font size="2">Go to the Emerging Women website for more information: &nbsp; </font><a href="http://www.ewofrochester.com/"><font size="2">http://www.ewofrochester.com/</font></a>&nbsp;</em>&nbsp;</strong></p>', '2009-02-25 09:15:00', '2009-02-25 10:53:54', 130),
(15, 'Eating Meat Kills More People Than Previously Thought ', '<p><font size="2"><strong>&nbsp;If you care about your health and your family &amp; friends health this is a MUST-READ!</strong></font></p><p><font size="2">After reading this article you will realize how dangerous it is for your health to be eating meat.</font></p><p><strong><font size="2"><a href="http://www.naturalnews.com/025957.html">http://www.naturalnews.com/025957.html</a> </font></strong></p><p><font size="2">The most ALARMING part is ''Death in Meat'' section: ''Research has shown that all meat eaters have worms and a high incidence of parasites in their intestines. This is hardly surprising given the fact that dead flesh (cadaver) is a favorite target for microorganisms of all sorts. The germs and parasites found in meat weaken the immune system and are the source of many diseases.''.....</font></p>', '2009-04-11 10:49:00', '2009-04-11 11:04:49', 130),
(16, 'PBS: Poisoned Water', '<p><font size="2">The meat industry causes more water pollution in the US than all other industries combined! Think about it, all that poop that comes from 10 billion animals that are raised for food, it has to go somewhere and a lot of it ends up contaminating our waterways in staggering amounts! (yikes) </font></p><p><font size="2">Please watch tonight on PBS: Poisoned Water: </font></p><p><a rel="nofollow" href="http://www.pbs.org/wgbh/pages/frontline/poisonedwaters/" target="_blank" onmousedown="UntrustedLink.bootstrap($(this), "><font size="2">http://www.pbs.org/wgbh/pages/frontline/poisonedwaters/</font></a></p>', '2009-04-21 10:15:00', '2009-04-21 10:19:06', 130),
(17, 'VIGOR Spotlighted in the News!', '<p><font size="2">&nbsp;On April 27th,the Post-Bulletin spotlighted&nbsp;the Vegetarian Information Group of Rochester by giving us a 3/4 spread article on one page! The on-line version doesn''t give the full effect like how it was&nbsp;presented in the paper. On-line version: </font></p><p><font size="2"><font size="3">&quot;Potlucks promote plant-based lifestyle&quot;&nbsp;article:</font>&nbsp;&nbsp;&nbsp;</font></p><p><font size="2"><a href="http://www.postbulletin.com/newsmanager/templates/localnews_story.asp?z=36&amp;a=396455">http://www.postbulletin.com/newsmanager/templates/localnews_story.asp?z=36&amp;a=396455</a></font></p>', '2009-04-28 09:53:00', '2009-04-28 10:09:51', 130),
(18, 'Green Smoothies (May Potluck Presentation)', '<font size="3"><strong>Basic Recipe</strong></font><p><font size="3">8 to 16 ounces (1 bunch) of leafy greens.  If consuming daily, it''s important to alternate between 12 different types of greens.<br />1 type of fruit to taste<br />2 to 3 cups water</font></p><p><font size="3"><strong>Some of the Benefits </strong></font></p><p><font size="3">&middot;	Green smoothies are a complete food abundant in vitamins, minerals, carbs, fiber and protein which will sustain health.  You can live off green smoothies alone (try a savory tomato and avocado green smoothie for variety and fat content).<br />&middot;	Where do you get your protein?  Same place that grass fed beef does.  Greens are abundant in protein.  USDA breakdown of amino acids in raw kale shows 450 grams (approximate amount for one quart of green smoothie) has %100 RDA of all essential protein amino acids.<br />&middot;	Fiber acts as little sponges that carry toxins to elimination. <br />&middot;	Chlorophyll has medicinal value for helping with countless diseases according to Victoria in &quot;Green for Life&quot;.</font></p><p><font size="3"><strong>Adjusting to eating greens</strong><br /><br />&middot;	Greens help your body detoxify, cleanse and alkalize while providing complete nutrition at the same time.<br />&middot;	Alkalizing and cleansing foods are in conflict with acid producing foods such as pop, alcohol and coffee.  When I eat too much acid producing food my appetite for green smoothies declines very quickly.<br />&middot;	Your taste pallet may take time to be accustomed to the bitterness of greens. <br />&middot;	Large quantities of green smoothies should be consumed on an empty stomach.  <br />&middot;	The HCL (hydrochloric acid) in your stomach may take time to replenish itself for optimal digestion.  Roseberg study shows green smoothies may help increase HCL acid in stomach. HCL is important to help digestion break down the food enough to extract the nutrition.</font> </p><p><font size="3"><strong>Boutenko Story from &quot;Green for Life&quot; by Victoria Boutenko (mother of green smoothies)</strong></font></p><p><font size="3">The Boutenko family of four in 1994: The father had progressive hypothyroidism and chronic rheumetoid arthritis at age 38. The mother, Victoria, had arrhythmia and edema, daughter had asthma and son was diagnosed with diabetes.  </font></p><p><font size="3">They went raw and all their diseases disappeared.  After 7 years raw though their teeth started to decay and hair turned grey and they lost their appetite for the food they had been eating.  Victoria Boutenko researched the Chimpanzee diet and then invented <br />green smoothies to mimic their nutrition.  Shortly after their appetite, tooth and hair health was restored and general health flourished.</font></p><p><font size="3"><strong>Chimp Diet </strong></font></p><p><font size="3">%25 - %50 dark green leafs and blossoms (percentages vary with seasons), about 50% fruit, and small quantities of bark, seeds and insects.</font></p><p><font size="3"><strong>Demo Recipes</strong></font></p><p><font size="3">Dandelion Mango<br />-----------------<br />3 mangos<br />1/2 bunch parsley<br />1/2 bunch dandelion greens<br />3 cups water</font></p><p><font size="3">Kale Apple<br />--------------<br />1/2 bunch kale<br />2 apples<br />1 meyer lemon<br />pinch ginger<br />2.5 cups water</font></p><p><font size="3"><br /><strong>What are the right choices for optimal health?</strong><br /><br />In his new book &quot;High Raw&quot;, Kevin Giani defines health simply as &quot;feeling your best&quot;.  He defines 5 principles of eating what he calls High Raw.  Go to <a href="http://www.gohighraw.com">www.gohighraw.com</a> for more information.  </font> </p><p><font size="3">I like defining feeling your best as the goal.  It helps to remember this when bombarded with so many opinions and studies on what to eat and what not to eat.  Being aware of your body and your sense of well being helps you identify and choose what''s best for your health at any given time.</font></p><p><font size="3">From my personal experience I believe the right nutrition and exercise are important but are not enough for optimal health.  We need awareness of our well being as a foundation for proper nutrition and exercise.  We need to avoid turning obstacles into stress via worry, anger or frustration.  Otherwise we tend to feed our emotions and suppress stress with unhealthy food and drugs.  With proper awareness we can see obstacles as challenges and embrace them in the mode of acceptance, enjoyment or enthusiasm.</font></p><p><font size="3">Boutenko Family Recipes and Info</font></p><p><font size="3">For more information visit <a href="http://www.rawfamily.com">www.rawfamily.com</a> and check out their new book &quot;Green Smoothie Revolution&quot;. Their newsletters online have free green smoothie recipes and also some of the Boutenko''s early recipes are published at <a href="http://wwwhomemakerinprogress.com/files/greensmoothies.pdf">http://www.homemakerinprogress.com/files/greensmoothies.pdf</a></font></p><p>&nbsp;</p>', '2009-05-21 14:30:00', '2009-05-21 14:35:26', 20),
(19, 'VIGOR at Thursday''s on First, Giving Deep Discounts to Promote Vegetarianism', '<p><font style="background-color: #ffffff"><font color="#000000"><font face="arial,helvetica,sans-serif" size="2">VIGOR is setting up at <a href="http://www.downtownrochestermn.com/">Thursdays on First Downtown Rochester</a> this summer open for business from 11:00am to 8:30pm </font><font face="arial,helvetica,sans-serif" size="2">every Thursday July 16th through August 27th!&nbsp; Our stand will be located near the stage on the south end of 1st avenue SW between 2nd and </font><font face="arial,helvetica,sans-serif" size="2">3rd streets.</font></font></font></p><p><font style="background-color: #ffffff"><font color="#000000"><font face="arial,helvetica,sans-serif" size="2">The first Thursday we plan to sell Oat Pecan Burgers&nbsp;and Blue Sky Organic soda catered by&nbsp;the <a href="http://www.rochestergoodfood.com">Good Food Store''s</a> Backroom Deli.</font><font face="arial,helvetica,sans-serif" size="2">&nbsp; To promote vegetarianism an anonymous VIGOR sponsor is subsidizing the food cost so we </font><font face="arial,helvetica,sans-serif" size="2">can give the veggie burger and soda combo away for a very low price!&nbsp; We plan to start out charging $1.00 </font><font face="arial,helvetica,sans-serif" size="2">for the combo and see how it goes.</font></font></font></p><p><font style="background-color: #ffffff"><font color="#000000"><font face="arial,helvetica,sans-serif" size="2">We encourage you to&nbsp;spread the word to non-vegetarians to get them to come&nbsp;down&nbsp;for a healthy yet delicious and filling vegan meal on VIGOR and take home s</font><font face="arial,helvetica,sans-serif" size="2">ome literature on the benefits of a plant-based diet.&nbsp; Please feel free to stop by and if you are&nbsp;already vegetarian </font><font face="arial,helvetica,sans-serif" size="2">we would appreciate a donation for the cause.&nbsp; The retail value of the </font><font face="arial,helvetica,sans-serif" size="2">soda and burger is $7.00.</font></font></font></p><p><font style="background-color: #ffffff"><font color="#000000"><font face="arial,helvetica,sans-serif" size="2">We also plan to sell homemade crafts (such as organic herbal fragrance sachets) or possibly garden items of VIGOR members who are interested in helping </font><font face="arial,helvetica,sans-serif" size="2">staff the food stand.&nbsp; Ideas on what to sell in the future are very welcome.&nbsp; Please fill out our <a href="../../contact">contact form</a>.</font></font></font></p>', '2009-07-09 12:51:00', '2009-09-08 18:37:08', 20),
(20, 'Thursdays on First Pictures', '<p>VIGOR gave away over 3,300 sandwhiches and soda at Thursdays on First this summer.&nbsp; We were able to set up 6 times on Thursdays throughout the summer&nbsp;thanks to our hard working volunteers and the Good Food Store for their catering and to our sponsor for paying for all of the food!</p><p><a href="../images/tf09/tof_e.jpg"><img src="../images/tf09/tn_e.jpg" border="0" alt="" width="130" height="97" /></a>&nbsp; <a href="../images/tf09/tof_b.jpg"><img src="../images/tf09/tn_b.jpg" border="0" alt="" width="130" height="97" /></a>&nbsp;&nbsp;<a href="../../images/tf09/tof_d.jpg"><img src="../images/tf09/tn_d.jpg" border="0" alt="" width="130" height="97" /></a>&nbsp;&nbsp;</p><p><a href="../images/tf09/tof_f.jpg"><img src="../images/tf09/tn_f.jpg" border="0" alt="" width="130" height="98" /></a>&nbsp; <a href="../images/tf09/tof_g.jpg"><img src="../images/tf09/tn_g.jpg" border="0" alt="" width="130" height="98" /></a>&nbsp; <a href="../images/tf09/tof_h.jpg"><img src="../images/tf09/tn_h.jpg" border="0" alt="" width="130" height="98" /></a></p><p>Here is the break down of what we gave away:<br />2,880 Oat Pecan Burgers<br />450 Boca &quot;Chick&quot; Pattis<br />3,200 Blue Sky Soda<br />750 PCRM vegetarian starter kits<br />750 PETA vegetarian starter kits<br />200 Chew on This DVDs<br />75 VIGOR potluck flyers<br />100 VIGOR Brochures</p>', '2009-09-14 09:29:00', '2009-09-14 10:35:28', 20),
(21, 'O''neill''s Pizza Pub Adds New Vegan Menu Items!', '<p><font face="arial,helvetica,sans-serif" size="3">VIGOR is&nbsp;excited to announce&nbsp;O''Neill''s Pizza Pub&nbsp;is adding a vegan cheese pizza to their menu in January and currently have it readily available for walk-in customers.&nbsp; The cheese is a Mozzarella style, vegan cheese alternative special ordered from Chicago for their vegan customers.&nbsp; And for those non-vegans watching their cholesterol, it''s cholesterol free!&nbsp; &nbsp; </font></p><p><font face="arial,helvetica,sans-serif" size="3">They also have new specialties available to order for take home and special occasions such as frosted chocolate cake and fruit cake (excellent choice for the holidays, yes it is actually good!), choco-chip cookie dough, artichoke dip, peanut brittle, Christmas cookies and more.&nbsp; Some of these items currently need to be pre-ordered.&nbsp; <br /></font></p><p><font face="arial,helvetica,sans-serif" size="3"><strong><font size="4">O''Neill''s Pizza Pub</font></strong><br />1201 S Broadway, #24, Rochester, MN 55904<br />507-529-1200</font></p>', '2009-12-17 21:25:00', '2009-12-17 21:41:48', 20),
(22, 'Special Announcement for POTLUCKS', '<p><font size="2"><strong>New Potluck Dates &amp; Times for 2010!</strong><br /></font></p><p><font size="2">We are back&nbsp;at the Rochester Public&nbsp;Library <strong>4th Wednesday of&nbsp;each month</strong>&nbsp;(except April)<strong>.</strong>&nbsp;We eat at 6:30 pm.&nbsp;The summer months at Quarry Hill Pavilion.(Please mark you calendar!)&nbsp; <br /></font></p><p><font size="2"><strong>Wednesday, February 24<sup>th</sup>, 6:30PM<br /></strong><em><strong>Rochester Public Library, Meeting Room B<br /></strong>Blending cashews makes a great cream sauce demonstration by Kati Berg</em></font></p><p><font size="2"><strong>Wednesday, March 24<sup>th</sup>, 6:30PM<br /></strong><em><strong>Rochester Public Library, Meeting Room B<br /></strong>Chia seeds are the richest natural source of pure omega-3, the only unprocessed whole food source of omega-3. Chia seeds are readily available and inexpensive to buy and easy to use! Demo&nbsp;about Chia Seeds by Julie Eyrich!</em></font></p><p><strong><font size="2">Wednesday, April 7<sup>th</sup>, 6:30PM<br /><em>Rochester Public Library, Meeting Room B</em></font></strong><br /><em><font size="2">Get ready for spring greens with a green smoothie demonstration by Jaben Kitson</font>&nbsp;</em></p><p><strong><font size="2">Wednesday, May 26<sup>th</sup>, 6:30PM<br /><em>Outdoors at the Quarry Hill Pavilion</em></font></strong></p><p><strong><font size="2">Wednesday June 23<sup>rd</sup>, 6:30PM<br /><em>Outdoors at the Quarry Hill Pavilion</em></font></strong></p><p><strong><font size="2">Wednesday, July 28<sup>th</sup>, 6:30PM<br /><em>Outdoors at the Quarry Hill Pavilion</em></font></strong></p><p><strong><font size="2">Wednesday, August 25<sup>th</sup>, 6:30PM<br /><em>Outdoors at the Quarry Hill Pavilion</em></font></strong></p>', '2010-02-07 15:07:00', '2010-02-24 14:18:54', 130),
(23, 'Newsletter Announcement', '<p>We are pleased to inform you that we will be making our future newsletters available online in PDF format and will send them out to our e-mail list.</p><p>Thank you to VIGOR President Kati Berg we were able to send out a February newsletter via post mail.&nbsp; For those of you who are not on our post mail list and would like to read the February Newsletter.&nbsp; You may download it at <a href="../newsletters/2010Newsletter.Feb2.pdf" title="February Newsletter">http://www.vigr.org/newsletters/2010Newsletter.Feb2.pdf</a></p><p>If you would like to subscribe to our e-mail list to receive future newsletters or would like a paper copy post mailed to you please submit your request via our <a href="../contact">contact form</a>&nbsp;or&nbsp;send an e-mail to&nbsp;<a href="mailto:friends@vigr.org">friends@vigr.org</a>.</p>', '2010-02-28 07:49:00', '2010-02-28 07:55:49', 20);
INSERT INTO `posts` (`id`, `title`, `body`, `created_at`, `updated_at`, `author_id`) VALUES
(24, 'VIGOR is featured in the Post-Bulletin! ', '<p>Read all about it, VIGOR is featured in the Post-Bulletin!&nbsp;</p><p><strong><font size="3">GreenSpace: Add a little chia to your diet</font></strong></p><p>&nbsp;<a href="http://www.postbulletin.com/newsmanager/templates/localnews_story.asp?z=51&amp;a=442370">http://www.postbulletin.com/newsmanager/templates/localnews_story.asp?z=51&amp;a=442370</a></p><p><strong>If you go: </strong><br /><br /><strong>What: </strong>Chia seeds as a superfood, presentation by Julie Eyrich. <br /><br /><strong>When: </strong>6:30 p.m. March 24 at a meeting of the Vegetarian Information Group of Rochester.<br /><br /><strong>Where: </strong>Rochester Public Library, Room B, 101 Second St. S.E.<br /><br /><strong>What to bring: </strong>Those attending should bring a plant-based dish, the recipe, a place setting and a beverage.<br /><br /><strong>For more information: </strong>Call Eyrich at 254-8349.</p><p>&nbsp;</p>', '2010-03-15 08:05:00', '2010-03-17 10:36:22', 130),
(25, 'Think Green Fair, June 26 10am-9pm', 'The Think Green Fair is coming up on Saturday, June 26th from 10am-9pm at the Olmsted County Fairgrounds.&nbsp; The fair is free and open to the public! <p>Come check out the 2 story earth balloon, local food vendors, crafts and art produced by local artisans, a free raffle of sustainable prizes, and <a href="http://www.rneighbors.org/wp-content/uploads/2009/07/TGFMusicPoster1.pdf">music</a> by Minnesota artists including The Evening Rig, Red Pens, Prairie Sons, Orangutan and more!</p><p>The fair is entering its second year and is committed to showcasing green businesses and organizations dedicated to bringing sustainable services, products and visions to southeastern Minnesota. Learn about energy efficiency, renewable energy, earth friendly home and garden products, locally and organically produced food, green certification, conservation, &amp; reducing and reusing your waste!</p><p>The Think Green Fair is a day long celebration that includes:</p><p> Green Exhibitors Food and catering from local restaurants&nbsp;&nbsp;Local growers &amp; producers &nbsp;Presentations&nbsp;  Kid''s activities  Local artisans &nbsp;Music  Door prizes and Raffle</p><p><strong>VIGOR will have a booth and needs volunteers!&nbsp; Call Kati Berg at 507-259-1490 to sign up or email </strong><a href="mailto:katiberg@kw.com"><strong>katiberg@kw.com</strong></a><strong>.&nbsp;&nbsp;We will be handing out information, answering questions about vegetarianism and giving away simple vegan fare (rice, beans, chips &amp; salsa) to remind people how easy it is to eat low on the food chain.&nbsp; </strong></p><p>&nbsp;</p>', '2010-06-17 18:55:00', '2010-06-17 19:12:07', 24),
(26, 'Think Green Fair', 'Thank you for all who helped!  We served 300 free meals of rice, beans, salsa and chips--reminding people it isn''t complicated or expensive to eat low on the food chain.  \r\n\r\n', '2010-06-20 12:17:00', '2010-07-06 11:00:26', 24),
(27, 'Summer News Letter', '<a href="http://www.vigr.org/newsletters/2010NewsletterJune.pdf">Summer Newsletter</a>', '2010-07-27 16:48:00', '2010-07-27 16:59:20', 20),
(28, 'Free Breakfast for Volunteers!  Monday, Aug. 30th', '<p>Calling all Early Bird Activists!&nbsp; 6:30-9:30am, Monday Aug. 30th 2010, Century High School Cafeteria &amp; Auditorium.</p><p>On very short notice we received an opportunity to put our message out in front of every Rochester Public School&nbsp;District Employee-- principals, teachers, lunch ladies, nurses, everyone!&nbsp;&nbsp; Monday morning the district is having its 2010-2011 kick off meeting.&nbsp; Normally 1500 people attend.&nbsp; In exchange for providing breakfast (bagels and fruit which a generous sponsor is paying for), we can put a PCRM Vegetarian Starter Kits onto every attendee''s seat.&nbsp; </p><p>Volunteers are needed to place Vegetarian Starter kits onto seats prior to the 8am meeting.&nbsp; We''ll have a specialized bookmark that will need to go into each one.&nbsp; Please arrive at 7am.</p><p>Volunteers needed to help the cafeteria staff set up and maintain the breakfast table.&nbsp; Please arrive at 6:30am.</p><p>Volunteers needed to collect unused starter kits and clean up as needed.&nbsp; Please arrive at 9am.</p><p>Call&nbsp;or email Kati to confirm when you can be there.&nbsp; 259-1490 or <a href="mailto:katiberg@kw.com">katiberg@kw.com</a>.</p><p>Breakfast will be included! Take home leftovers if there are any!&nbsp;Thank you!</p><p>Kati</p><p>&nbsp;</p><p>&nbsp;</p>', '2010-08-25 12:57:00', '2010-08-25 13:30:03', 24),
(29, 'Why Macrobiotics?', '&nbsp; <p>The word Macrobiotics comes from the Latin Macro meaning big, and Bios meaning life. It is a big view of life that sees human beings as connected to the big whole of nature. The macrobiotic diet encourages us to eat in accordance&nbsp;with the order of nature. This way we become whole and healthy like nature is. In macrobiotics we are encouraged to eat foods in their organic and whole form as much as possible. Other macrobiotic diet recommendations include avoiding animal products, eating&nbsp;foods locally and seasonally, and chewing our food well. </p><p>Contrary to common belief, the macrobiotic diet is far from being rigid, strict, or narrow. In fact, macrobiotics can introduce us to a wide variety of foods not commonly used in the modern diet like&nbsp;many whole grains, vegetables, beans, sea vegetables, and soups, and condiments. Cooked in a variety of different methods and in different combinations, these foods can be very appetizing, visually appealing,and&nbsp;satisfying. </p><p>While there isn''t very much scientific research done specifically on macrobiotics, there is a rich history that supports it. There are many individuals and cultures throughout history that have been known to eat a simple and whole foods diet that helped them achieve health, vitality,&nbsp;and long life. Macrobiotics rests on ancient Eastern as well as Western philosophies of medicine, health, and balance.</p><p>If you are already into a vegetarian, vegan, or whole foods diet, macrobiotics can help you eat a plant-based diet in a more balanced way.</p><p>If you are looking into starting to eat in a healthier way generally, macrobiotics is a great place to start because it can provide you with general principles of balance that can help you make more informed decisions in whatever diet you choose to follow. </p><p>If you are dealing with certain physical or psychological health conditions or simply want to lose weight, you will find macrobiotics very healing.</p><p>If you want to achieve more peace in mind and spirit and in the world as a whole, macrobiotics promotes peace.</p><p>If you are interested in trying macrobiotic meals and judging for yourself, please join us for a macrobiotic potluck every other Wednesday at 6:30 pm starting Nov. 3<sup>rd</sup> 2010. Contact <a href="mailto:ameen1983@yahoo.com">ameen1983@yahoo.com</a> for location and other questions.&nbsp;</p><p>&nbsp;Amin Abdelkariem-- a student of macrobiotic counseling with Macrobiotics America</p><p>&nbsp;</p>', '2010-10-21 11:16:00', '2010-10-21 12:22:21', 4),
(30, 'Restaurant Guide Updates', '<p>A couple of new restaurants were added to VIGOR''s list of Restaurants with great vegetarian/vegan options.&nbsp; </p><p>See the updated list at <a href="../dine">http://www.vigr.org/dine</a>.<br /><br />If you have a favorite restaurant for vegetarian or vegan options that is not listed or you''d like to comment on one that is, please send an e-mail or fill out the contact form.</p>', '2011-01-25 07:15:00', '2011-01-26 08:49:01', 20),
(31, 'Tomorrow, Feb 1st''s Oprah Show is about going Vegan! ', '<p><font size="3">Oprah and her 378 staff go Vegan: The One-Week Challenge</font></p><font size="4"><font size="3">Watch Oprah Feb.1st, 4pm on CBS to find out how it went.<br /></font></font><font size="4"><p><a href="http://www.oprah.com/showinfo/Oprah-and-378-Staffers-Go-Vegan-The-One-Week-Challenge" title="blocked::http://www.oprah.com/showinfo/Oprah-and-378-Staffers-Go-Vegan-The-One-Week-Challenge"><font size="3">http://www.oprah.com/showinfo/Oprah-and-378-Staffers-Go-Vegan-The-One-Week-Challenge</font></a></p><p><font size="3">P.S.&nbsp; The next 2 vegetarian potlucks are Wednesday,&nbsp;Feb. 23rd &amp; March 23rd, 6:30pm at the Rochester Public Library.&nbsp; </font></p></font>', '2011-01-31 15:36:00', '2011-01-31 15:46:51', 24),
(32, 'May 25th, 6:30pm India Curry House', '<p>Instead of a potluck this month we will meet at the India Curry House located at 1647 South Broadway<br />Rochester, MN 55904, ph: 507-288-5001</p><p>Ask for the VIGOR party.</p><p>Please join us.&nbsp; Each person will pay for their own meal.</p><p>Summer Potlucks will resume outdoors&nbsp;at the Quarry Hil Nature Center, 6:30pm on the 4th Wednesdays of June, July and August.</p><p>For questions call Kati at 259-1490.</p>', '2011-05-16 13:19:00', '2011-05-18 06:57:12', 24),
(33, 'Vegetarian Summer Potlucks at Quarry Hill Park', '<p>Wed. June 22nd 6:30pm</p><p>Wed. July 27th 6:30 pm</p><p>Wed. August 24th 6:30pm</p><p>We have the pavilion reserved&nbsp;located next to Quarry Hill Nature Center.&nbsp;&nbsp; This is outside, so dress appropriately!</p><p>Please bring a dish to pass with no animal products, including dairy and eggs as well as your own place setting.&nbsp; </p><p>See you there!</p>', '2011-06-21 09:38:00', '2011-06-21 09:48:25', 24),
(34, 'About The Good Food Store Merger', '<p>As some of you may have heard there are some major opportunities erupting at the Good Food Store here in Rochester. If you are a member or even an interested shopper, please take action immediately. </p><p>To Review the concerns of the &quot;no&quot; vote go to: <a href="http://tinyurl.com/3os63rq" title="blocked::http://tinyurl.com/3os63rq http://home.vigr.org/uploads/RGFSMergerConcerns.pdf">http://home.vigr.org/uploads/RGFSMergerConcerns.pdf<br /></a></p><p>&nbsp;</p>', '2011-07-28 17:17:00', '2011-08-18 12:28:09', 20),
(35, 'Good Food Store Merger Updates', '<p>Dear Vegetarian Community: <br /><br />If you are a member or shopper&nbsp;of the Good Food Store, this weekend and the following week are&nbsp;important. The store will vote on whether to merge into&nbsp;the LaCrosse People''s Food&nbsp;Co-op. There are supporters for both a YES and a NO vote. VIGOR <u>does not</u> endorse a vote either way. <br /><br />Last week we posted a document with concerns from a group calling themselves the Rochester Good Food Store Concerned Members.&nbsp;&nbsp;<br /><br />Please review this&nbsp;document from the supporters of the merger <a href="http://tinyurl.com/44yadxl">Proposed Merger and Expansion FAQ</a>. <br /><br />We believe it is important for voters to see the arguments from both sides.&nbsp; VIGOR has not verified the facts in either document so we cannot guarantee all of the information is true nor be held accountable for any misinformation.<br /><br />Important dates have recently changed. Here is the updated information.</p><ul><li>August 6th (Saturday), Balloting begins</li><li>August 7th (Sunday), 5 - 6 pm, Open Q&amp;A at the Good Food Co-op</li><li>August 13th (Saturday), 10 - 11:30 am, Bagels with the Board, Back Room Deli</li><li>August 13th (Saturday), 12 - 2 pm, Special Member Meeting, United Way Building , 903 W Center St .</li><li>August 20th (Saturday), 5 pm, Balloting by mail ends</li><li>August 21st (Sunday), 3 - 5 pm, Special Member Meeting, Balloting ends, United Way Building , 903 W Center St</li></ul>', '2011-08-06 05:48:00', '2011-08-06 20:38:00', 20),
(36, 'Check it out, President Clinton is a vegan!', '<p>This link is to a video from CNN on August 18, 2011, quick update on his current vegan status: </p><p><a href="http://www.cnn.com/2011/HEALTH/08/18/bill.clinton.diet.vegan/index.html?&amp;hpt=hp_c2">http://www.cnn.com/2011/HEALTH/08/18/bill.clinton.diet.vegan/index.html?&amp;hpt=hp_c2</a></p><p>&nbsp;</p><p>This imbedded video is a more indepth explanation from September 2010: </p>  \r\n<iframe width="560" height="345" src="http://www.youtube.com/embed/R3ied_AD4iE" frameborder="0" allowfullscreen></iframe>', '2011-08-18 11:59:00', '2011-08-19 10:06:36', 24),
(37, 'Let''s get Vegucated', '<p><font size="2">Introducing Vegucated...</font></p><iframe width="420" height="315" src="http://www.youtube.com/embed/GKzng1_byMY" frameborder="0" allowfullscreen></iframe><p><font size="2">VIGOR will be&nbsp;sponsoring a screening of the award winning documentary </font><a rel="nofollow" href="http://www.facebook.com/pages/Vegucated/146947672024544" target="_blank"><font size="2">Vegucated</font></a><font size="2">, on Feb 4, Sat, 1pm at the Rochester Public Library.</font><br /><br /><font size="2">More info: </font><a rel="nofollow" href="http://www.getvegucated.com/" target="_blank"><font size="2">http://www.getvegucated.com/</font></a><font size="2"> </font></p>', '2011-12-04 08:34:00', '2011-12-04 08:40:28', 20),
(38, 'Proposed Iowa Law Would Keep Hidden Cameras Off Farms', '<p>(ABC 6 NEWS) -- A proposed law in Iowa could soon keep hidden cameras looking to catch animal abuse out of farms.</p><p><a href="http://kaaltv.com/article/stories/S2513343.shtml?cat=10151" title="http://kaaltv.com/article/stories/S2513343.shtml?cat=10151">http://kaaltv.com/article/stories/S2513343.shtml?cat=10151</a></p>', '2012-02-27 08:43:00', '2012-02-27 08:44:18', 130),
(39, ' Healthy Green Living Show!  Volunteers Needed!  Free Pass Attached!', '<p>VIGOR will have a booth at the Healthy Green Living Show Saturday and Sunday - March 24 &amp; 25, 10-5pm each day.&nbsp;&nbsp;Print the coupon below for FREE entrance to the event.&nbsp; Print as many as you need, send to&nbsp;family and friends!&nbsp; Also, we need volunteers to answer questions and hand out vegetarian materials.&nbsp; Can you give 2-4 hours Saturday or Sunday?&nbsp; Call&nbsp;or email Kati at 259-1490, <a href="mailto:katiberg@kw.com">katiberg@kw.com</a>.&nbsp; </p><p>Volunteers needed for the following shifts.&nbsp; 3-4 people per shift ideal.</p><p>Saturday: 9am set up plus 10-1pm<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1pm-5pm<br />Sunday: 10am-2pm<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2pm to 5pm plus take down.</p><p>If we get enough responses to volunteer, we will split the shifts to be 2 hours each instead of 4.&nbsp; Thank you for your help!</p><p><img src="http://tinyurl.com/7ads5g3" border="0" alt="Guest Pass" width="402" height="312" /></p><p>&nbsp;</p>', '2012-03-07 11:44:00', '2012-03-07 12:35:49', 24),
(40, 'Wayne Pacelle, CEO of the Humane Society of the United States is coming to Rochester! ', '<p><strong>VIGOR is excited to announce, Wayne Pacelle, CEO of the Humane Society of the United States is coming to Rochester! </strong></p><p>Join Wayne Pacelle as he puts his 25 years of work, experience and hopes into<strong> his </strong>best-selling book &quot;<a href="http://www.examiner.com/books-in-denver/the-bond-our-kinship-with-animals-our-call-to-defend-them-review">The Bond: Our Kinship with Animals, Our Call to Defend Them</a>, and shares his vision of a better world for us all. We hope that you will join him in discussing: &quot;The Bond: Our Kinship with Animals, Our Call to Defend Them, and help spread the word.&quot;</p><p><strong>Wednesday, October 10<br /></strong><em>Co-hosted by the <a href="../home" target="_blank">Vegetarian Information Group of Rochester</a></em><br />7:00 - 9:00 p.m. CDT<br /><a href="http://store-locator.barnesandnoble.com/event/3878977" target="_blank">Barnes &amp; Noble </a><br />Rochester/Apache Mall<br />1201 12th Street SW<br />Rochester, Minn. </p><p>RSVP FACEBOOK: <a href="http://www.facebook.com/search/results.php?q=wayne%20pacelle%20the%20bond%20book%20tour&amp;pq=wayne%20pacelle%20the%20bond&amp;type=web&amp;form=FBKFTA#!/events/266983203419164/">http://www.facebook.com/search/results.php?q=wayne%20pacelle%20the%20bond%20book%20tour&amp;pq=wayne%20pacelle%20the%20bond&amp;type=web&amp;form=FBKFTA#!/events/266983203419164/</a></p><p>More info: <strong><a href="http://www.humanesociety.org/about/events/the_bond/the_bond_book_tour.html">http://www.humanesociety.org/about/events/the_bond/the_bond_book_tour.html</a></strong></p>', '2012-09-09 08:29:00', '2012-09-09 08:41:58', 130);
INSERT INTO `recipes` (`id`, `title`, `description`, `ingredients`, `instructions`, `category_id`, `created_at`, `updated_at`) VALUES
(1, 'Pastitsio', NULL, '3 cups Penne Pasta<br>1/4 cup Soy butter/margarine, coarsely chopped<br>16 oz can Whole canned tomoatoes with juice<br>8-10 cloves Pressed garlic<br>3 tbsp Olive oil (Virgin/Extra Virgin preferred)<br>2 tbsp Fresh basil or 1 Tsp dried basil<br>1/2 tsp Salt<br>1 1/2 cups Soy milk<br>4 tbsp Whole wheat flour<br>1/3 cup Soy cream Cheese (Tofuitti Brand)<br>A pinch Salt/Pepper to taste', 'Preheat oven to 400 degrees.  Boil the Penne Pasta (add 2 Tsp Salt for taste).  Cook until almost al dente (almost cooked, a bit undercooked)<br>Drain pasta thoroughly and mix with butter in a separate bowl.<br>Blenderize tomatoes, garlic, olive oil, basil, and salt until smooth.<br>Heat 1/2 of milk gently in saucepan.<br>Blenderize the other half with the flour and add it when the milk in the sauce pan is warm.<br>Add Soy Cream Cheese to sauce .<br>Whisk the sauce, regularly, while it heats, and keep a sharp eye on it so it doesn''t burn or boil.  When it begins to boil, reduce the heat to a simmer and cook for five minutes.  Season to taste with salt & pepper.<br>Butter a 2 1/2 inch deep a baking dish (preferably a casserole dish).<br>Layer  1/2 the creamy sauce, 1/2 the pasta, 1/2 the tomato sauce.  Repeat layers until all sauces, pasta are gone.<br>Bake uncovered for 35 minutes at 400 degrees', 105, NULL, NULL),
(2, 'Easy Pasta Salad', 'Easy Pasta Salad - Quick meal', '1 lb. pasta (cooked and drained)<br>8 oz. frozen lima beans (cooked and drained)<br>3 carrots (finely chopped)<br>1 tsp dill weed<br>1/2 tsp salt (optional)<br>4 tbsp veganaise (vegan mayonaise)', 'Mix all ingredients together in a bowl. If time permits, chill before serving.', 110, NULL, NULL),
(3, 'Sweet Pea Salad', NULL, '(2) 15 oz cans Organic sweet peas<br>3/4 cup Slivered almonds<br>3/4 cup Sliced olives<br>12 oz French dressing', 'Mix all ingredients together in a bowl. Server chilled.', 110, NULL, NULL),
(4, 'Speedy Gonzales Bean and Cucumber Salad', NULL, '2 cucumbers (sliced)<br>1 can Kidney beans<br>1 can Diced Celery<br>2 tbsp mild Pace Picante sauce<br>4 tbsp Veganaise  (Soy/Vegan Mayonasise)', 'Mix all ingredients together in a bowl. If time permits, chill before serving.', 110, NULL, NULL),
(5, '3 Bean Salad', '', '1 tbsp Apple cider vinegar<br>1 tsp Mustard seed<br>some Salt/ pepper to taste<br>1 cup Yellow beans<br>1 cup Green beans<br>1 cup Chickpeas (Garbonzo bean)<br>1 medium Onion (diced or chopped)<br>some Pimiento<br>pinch Sugar', 'Mix all ingredients together in a bowl. If time permits, chill before serving.', 110, NULL, NULL),
(6, 'Lentil Confetti Salad', NULL, '1 cup Lentils<br>1 cup Brown rice<br>1 tsp Salt<br>7 cups Boiling water<br>1 medium Chopped red onion<br>1 small Green pepper<br>1 tbsp Italian dressing<br>some Olives, celery, mushrooms, or cherry tomatoes', 'Add lentils, brown rice, and salt to the boiling water.<br>Cook covered for 40 minutes.<br>Drain cooked lentils and rice.  Then add onion, green pepper, dressing, and any other favorite vegetables.<br>Make this at least 12 hours before serving.  Serve chilled.', 110, NULL, NULL),
(7, 'Parsleyed Red Potatoes', NULL, '5 lb Red potatoes(organic), diced<br>2 cubes "Rapunzel" vegan bullion<br>3 tbsp Margarine (non-dairy non-hydrog)<br>1/2 bunch Chopped parsley<br>some Salt/pepper to taste', 'Boil potatoes in water with bullion until almost tender.<br>Drain.  Add margarine and parsley.  Serve hot.', 113, NULL, NULL),
(8, 'Asian Cucumber and White Radish Salad', 'NOTE - You can substitute other firm veggies like carrots, kohlragi, sweet peppers.', '6-8 med Cucumbers (peeled and sliced 1/8 inch thick)<br>3-4 cups White or rice vinegar<br>1 cup White sugar<br>1 tbsp Salt<br>1/2 - 1 tbsp Dried pepper flakes<br>1 - 2 tbsp Sesame oil<br>1 bunch or 1/2 lb Radishes (white or Daikon) scrubbed and thinly sliced', 'In microwave, warm the dressing ingredients enough to dissolve sugar and let flavors blend.  Do not boil.<br>Pour warm dressing over veggies and toss.<br>Chill at least 2 hours or overnight.', 110, NULL, NULL),
(9, 'Avacado Dip', NULL, '2 medium Avocados (mashed)<br>1 tsp fresh Garlic (pressed)<br>2 tsp fresh lemon juice<br>1 med tomato (very finely diced)<br>1/4 cup mild salsa<br>1 tsp salt/pepper to taste', 'Mix all ingredients together.  Chill before serving.', 114, NULL, NULL),
(10, 'Split Pea Herb Soup', NULL, '4 1/2 cups Water<br>2 oz Vegetable base<br>1/2 cup Chopped onion<br>3 tbsp Lemon juice<br>1 1/2 tsp Sugar<br>1/2 tsp Salt<br>1/4 tsp Nutmeg<br>1/4 tsp Cayenne<br>1/4 tsp Marjoram<br>1/4 tsp Thyme<br>1/4 tsp Pepper<br>5 oz Chopped spinach<br>1 cup Grated carrots<br>1 tbsp Parsley flakes<br>1 lb Yellow split peas', 'Mix peas, water, vegetable base, onion, lemon juice, sugar, salt, nutmeg, cayenne, marjoram, thyme, and pepper in a large saucepan. Cook for 45-60 minutes.<br>Whisk until peas are pureed.  Then add spinach, carrots, and parlsey.  Heat through before serving for approximately 10 minutes.', 119, NULL, NULL),
(11, 'Vegan Peanut Better Bars', NULL, '8 cups Organic raisin bran flakes<br>2 cups Llight corn syrup<br>2 cups Organic sugar<br>2 1/2 cups Organic peanut butter<br>3 cups Vegan chocolate chips', 'Lightly oil 8 x 12 inch cake pan, and place the bran flakes in the pan.<br>Mix the corn syrup and sugar in a saucepan, and bring to a light boil.<br>Remove from heat, add the peanut butter, and mix until smooth.<br>Pour the mixture over the flakes, and combine.<br>Frosting: Melt the chocolate chips (in a double boiler or in the microwave) and pour over the top.  Place in the refrigerator overnight, and cut and serve the next day.', 108, NULL, NULL),
(12, 'Tahini Spread', NULL, '1 Large carrot<br>1 Celery stalk<br>2 tbsp Onion<br>1 tbsp Green onion<br>1/2 cup Fresh parsley<br>1/4 cup Fresh dill (2 tbsp dried dill)<br>1 cup Thick tahini<br>1/3 cup Lemon juice<br>2 tbsp Bragg''s liquid aminos<br>2 tsp Kelp powder', 'Finely chop and blend carrot, celery, onion, green onion, parsley, and dill.<br>Add tahini, lemon juice, liquid aminos, and kelp powder.<br>Mix well and serve. (Chill if desired).', 114, NULL, NULL),
(13, 'Artichoke Rice Salad', NULL, '1 cup Uncooked brown rice<br>1/4 cup Green onion<br>1/4 cup Chopped fresh parsley<br>1 Chopped small red bell pepper<br>14 oz can Artichokes, drained and quartered<br>1/4 cup Olive oil<br>1 tbsp Grated lemon peel<br>3 tbsp Lemon juice<br>1/2 tsp Salt<br>1/4 tsp Pepper<br>1 clove Minced garlic', 'Cook the rice<br>Make the Lemon Garlic Vinagrette - Mix the olive oil, lemon peel, salt, pepper, and garlic.<br>Mix everything together and refrigerate for at least 3 hours.  Serve chilled!', 110, NULL, NULL),
(14, 'Chop Suey Stir-fry', NULL, '1/2 cup Bamboo sprouts<br>1/2 cup Bean sprouts<br>1/2 cup Water chestnuts<br>1/3 cup Mushrooms<br>1 cup Mock duck or Mock chicken<br>1 1/2 cup Water<br>1/2 tsp Salt<br>2 tbsp Soy sauce<br>1 tsp Sugar<br>1/2 tsp Cornstarch<br>1/2 cup Water', 'Make the Peanut Oil Gravy - Mix water, salt, sugar, soy sauce, cornstarch, Chinese molasses, and water.<br>Stir-Fry the vegetables.  Add gravy before adding vegetables. Cook and Serve with rice.', 103, NULL, NULL),
(15, 'Best Carob Fudge', NULL, '2 cup Sunspire carob chips<br>1 cup All-natural peanut butter<br>1 cup Raisins<br>1 cup Thinly sliced almonds, or coarsley chopped pecans<br>1 cup Shredded, unsweetened coconut', 'Melt chips and Peanut butter<br>Remove from heat and quickly stir in the other ingredients.  Tends to get thick quickly.<br>Pat out on cookie sheet<br>Freeze 20 minutes and cut into 1 inch squares<br>Tips for cooking with carob chips:  If the chips don''t melt well, add a small amount of water 2 T. at a time until chips melt but are still thick looking.  The fudge won''t set if you add too much water.', 108, NULL, NULL),
(16, '3 Bean Salad II', '', '4 cups green beans<br>2 cups red bell pepper (chopped)<br>1 cup garbanzo beans<br>1 cup kidney beans<br>2 tbsp red onion (minced)<br>2 tbsp vinaigrette dressing<br>2 tbsp fresh lemon juice', 'Clean and steam green beans for 4-5 minutes until tender.<br>Combine all ingredients and toss.  Chill before serving.', 110, NULL, NULL),
(17, 'Garden Pasta Salad', '', '1lb cooked pasta<br>1/4 red onion (diced)<br>1 carrot (sliced and quarterd)<br>1 small can black olives (sliced)<br>1/4 cup peas (corn optional)<br>1 clove garlic (miced)<br>1/2 cup balsamic vinegar<br>salt and pepper to taste', 'Mix all the ingredients together.  Add more vinegar to taste.  Toss and chill before serving.', 110, NULL, NULL),
(18, 'Chewy Peanut Butter  Cookies', '122 calories and 15 grams carbohydrates.', '1-1/2 cups oats (finely ground in food processor or oat flour)<br>1 cup unbleached all-purpose flour<br>1/2 tsp baking powder<br>1/2 tsp baking soda<br>3/4 tsp sea salt<br>1 cup unsalted peanut butter<br>2 tbsp water<br>1/2 cup maple syrup<br>1 tsp vanilla extract<br>1 cup Sucanat<br>2/3 cup soy margarine', 'Preheat oven to 350 degrees.  In a small bowl, stir together ground oats, flour,baking powder, baking soda, and salt. Set aside.<br>Use beater to mix peanut butter and<br>water together in large bowl until smooth. Add maple syrup and vanilla and beat until well blended.  Add Sucanat and margarine and beat until incorporated.<br>Add dry ingredients and beat on low speed just until completely blended.<br><br>Drop dough by tablespoonfuls onto baking sheets lined with parchment. Press a criss-cross pattern into tops of cookies with the tines of a dinner fork.<br>Bake until tops are lightly browned but cookies are still slightly soft, 10-12 min. Cool on racks.  Cookies can be stored in an air-tight container for several days.', 104, NULL, NULL),
(19, 'Raspberry Sauce', '', '2 pints red raspberries<br>1 cup cherry juice<br>2 tbsp maple syrup', 'Blen all ingredients.  Chill before serving.', 114, NULL, NULL),
(20, 'Olive Hummus', NULL, '2 cups black olives<br>12 oz can garbanzo beans<br>Juice of 1 lemon<br>1 large clove of garlic<br>1/3 cup tahini (ground sesame seed paste)<br>2 tbsp olive oil<br>some fresh dill or green onions (optional)', 'Blend all ingredients in a food processor or blender. Add water to thin to desired texture.', 114, NULL, NULL),
(21, 'Quick Yummy Squash', 'You can make this vegan by adding soy margarine and cinnamon instead of butter and honey for the topping.', '1 whole sqash', 'Take whole squash and poke several holes in it with a fork. Put it in microwave and cook until it partially caves in.  Time varies according to size of squash and microwaves - times range from 9 to 18 minutes.<br>Optional Sauce ideas - Melt butter or margarine.  Add honey and <br>cinnamon.  Scoop seeds out of<br>squash and pour this tasty<br>topping on.  YUMMY!', 103, NULL, NULL),
(22, 'Ginger and Chives "Sour Cream" Dip', NULL, '1 package soft silken tofu (organic)<br>3 tbsp canola oil<br>3 tbsp lemon juice<br>1 - 2 tbsp brown rice vinegar<br>1 - 2 tbsp ginger juice<br>1/2 tsp salt (optional)<br>3 tbsp chopped chives', 'Blend all ingredients until smooth.  Chill before serving.', 114, NULL, NULL),
(23, 'Tabooli', '', '1 cup bulgar wheat<br>1 cup cold water<br>1/2 cup minced parsley<br>1/2 cup green onion<br>1/4 cup fresh mint leaves<br>1/4 cup green pepper<br>1 large tomato (chopped)<br>1/4 cup olive oil<br>1/4 cup lemon juice', 'Rinse bulgar several times. Combine with cold water and let stand one hour.<br>Drain excess liquid. Mix all ingredients.  Refrigerate at least one hour.', 110, NULL, NULL),
(24, 'Korean Fried Rice', 'Family recipe - old world Korean style fried rice.', '2 tbsp oil for frying tofu<br>1 lb firm tofu<br>3 tbsp soy sauce<br>1/3 cup oil for frying veggies and rice<br>1 medium onion (chopped)<br>1 medium carrot (chopped)<br>1 cup frozen peas<br>4 cups cold cooked rice<br>salt to taste', 'Heat 2 tbsp oil in a frying pan. Crumble the tofu with a fork. Fry in the pan for about 9 minutes til the water has evaporated. Drizzle the soy sauce over the tofu, mix to spread evenly then transfer to a plate to cool off.<br>Heat the 1/3 cup oil in the frying<br>pan and fry the onion and carrots.<br>After about 3 minutes, add the peas. Cook until the carrots are tender and the peas are warm.<br>Add the rice and mix in the vegetables.  Fry for 3-5 minutes.<br>Add the crumbled tofu.  Salt the<br>fried rice to taste.', 116, NULL, NULL),
(25, 'Grumbles', 'The following recipe is very<br>versitile.  It could be used in chili, sloppy joes, tacos, tortillas, enchiladas or spaghetti.  At the July potluck it was used in the Zesty Garden Casserole.', '4 1/2 cups water<br>1 cup walnuts<br>2 cups bulgar wheat<br>1/2 cup dried onion flakes<br>1 1/2 tsp. onion powder<br>1/4 tsp. garlic powder', 'Blend 2 cups water and walnut in<br>blender until not nut pieces<br>remain.<br>Then put remaining water along with bulgar and seasonings in a pan and simmer covered for 20 min, stirring occasionally.<br>Bake for 1 1/2 hours at 350 degrees.  Turn every 15 min.  (Like fried hamburger - not to crunchy).<br>To reconstitue add 1 cup salsa or diced canned tomatoes.', 103, NULL, NULL),
(26, 'Brown Gravy', 'Delicious Brown Gravy from our 1st Annual Dinner and Buffet.', '2 ? tbsp Soy Margarine<br>1/4 cup  Flour  ?Wondra?<br>1 ? cups Vegetable Broth (?Imagine? no-chicken flavor)<br>2 tbsp Soy Sauce ?Tamari?<br>?  tsp  Black Pepper<br>1/8 cup Dried Parsley', 'Melt margarine in a small sauce pan over medium heat.  Add flour and whisk together about 30 seconds.<br>Then add broth slowly while whisking. Cook over medium heat for 2 minutes.<br>Add soy sauce and pepper. Continue cooking until gravy is thickened.', 113, '2001-12-10 22:32:19', NULL),
(27, 'Stuffing', 'Stuffing from 1st Annual Dinner and Buffet.', '9x13 Cake Pan<br>2 cups Diced Onions<br>2 cups Diced Celery<br>2 tbsp Sesame Oil<br>2 bags ?Pepperidge Farm Stuffing - herb seasoned cubes"<br>2 tsp Dried Parsley<br>2 tsp Poultry Seasoning<br>4 cups Vegetable Broth ( ?Imagine? no-chicken flavor)', 'Saute onion and celery in oil.<br>Mix cubes, seasoning, sauted vegetables, and broth in large bowl until cubes are well coated.<br>Place mixture in cake pan and bake at 350 until lightly browned.', 113, '2001-12-10 23:01:01', NULL),
(28, 'Broccoli Salad', 'Awsome Broccoli Salad from the 1st Annual Dinner and Buffet.', '1 bunch Broccoli<br>1 small Red Onion<br>1 cup Sunflower Seeds<br>1 cup Raisins<br>Dressing:<br>2 tbsp Sugar<br>2 tbsp Vinegar<br>1cup Mayonaise ("Vegenaise")', 'Cut Broccoli and Onion.  Mix in Sunflower seeds and Raisins.<br>Mix dressing ingredients together and add to salad right before serving.', 110, '2001-12-10 23:09:04', NULL),
(29, 'Apple Crunch', 'Apple Crunch from 1st Annual Dinner and Buffet.', '6 apples - peeled and sliced<br>? cup oatmeal (uncooked)<br>? cup brown sugar<br>? cup  flour<br>? cup margarine', 'Place sliced apples in a 8x8 pan.<br>Mix margarine, sugar, flour, oatmeal until crumbly. Place on top of apples.<br>Bake at 350 for 35 to 40 minutes.', 108, '2001-12-10 23:15:31', NULL),
(30, 'Pumpkin Spice Cake', 'Pumpkin Spice cake from the 1st Annual Dinner and Buffet.', '1 2/3 cup flour<br>1 cup packed brown sugar<br>1 tsp allspice<br>1 tsp baking soda<br>? tsp salt<br>? cup water<br>? cup vegetable oil<br>? tsp vinegar<br>? cup canned pumpkin<br>FROSTING:  ? cup margarine<br>8oz. cream cheese ("tofutti")<br>2 cups powder sugar<br>1 tsp vanilla<br>pinch of salt', 'Pre-heat oven 350.<br>Mix the flour, brown sugar, allspice, baking soda, and salt in an oiled pan (8x8x2inch).<br>Stir in the remaining ingredients, and bake for 35 to 40 minutes. Allow to cool.  Frost and serve when cooled.<br>FROSTING: Cream the ingredients.  Beat until smooth.', 106, '2001-12-10 23:20:52', NULL),
(31, 'Baked Beans', '', '1/2 c. diced onion<br>1/2c. diced green pepper<br>1/2 c. cubed firm tofu<br>1/2 c. diced apples<br>3-15oz can Great NorthernBeans drained<br>1/2 c. ketchup<br>1 tbsp dry mustard<br>1/4 c. blackstap molasses<br>1 tbsp apple cider vinegar<br>salt and pepper to taste', 'Preheat oven to 350 degrees.<br>Saute onions, green pepper and tofu in water until onion is soft. Combine all ingedients in an oven proof casserole.<br>Cover and bake 30 minutes; then uncover and bake 30 minutes.', 113, '2001-12-20 00:46:57', NULL),
(32, 'Pumpkin Chip Cookies', '', '1 c. shortening<br>2 c.sugar<br>2 c. cooked pumkin<br>2 tsp vanilla<br>4 c. flour<br>2 tsp baking soda<br>2 tsp cinnamon<br>12oz chocolate chips<br>nuts optional', 'Cream shortening with sugar. Add vanilla, pumpkin, and stir. Mix the rest of the ingredients together. Bake at 325 until golden brown 5-10 minutes', 104, '2001-12-20 01:19:13', NULL),
(33, 'Brown Rice with Chili and Green Chilies', '', '1 c. brown rice<br>15 oz can Hormel Vegetarian Chili w/Beans<br>4 oz green chiles', 'Cook one cup of brown rice. Add 15oz. can of Hormel Vegetarian Chili w/Beans. Add 4oz can of green chiles.Mix and heat at 350 degree oven for 30 minutes.<br>You may serve with tortilla chips or use as filling for burritos that you cover with a can of enchilada sauce.', 116, '2001-12-20 01:38:26', NULL),
(34, 'Broccoli Vegetable Quiche', '', '1 prepared pie shell (vegan)<br>1 T. olive oil<br>1 medium onion, diced<br>1 green bell pepper, chopped<br>1 cup sliced fresh mushrooms<br>1 lb firm tofu, patted dry with a paper towel<br>pinch of grated nutmeg<br>1/2 t. turmeric<br>1/2 bunch fresh basil, chopped (or 1 T. dried basil)<br>1/2 t. salt<br>pepper to taste<br>1/2 cup soy milk', 'Preheat oven to 425 degrees F.<br><br>Bake pie crust 8 to 12 minutes.<br>Heat the olive oil in a medium saucepan over medium heat, and saute the onion, green pepper, broccoli, and mushrooms until cooked, about 8 to 10 minutes.<br>In a blender or food processor, blend the tofu, nutmeg, turmeric, basil, salt, and soy milk until smooth.  Stir the vegetables and the tofu mixture together and add pepper to taste.<br>Pour the batter into the pie crust. Bake for 30 minutes, or until a knife inserted just off-center into the quiche comes out clean.', 111, '2001-12-20 01:56:09', NULL),
(35, 'Delicious Apple Crisp', '', '6-8 peeled and sliced apples<br>1 c. brown sugar<br>3/4 c. flour<br>1/3 c. olive oil<br>1 tsp cinnamon', 'Put sliced apples in pan. Mix oil, sugar, flour. Pour over the top of the sliced apples. Bake at 350 for 35-40 minutes.', 108, '2001-12-20 02:00:16', NULL),
(36, 'No-Bake Coconut-Chocolate Drops', '', '1/2c. margarine<br>2c. sifted powdered sugar<br>3c. shreaded coconut<br>2oz. unsweetened chocolate', 'Melt margarine. Remove from heat. Add powdered sugar to margarine. Add coconut, mix well. Shape into balls. Make indent in center fill with melted chocolate. Keep chilled.', 104, '2001-12-22 21:36:41', NULL),
(37, 'Potato Patties Herb Style', '', '8-10 cooked peeled potatoes<br>1 large onion diced<br>2 stalks celery diced<br>2 garlic cloves crushed<br>2 Tbsp. Parsley<br>1/2 tsp. oregano<br>1/2 tsp dill<br>1/4 tsp.sage<br>1/4 tsp. onion salt<br>1/4 tsp. onion salt,  1/4 tsp. onion powder<br>2 Tbsp. Bragg Aminos, 1/2 cup water', 'Put cooked peeled potatoes in a bowl and whip,until creamy. Saute the rest of the ingredient in a pan. Add saute food into the whipped potatoes. Let cool. Shape into patties. Then cover in breading (Falafel Dry Mix). Bake at 400 degrees, for 30 minutes.', 113, '2001-12-22 22:07:54', NULL),
(38, 'Veggie Prawns (veggie shrimp)', '', 'soybean protein<br>Vegetable oil<br>Natural seasonings', 'Wholesale and retail of Vegetarian Frozen Food Prpducts. Order by telephone 877-668-2668 or web-site: <br>www.vegieworld.com', 112, '2001-12-22 22:44:06', NULL),
(39, 'Low Fat Enchiladas', 'These are very easy to make enchiladas for a quick meal.', '1 8 oz can of Red or Tomatillo green enchilada sauce<br>6 corn tortillas<br>6 Tbsp of "Tofutti" Garlic Soy Cream Cheese<br>1 medium bunch spinach or 2 medium zucchini<br>3 green onions (diced)<br>1 cup of "Tofutti" Soy Shredded Cheddar Cheese', 'Clean and prepare the spinach or zucchini.  Shred the zucchini or finely chop the spinach.<br>Spray an 8x8 square pan or a casserole dish with cooking spray.  Preheat the oven to 350 degrees.<br>Mix the zucchini or spinach with the Tofutti shredded cheese.<br>Microwave the corn tortillas for 10 seconds for easier folding and pliability.<br>Spread 1 tablespoon of the Tofutti soy cream cheese on each tortilla.<br>Fill each tortilla with the cheese and vegetable mixture.  Do not over fill since it will make it difficult to wrap the tortilla.<br>Fold each tortilla into a cylindrical shape.  Then place into the pan or casserole dish.<br>Once all the enchiladas have been folded and placed into the pan, pour the enchilada sauce over them until they are all covered.  Cover the pan or casserole dish and bake in oven for 30 minutes.<br>Remove from oven and serve.  Sprinkle chopped green onions over each enchilada before serving.', 103, '2001-12-28 10:14:08', NULL),
(40, 'Carob Fudge', '', '2c. Sunspire carbo chips (unsweetened)<br>1c. peanut butter<br>1c. raisins<br>1c. thinly sliced almonds,or coarsely chopped pecans<br>1c. shredded, unsweetened coconut', 'Melt chips and peanut butter. Remove from heat and quickly stir in remaining ingredients.<br>Pat out on cookies sheet 3/8 to 1/2 inch thick.<br>Freeze 20 minutes, and cut into 1 inch squares. Store in plastic bags in freezer. Serve cold.<br>* I prefer to make balls out of the fudge and then roll in coconut.', 108, '2002-01-17 00:12:44', NULL),
(41, 'Chocolate Peanut Butter  Chex Mix', '', '8 Tbsp margarine<br>1c. vegan chocolate chips<br>1/2c. peanut butter<br>6c. Rice Chex cereal<br>2c. powdered sugar<br>1/2 c. raisins', 'Put powdered sugar in paper bag.<br>Melt margarine, chips, and peanut butter. Mix in chex mix and raisins.<br>Put chex mix in paper bag. Shake until chex mix is covered with sugar.', 114, '2002-01-17 00:35:33', NULL),
(42, 'Molassses Creams', '', '1/2 c. shortening<br>1/2 c. sugar<br>1 inch tofu<br>1/2 c. molasses<br>1 c. flour<br>1 1/2 tsp  ground cloves<br>1/2 c. coffee with 1/4 tsp baking soda<br>1 c. raisins<br>1 tsp cinnamon<br>1/2 tsp salt<br>1 1/2 tsp baking soda', 'Cream shortening, molasses, and sugar together mix well.<br>Beat tofu then add to mixture.<br>Add fusion coffee to mixture.<br>Mix dry ingredients together then add to mixture and stir until smooth. Stir in raisins.<br>Pour into 9x13 greased pan. Bake at 350 degrees for 20-25 minutes.<br>Mix one cup powdered sugar with 2 tsp. rice milk to form a thick paste, and frost.', 108, '2002-01-17 00:49:04', NULL),
(43, 'Veggie Pizza  Appetizer', '', '2 pkg crescent  roll dough<br>2/3c. sour supreme<br>2 8oz. pkg Better Than Cream Cheese, softened<br>1/4c. sliced green onion with tops<br>1 tsp dill weed<br>1 tsp garlic powder<br>1 tsp garlic powder<br>3 c. chopped veggies raw of choice<br>nutritional yeast flakes', 'Unroll crescent roll dough onto 10x15 inch pan. Press scams together. Bake at 350 degrees for 10 minutes, or until golden brown. Cool.<br>Mix together remaining ingredients except yeast flakes and chopped veggies. Spread mixture over the rolls and top with chopped veggie.<br>Sprinkle pizza with nutritional yeast flakes.', 114, '2002-01-19 23:38:34', NULL),
(44, 'Herbed Deep-Dish Pizza', 'Pizza Hut Pan Crust like pizza.', '1 pkg active yeast<br>1c. luke warm water<br>1 Tbsp sugar<br>2 Tbsp oil<br>2 1/2c. unbleached white flour<br>2 tsp oregano<br>1 1/ 2  tsp garlic<br>1 tsp basil<br>1/2 tsp thyme<br>1 tsp salt<br>2c. pizza sauce<br>fresh mushrooms,onions, olives,jalapenos<br>1 10oz. frozen spinach', 'Combine yeast and water and let dissolve (10 min.). Add sugar and oil to yeast mixture. Combine flour, herbs, and salt.<br>Mix together yeast and flour mixtures and knead for 8 min. until dough loses stickiness(add flour as needed). Let rise in warm place until doubled in size(about 1 1/2 hours)in a flour bowl (covered).<br>Generously oil a 9 inch deep dish pan or 12 spaced muffin pan. Roll out dough 11 inch diameter. Place in the pan and pinch edges for crust. For muffins cut out 2 inch circles and place in muffin tins.<br>Add the pizza sauce and then veggies. Sprinkle a little olive oil on top. Pre-heated oven 425 degrees. Bake for 12-14 minutes. Let cool.', 103, '2002-01-20 10:49:53', NULL),
(45, 'Chocolate Covered Nuts', '', '1c. semi-sweet chocolate chips<br>1c. nuts of your choice', 'Melt chocolate on low. Constantly stirring. Add nuts and spread on wax paper to a thin layer.<br>Refrigerate until solid. Serve by breaking apart.', 114, '2002-01-20 11:23:01', NULL),
(46, 'Simple Pizza', '', 'ready- made pizza crust<br>8oz pizza cheese<br>2 oz chopped black olives<br>5 green olives w/pimentos sliced<br>4 oz canned mushrooms pieces drained<br>8 oz can pizza sauce<br>1/2 c. chopped green onions w/top<br>1/2c. chopped green peppers', 'Spread pizza sauce over pizza crust. <br><br><br><br><br><br><br><br>Spread pizza sauce over crust. Sprinkle all other ingredients except cheese. Last ingredient is cheese.<br><br><br><br>Pre-heat oven to 450 degrees and bake 7-12 minutes.', 114, '2002-01-30 19:56:05', NULL),
(47, 'American Cheese', 'NOTE: Use of gelatin (animal by-product)', '1 cup water<br>1/3 cup and 1 tbsp Emes unflavored gelatin<br>1-1/4 cup boiling water<br>2 cups raw cashews<br>1/4 cup nutritional yeast flakes<br>1 tbsp salt<br>2 tsp onion powder<br>1/4 tsp garlic powder<br>1/4 cup fresh lemon juice<br>4 oz jar pimentos or 1/2 large sweet pepper', 'Soak gelatin in the 1 cup water<br>in blender.<br>Pour boiling water over<br>soaked gelatin and whiz briefly to<br>disssolve.  Cool slightly.<br>Add cashews and liquefy.  Add remaining indregients.  Liquefy until mixture is the consistency of a creamy sauce and no bits of pimento or pepper are visible.<br>Pour into a 1 quart mold and<br>cool slightly.<br>Cover and refrigerate overnight before seving.  After cheese is firm, it may be frozen.', 113, '2002-02-01 11:04:10', NULL),
(48, 'Melty Cheese', 'Topping for the casserole by Donna Dickie', '4 oz jar pimentos<br>1 tbsp arrowroot or cornstarch<br>1/2 cup cashew nuts<br>1 cup water<br>2 tsp salt<br>1/4 cup nutritional yeast flakes<br>1 1/2 tbsp lemon juice<br>t tsp onion powder', 'Blend all ingredients until smooth.<br>Add to a pot of 1 1/2 cups of boiling water.  Cook until thick.  Serve warm over tacos, haystacks, corn chips, or any of your favorite foods for a zesty vegan cheesy taste.', 113, '2002-02-01 11:49:12', NULL),
(49, 'Zesty Garden Casserole', '', '4 - 5 Roma tomatoes<br>2 medium zucchini<br>4 - 5 small yellow summer squash<br>1/4  - 1/2 tsp dried or handful fresh basil, chives, oregano, and parsley<br>1/2 medium onion<br>5 cloves garlic (minced)<br>1/4 tsp garlic salt (to taste)<br>grumbles (optional)<br>melty cheese', 'Saute the squash in water adding the salt and herbs, then set aside.<br><br>Saute onion and garlic in olive oil.<br>Layer the squash, tomatoes, *grumbles seasoned with italian seasoning, onion, garlic and melty cheese.<br>Cover and bake at 375 until bubbles through.<br>* Could substitute pasta instead of grumbles or leave out the grumbles<br>altogether.', 105, '2002-02-01 11:56:36', NULL),
(50, 'Butter Crunchies', '', '1/2 cup peanut butter<br>2 tbsp honey<br>2 cups granola<br>Pinch of salt<br>1 1/2 tsp vanilla', 'Use your hands to mix all ingredients.  Then form into balls.', 104, '2002-02-01 12:09:52', NULL),
(51, 'Balkan Cucumber Salad', '', '1/2 cup yellow onion<br>4 cucumbers<br>1 tsp salt, mint, pepper, and scallions<br>1/4 cup parsley<br>1 1/2 cup yogurt<br>1 tsp dill<br>1 clove garlic<br>1 cup walnuts', 'Soak onions in cold water for 30 minutes. Cut cucumbers into thin rounds.  Add remaining ingredients and mix (not walnuts).  Sprinkle on walnuts just  before serving.', 110, '2002-02-01 12:13:08', NULL),
(52, 'Thai Noodle Salad', '', '1 cup picante sauce (Pace mild salsa)<br>1/4 cup peanut butter<br>2 tbsp brown sugar<br>2 tbsp orange juice<br>1 tsp soy sauce<br>1/2 tsp ginger<br>1 box fettucini noodles', 'Add veggies and or beans (ie. kidney beans, broccoli, bell pepper etc..) and mix all together.  Top with fresh cilantro. (peanuts optional)', 110, '2002-02-01 12:18:51', NULL),
(53, 'Organic Salad', '', '8 ripe tomatoes<br>1 organic red onion<br>7 fresh picked sprigs of parsley<br>10 of the biggest basil leaves you can find on the plant<br>Juice from one lemon<br>1/4 cup vinegar<br>1/4 cup olive oil<br>1 tsp Braggs (soy sauce)<br>1 tsp Sucanat<br>1 bay leaf', 'Cut cup the onion, parsley and basil as fine as you like. Add this to the lemon juice, vinegar, olive oil, soy sauce, bay leaf, and sucanat.<br>Cut one of the tomatoes and add to the salad.  Let sit for a couple of hours so the flavors blend.<br>Take out the bay leaf and add the remaining tomatoes (diced).  Stir and serve chilled.', 110, '2002-02-01 12:26:56', NULL),
(54, 'Lovely Light Lemon Cake', '', '2 c. unbleached flour<br>1 1/2 tsp. baking powder<br>1 tsp. baking soda<br>1/2 tsp. sea salt<br>1 Tbsp. lemon zest<br>1/3 c. canola oil<br>3/4 c. maple syrup<br>1/3 c. vanilla soymilk or ricemilk<br>1/3 c. water<br>1/4 c. plus 2 Tbsp. lemon juice<br>2 tsp. apple cider vinegar<br>1 tsp. vanilla extract<br>2 tsp. lemon extract', 'Sift together dry ingredients.<br>In another bowl combine wet ingredients.<br>3. Add wet ingredients to the dry and mix quickly and thoroughly until smooth.<br>Pour into cake pan(s). Bake for 25-30 minutes at 350 degrees.', 106, '2002-02-25 21:28:57', NULL),
(55, 'Dreamy Cream Whip', '', '2 c. silken tofu<br>2/3 c. corn syrup<br>1/2 c. canola oil<br>2 Tbsp. vanilla<br>2 Tbsp. lemon juice<br>pinch of salt', 'Combine in a blender and add water only if needed to keep the mixture moving.  Use like you would whipped cream.', 108, '2002-02-25 21:41:39', NULL),
(56, 'Vegan Brown Rice', '', '1 Cup uncooked Long grain Brown Rice<br>2 heads of broccoli(medium size flowerettes), 2 red sweet peppers(sliced), 1/3 cup olive oil, 1 Tablespoon Tamari, 1/4 cup raw cider vinegar', 'Steam cook rice<br><br>Steam broccoli and peppers till tender<br>Mix together rice and vegetables and dress with olive oil, Tamari and raw cider vinegar', 116, '2002-02-28 18:20:02', NULL),
(57, 'Chili and Chips Delight', '', 'Three-15 oz cans Hormel Vegetarian Chili with Beans<br>one-32 oz bag Ore-Ida Cottage Fries<br>10 oz can of Chi-Chis Fiesta diced tomatoes with Green Chilies', 'In a large microwaveable bowl mix the three cans of chili with the can of diced tomatoes, heat in microwave to desired temperature<br>Heat oven to 450 degrees, place the cottage fries on enough flatware to lay them out individually, cook for about 18-20 minutes, turning once if desired<br>Serve the two separate dishes, take potatoes and then pour chili over the potatoes', 113, '2002-02-28 19:14:29', NULL),
(58, 'Tabuli', '', 'one cup dry bulghar wheat<br>one and a half cups boiling water<br>one and a half teaspoons salt<br>1/4 fresh lemon and/or lime juice<br>one heaping teaspoon crushed, fresh garlic<br>1/2 cup chopped scallions<br>1/2 teaspoon dried mint<br>1/4 cup  olive oil<br>fresh black pepper<br>two medium tomatoes diced<br>1 packed cup freshly chopped parsley<br>1 chopped cucumber', 'Begin to soak bulghar at least 3 hrs before serving time.<br>Combine bulghar, boiling water and salt in a bowl. Cover and let stand 15-20 minutes or until bulghar is chewable.<br>Add lemon juice, oil and mint and mix. Refrigerate 2-3hrs.<br>Just before serving add the vegetables and mix gently.', 110, '2002-02-28 19:31:31', NULL),
(59, 'Mediterannean Tofu Salad', '', 'SALAD<br>1 lb firm tofu, cubed<br>1 cup garbanzo beans(drained, canned or cooked and dried)<br>1/2 cup black olives, pitted and sliced(preferably Kalamata)<br>1/2 cup chopped parsley<br>1/2 medium red onion, peeled and sliced in thin matchsticks<br>3 ripe, medium tomatoes, diced<br>1 small cucumber, seeded and diced<br>DRESSING<br>1/3 cup olive oil<br>2 tablespoons red wine vinegar<br>2 garlic cloves, minced<br>1 teaspoon Dijon mustard<br>2 teaspoons honey<br>1 tablespoon dried oregano<br> 1 teaspoon cayenne pepper, or to taste<br>1/2 teaspoon salt<br>1/4 teaspoon white pepper', 'Place the tofu, beans, olives, parsley and vegetables in a salad bowl<br>Whisk together all the dressing ingredients and pour salad. Toss lightly and serve.', 110, '2002-02-28 19:54:20', NULL),
(60, 'Calypso Stew', 'Calypso beans are a black and white bean. You can substitute pinto,kidney or garbanzo beans', '2 c. calypso beans<br>1 tsp. cumin<br>1.5 tsp. McKays Chicken Seasoning<br>1 tsp. Vege-Sal<br>salt to taste<br>1 tsp. basil<br>1/2 tsp. paprika<br>1/4 tsp. oregano<br>1 tsp. dill weed<br>1 large carrot, sliced or diced<br>2 c. shredded green cabbage<br>1 c. shredded red cabbage<br>1 large onion, cut in long, thin strips<br>1 c. sliced celery<br>3 c. canned diced tomatoes in juice', 'Soak dry beans overnight or boil in water and let soak 1 hr. Drain and discard water.<br>Cover soaked beans with water in a large kettle 1 inch above beans(or use 4 c. of canned beans of your choice). Bring to a boil and simmer until nearly done, about 2 hrs.<br>Add seasonings ansd diced carrot; cook for 15 min., then add the remaining ingredients and cook 15-20 min. longer or until vegetables are tender. You may need to add more water to achieve the consaistency of a thick stew. Serve over rice or couscous.', 103, '2002-04-01 16:49:20', NULL),
(61, 'Calico Beans', '', '12 oz. textured vegetable protein(TVP)<br>1/2 c. BacOs<br>1/2 - 1 c. chopped onion<br>1 can kidney beans( 16 oz.)<br>1 can lima beans(16 oz.)<br>1 - 28 oz vegetarian baked beans<br>3/4 c. brown sugar<br>1/2 c. catsup<br>2 Tbsp. apple cider vinegar', 'Preheat oven to 350 degrees. Saute onion in small amount light vegetable or olive oil until tender. Add TVP to onions and heat through.<br>In 2.5-3 qt. casserole dish combine beans, brown sugar, catsup and vinegar and mix until well blended. Add BacOs and onion/TVP mixture and stir well.<br>Bake uncovered for 45 to 60 min.', 113, '2002-04-01 17:10:50', NULL),
(62, 'Angel Hair Pasta with Basil Pesto', 'Adapted from Vegetarian Nights: fresh from Hawaii written by Bonnie Mandoe.', '1/2 c. extra virgin olive oil<br>2 cloves garlic<br>4 c. fresh basil leaves, packed<br>1/2 c. pine nuts<br>salt to taste<br>1 lb Angel Hair Pasta', 'Place pesto ingredients in blender.<br>Blend to a smooth paste.<br>Cook pasta according to pkg. directions.<br>After draining pasta, mix the pesto in immediately.', 101, '2002-04-01 17:34:31', NULL),
(63, 'Curried Potatoes and Peas', '', '3 Tbsp. vegetable oil<br>1 onion, finely chopped<br>1 inch fresh ginger, peeled and finely chopped<br>2 garlic cloves, chopped<br>1 tsp. turmeric<br>16 oz. frozen peas<br>8 oz. potatoes, cubed<br>1 tsp. salt<br>2 Tbsp. coriander leaves, chopped<br>juice of 1/2 lemon', 'Heat  oil in a saucepan. Add the onion and fry until it is soft. Stir in ginger, garlic and cook for an additional 5 min., stirring frequently. Stir in turmeric, then peas, potatoes and salt.<br>Reduce the heat to low, cover the pan and simmer for 20 min. Add a spoonful or two of water if the mixture becomes too dry.<br>Stir in coriander leaves and lemon juice, and simmer for another 10 to 15 min., or until the vegetables are tender.', 115, '2002-04-01 18:24:15', NULL),
(64, 'Yummy Dal', '', '7 c. vegetable stock or vegetable bouillon<br>1 lb yellow or green split peas<br>1 medium onion, chopped<br>2 medium carrots, sliced into 1/4 inch rounds<br>2 medium boiling potatoes, unpeeled, cut into 1/2 inch cubes<br> juice of 1 lemon<br>2 Tbsp. canola oil<br>2 tsp. cumin seeds<br> 1 tsp. black mustard seeds<br>2 tsp. curry powder<br>1 tsp. ground coriander<br>1 tsp. ground cumin<br>1 tsp. turmeric<br>1 tsp. finely grated fresh ginger<br>2 garlic cloves, minced<br>1 tsp fine sea salt<br>1/8 tsp. cayenne pepper', 'Put the vegetable stock and split peas into a large pot. Cover and bring to a boil over medium-high heat, then immediately reduce the heat and simmer until the peas are beginning to get tender, about 25 min.<br>Stir in the onion, carrots and potatoes, cover, and return to a boil over medium-high heat. Immediately reduce the heat and simmer, stirring occasionally, until the potatoes are almost tender, about 15 min.<br>Meanwhile, in a small frying pan, heat the canola oil over medium heat.<br>Add the cumin seeds, mustard seeds, curry powder, coriander, cumin, turmeric, ginger, garlic, salt and cayenne.<br>Cook, stirring constantly, until the mustard seeds begin to pop, about 30 sec. Remove from the heat.<br>Stir  the spice mixture and lemon juice into  the split peas.<br>Cover and return to a boil over medium-high heat, then immediately reduce the heat and simmer, stirring occasionally, for 5 min.<br>Mash some of the vegetables and split peas until the DAL reaches the desired consistency. Serve immediately.', 115, '2002-04-01 18:44:17', NULL),
(65, 'Easy Lemon Sugar Snaps', '', '3/4 c. Earth Balance, softened<br>3 Tbsp. applesauce<br>1 pkg. 2-layer-size vegan lemon cake mix<br>1 c. yellow cornmeal<br>2 Tbsp. finely shredded lemon peel, coarse sugar or granulated sugar', 'Preheat oven to 375 deg.<br>In a large mixing bowl beat butter and egg with an electric mixer on medium to high speed for 30 sec. Gradually beat in cake mix until combined; stir in cornmeal and lemon peel.<br>Using 1 Tbsp of dough for each cookie, roll  into 1-in.balls. Roll in sugar. Place 2 in. apart on ungreased cookie sheets. Bake for 9 or 10 min. or until bottoms are lightly browned. Let cool on cookie sheet for 1 min. Transfer to wire rack. Cool complete', 104, '2002-04-27 20:21:48', NULL),
(66, 'Banana Blueberry Ice Cream', '', '1/4 c. ground flaxseed<br>2 bananas<br>1-16oz. bag frozen fruit', 'Place in blender with 1/2 c. of water. Eat or freeze for later.', 108, '2002-04-27 20:33:31', NULL),
(67, 'Mock Vegan Chicken Salad', '', '"Wheat Meat"<br>"Vegenaise"<br>pasta noodles<br>olives<br>celery<br>onion powder', 'Mix in ingredients in a bowl and serve.', 110, '2002-04-27 20:36:38', NULL),
(68, 'Tofu Corn Bread Casserole', '', '2 cans organic corn<br>One 1 lb. tofu (crumbled)<br>1 box organic cornmeal muffin mix<br>4 oz.(8Tbsp) vegan sour supreme(Tofutti)<br>2 Tbsp soy margarine (chopped up or melted)<br>Add garlic, black pepper and sea salt to taste', 'Mix all ingredients together in a bowl.<br>Grease a casserole dish.<br>Bake at 350 deg. for 1 hr. or until knife in center comes out clean.', 105, '2002-04-27 20:40:13', NULL),
(69, 'Cauliflower and Onion Pakoras', 'Traditional Indian Appetizer', '2 med. onions, cut into slices<br>1 head of cauliflower, cut into 1 in. flowerettes<br>2 c. Besan(gram) flour<br>3 tsp. chili pepper<br>4 tsp. coriander/cumin powder (50/50 mix)<br>2.5 tsp. salt<br>4 tsp. sugar<br>Juice of 1 lemon', 'Mix all ingredients (except for veggies) together to form a smooth batter.<br>Preheat deep fryer at 340 deg.<br>Dip each  cut veggie  piece and place in fryer( batch size depends on fryer capacity).<br>Fry for 10 min. for cauliflower and 5 min. for onion.', 114, '2002-04-27 20:51:04', NULL),
(70, 'Delicious Vegan Dip', '', 'Tofutti " cream cheeze "<br>Hormel Vegetarian Chili<br>Tofutti " sour cream "', 'Spread "cream cheese" on the bottom of a pie pan, pour can of chili on top.  Bake at 350 for 30 min. Eat with tortilla chips.', 110, '2002-04-27 21:00:52', NULL),
(71, 'Yummy Vegetarian Salad', '', 'Celery<br>frozen or fresh peas<br>fresh tomatoes<br>cucumbers<br>onion<br>garlic- minced<br>carrots<br>broccoli<br>cauliflower<br>mushrooms<br>twisted macaroni (colored)<br>dill weed<br>black pepper<br>garlic powder<br>parmesan cheese as desired<br>Italian Dressing', 'Mix ingredients and serve.', 110, '2002-04-27 21:04:58', NULL),
(72, 'Calico Beans', '', '12 oz. textured vegetable protein(TVP) o.k. to use 6 oz. TVP<br>1/2 c. "BacOs"<br>1/2 to 1 c. chopped onion<br>One 16oz. can kidney beans<br>One 16oz. Lima beans<br>One 28oz. can  vegetarian baked beans<br>3/4 c. brown sugar<br>1/2 c. catsup<br>2 Tbsp. apple cider  vinegar', 'Preheat oven to 350 deg.<br>Saute onion in small amount light vegetable or olive oil until tender. Add TVP to onion and heat through.<br>In 2.5 to 3 qt. casserole dish combine beans, brown sugar, catsup and vinegar. Mix until well blended. Add "BacOs" and onion/TVP mixture and stir well.<br>Bake uncovered for 45 to 60 min.', 113, '2002-04-27 21:20:30', NULL),
(73, 'Glazed Carrots', 'From PETA''s "The Compassionate Cook"', '2 c. peeled and sliced carrots<br>1 medium onion, diced<br>1/4 c. packed light brown sugar<br>2 Tbsp margarine, melted<br>1/4 tsp. ground cinnamon', 'Steam carrots in small amount of water until tender, about 8 min. Drain thoroughly.<br>In a medium saucepan, combine carrots, onion, brown sugar, margarine and cinnamon. Mix well. Simmer for 15 minutes or until onions are tender. Stir occasionally.', 115, '2002-04-27 22:14:49', NULL),
(74, 'Vegetable/Grape Salad', '', 'Avacodo<br>Tomatoes<br>Yellow pepper<br>onions<br>garlic<br>olives<br>grapes<br>lettuce<br>Dressing<br>vinegar<br>balsamico<br>lemons<br>olive oil<br>honey', 'Mix ingredients. Toss and serve.', 110, '2002-04-28 21:23:14', NULL),
(75, 'Andy''s Vegan Pizza', '', 'SROUT GRAIN CRUST<br>2 c. wheat berries,  soak for 2 days<br>1/4 c. olives<br>2 cloves garlic<br>MOCK CHEEZE<br>1 pkg. Mori Nu firm tofu<br>1 pkg. Mori Nu Italian mix', 'Oil pizza pan.<br>Masticate in a food mill wheat berries, olives and garlic.<br>Blend together components of Mock Cheeze(Mori Nu firm Tofu and Mori Nu Italian mix)<br>Add your choice of toppings and bake at 400 deg. for 20 min.', 103, '2002-04-28 21:29:09', NULL),
(76, 'Lentil Pate', '', '1 c. lentils, uncooked (7.5 oz.)<br>4 c. water<br>2 tsp. vegetable oil<br>1 to 1.5 c. chopped onions<br>1/4 tsp. salt<br>1/4 tsp. pepper', 'Bring water to a boil in a medium saucepan. Add lentils, cover pot, reduce heat, and simmer 40 to 45 min. until lentils are tender. Drain.<br>Heat oil in a large nonstick skillet over medium heat. Add onions and cook until browned. Stir frequently and add small amounts of water, if necessary to avoid sticking.(The secret to the flavor of this dish is to make sure the onions are nicely browned.)<br>In a food processor, combine lentils, cooked onions, salt, and peppers. Process until smooth.<br>Transfer to a bowl and chill several hours to blend flavors.<br>Serve on crackers or make a delicious sandwich on rye bread with lettuce, tomato and sliced onion.', 114, '2002-04-28 21:40:49', NULL),
(77, 'Cheese Factory Corn Bread', '', '1 c. flour<br>1 c. yellow cornmeal<br>1 Tbsp. baking powder<br>1 tsp. salt<br>1/2 c. sugar<br>3 large eggs, beaten or egg replacer<br>1/2 c. buttermilk<br>1/2 c. milk<br>1/4 c. butter, melted<br>1 tsp vanilla extract', 'Preheat oven to 425 deg.<br>Spray a 9-in. round cake pan with nonstick cooking spray and lightly flour.<br>Mix flour, cornmeal, baking powder, salt and sugar in a medium bowl. In a separate bowl, combine eggs, buttermilk, milk, butter and vanilla; stir well.<br>Add egg mixture to dry ingredients; stir just until ingredients are moistened.( Do not overmix.)<br>Pour batter into prepared pan and bake 20 to 25 min. until golden in color.<br>Remove from oven and invert onto round plate. Carefully remove from plate and cool on wire rack.', 109, '2002-04-28 22:17:57', NULL),
(78, 'QUICK SPANISH RICE', '', '1 medium onion thinly sliced<br>1 medium green pepper chopped<br>28 oz tomato sauce<br>1 tsp prepared mustard salt pepper<br>1/4 c. oil', 'Add onion, green pepper, rice and 1/4 c. oil in pan. Stir on high heat until lightly brown.<br>Add tomato paste, 2-1/2 c. hot water and remaining ingredients. Bring to a boil then cover and simmer 25 min.', 116, '2002-06-09 10:49:01', NULL),
(79, 'Green Beans and Chickpeas', '', 'Dressing----- 2 T. red wine vinegar, 1 T. olive oil, 1/2 tsp. garlic, minced<br>2 C. green beans cut into 1 in. pieces<br>1 C. chickpeas, rinsed and drained', 'Mix together the dressing ingredients and set aside.<br>Steam the green beans for 4 min.<br>Toss together the steamed green beans and the chickpeas with the dressing. Serve warm or chilled.', 110, '2002-06-09 10:56:16', NULL),
(80, 'Original Pepper Tofu Jerky', '', '1 lb. extra-firm tofu<br>1/2 c. Braggs or soy sauce<br>3-4 Tbsp liquid smoke<br>1/8 c. water<br>1 Tbsp. onion powder<br>1 tsp garlic powder or 1 clove garlic, crushed<br>1 Tbsp. pepper<br>1 tsp. sweetner', 'Cut the drained tofu into long narrow strips(about 1/4 in. thickness).<br>In a small bowl, whisk together the Braggs, liquid smoke, water, onion powder, garlic, pepper and sweetner.<br>Place the tofu strips in a shallow baking pan or on a cookie sheet and pour the marinade over them. Let them marinate for several hours or overnight for best results.<br>Cook the tofu in a food dehydrator or bake in the oven for about 4-6 hours at 200 deg. F.<br>Turn the tofu over once every hour so it bakes evenly. Continue until the texture is very chewy, but not crisp.<br>Tofu jerky will keep indefinitely. Store in a container with a tight-fitting lid.', 114, '2002-06-09 11:02:57', NULL),
(81, 'Spanish Dal', '', '1 Tbsp. oil<br>1 onion, peeled and chopped<br>1 garlic glove, crushed<br>1 dried red chili, crumbled<br>1 tsp. ground coriander<br>1/4  tsp. ground tumeric<br>2/3 c. lentils<br>2-1/2 c. water<br>1/2 lb spinach washed<br>salt and pepper', 'Heat oil in a large saucepan and put in onion. Let them cook covered for 10 min.<br>Add garlic, chili and spices. Cook for 1 min., stirring, then add lentils. Stir, then add water. Bring to boil. Simmer, uncovered for 30 min.until soft.<br>Add spinach to pan and cook for about 10 min.<br>Add season and serve.', 113, '2002-06-09 11:36:46', NULL),
(82, 'Jeera Rice', '', '1 c. rice<br>2 c. water<br>1 black cardemom<br>2 cinnamon sticks<br>1 bay leaf<br>2 tsp. cumin seeds<br>2 Tbsp. Ghee<br>Salt to taste', 'Wash and soak rice 1/2 hour before preparing. Drain the rice.<br>Heat ghee and add cumin seed, bay leaf, cardemom and cinnamon sticks.<br>When cumin seeds sizzle, add drained rice and stir to coat rice.<br>Add salt and water. Bring to a boil. Reduce the heat to low and cover with a lid. Leave a little opening for the steam to escape.<br>When holes appear on top, rice is done.', 116, '2002-06-09 11:47:18', NULL),
(83, 'Sesame Pasta Salad', '', '4 oz. dry pasta<br>1 carrot, shredded<br>1/2 bell pepper, slivered<br>2 radishes, sliced<br>1 green onion, minced<br>Dressing:<br>3 Tbsp. Rice Vinegar<br>1 Tbsp. Soy Sauce<br>2 Tbsp. Oil<br>2 Tbsp. Sesame seeds<br>Pepper to taste', 'Cook pasta.  Drain.<br>Mix together the dressing ingredients.<br>Combine pasta, vegetables, and dressing.  Toss gently.', 110, '2002-06-24 21:10:16', NULL),
(84, 'Cucumber Pea Salad', '', '8 oz. pasta rings, cooked al dente<br>1 c. fresh or frozen peas, steamed<br>1/2 c. chopped onion<br>1 large cucumber, chopped<br>1/4 c. chopped chives<br>1 c. Vegenaise<br>Salt, pepper, and some sugar to taste (can use sucanat)', 'Combine pasta and veggies. Separately mix vegenaise and spices. Add everything together.  Serve chilled.', 110, '2002-06-24 21:27:06', NULL),
(85, 'Macaroni Salad', '', '4 c. macaroni, uncooked<br>1 med. onion, diced<br>3 stalks celery, diced<br>1 small jar pimento, diced<br>sweet pickle relish, to taste<br>1 c. frozen peas, rinsed, thawed & drained<br>Yves vegan bologna, diced<br>Vegan mayo & Tofutti Sour Supreme, to taste<br>Salt & Mrs. Dash, to taste', 'Mix everything together. Chill before serving.', 110, '2002-06-24 21:34:36', NULL),
(86, '"Shrimp" Appetizer/Dip', '', '8 oz. Tofutti Mock Cream Cheese<br>6 oz. Cocktail Sauce<br>6 Veggie Shrimps (from vegieworld.com)', 'Spread the Tofutti mock cream cheese on a 10 inch plate.<br>Spread the cocktail sauce on top of the Tofutti.<br>Slice the Veggie Shrimp into coins and place on top of the dip.  Eat with your favorite crackers!<br>*To purchase Veggie Shrimp, go to www.vegieworld.com.  It is a frozen product and they will ship it overnight to your door.', 114, '2002-10-18 21:03:40', NULL),
(87, 'Vegetable Salad', '', '2 cans of peas, drained<br>1 c. green onions, chopped<br>1 c. radishes, sliced<br>2 c. celery, sliced<br>2 c. carrots, shredded<br>2 c. cauliflower buds<br>2 c. broccoli buds<br>DRESSING:<br>1/3 c. oil<br>2/3 c. vinegar<br>1 c. sugar<br>2 tsp. salt<br>1/8 tsp. pepper', 'Put prepared vegetables into a large bowl.<br>In a separate bowl, Mix dressing ingredients until sugar is dissolved.<br><br>Pour over vegetables, cover and let marinate for 24 hours in a refrigerator.  Makes 10 cups.', 110, '2002-10-18 21:09:57', NULL),
(88, 'Corn & Black Bean Salad', '', '4 c. fresh sweet corn, or 2 cans corn, drained<br>2 cans black beans, drained<br>2-3 large stalks of celery<br>1/2 to 1 whole green pepper, diced<br>1/2 to 1 whole red pepper, diced<br>green onions, a large handfull<br>fresh chopped cilantro, a large handfull<br>DRESSING:<br>1/4 c. olive oil<br>1/4 c. red wine vinegar<br>1/4 c. Balsamic vinegar<br>1 to 2 Tbsp. sugar (to taste)<br>fresh ground black pepper', 'Combine dressing ingredients and mix well until sugar in dissolved.<br>Add dressing to salad ingredients.  Mix well, then chill.', 110, '2002-10-18 21:19:40', NULL),
(89, 'Escalloped Corn', 'This is a vegan version of a classic, Thanksgiving side dish.', '2 egg equivelents (1 Tbsp. Egg Replacer)<br>2 c. corn<br>1 c. plain soy milk<br>1/4 tsp. salt<br>1/8 tsp. pepper<br>1 c. cracker crumbs (Saltines)<br>3 Tbsp. margarine', 'Mix all ingredients except the margarine.<br>Pour mixture into a greased baking dish.  Put the margarine on top of the mixture.<br>Bake for 45 min. at 325 degrees.', 113, '2002-10-18 21:30:12', NULL),
(90, 'Corn Bread', '', '3 cups cornmeal<br>2 cups white flour<br>1 T. baking powder<br>1/2 t. baking soda<br>1/2 c. sugar<br>1 t. salt<br>2 cups soy milk<br>1/2 cup vegetable oil', 'Preheat oven to 400 degrees F.<br>Mix lightly and put in oiled 9 x 12 pan. Bake 20 minutes.', 109, '2003-02-07 18:04:40', NULL);
INSERT INTO `recipes` (`id`, `title`, `description`, `ingredients`, `instructions`, `category_id`, `created_at`, `updated_at`) VALUES
(91, 'Cheesecake Bars', 'Cheesecake Bars that are fun and easy to make.  Origional recipe made veagn for a lemon cheesecake bars from Cookies! A cookie lovers collection by Cy Decosse Inc.', '1 3/4 cups crushed vanilla wafers (crust)<br>1/2 cup oil or soy butter (crust)<br>8 oz package Tofutti cream cheese<br>1/3 cup sugar<br>1/2 cup Tofutti sour cream<br>1 egg equivalent (egg substitute/replacer)<br>1 tsp vanilla extract', 'Preheat oven to 350 degrees.<br>In a bowl, mix vanilla wafers and oil until the wafers are well coated.<br>Press mixture evenly onto an ungreased 8 inch square pan to form the crust and set aside.<br>In another bowl, beat the cream cheese and sugar at medium speed until smooth.<br>Add the reamining ingredients and beat until smooth.  Spread the  mixture evenly over the crust in the pan.<br>Bake for 50-55 minutes ot until the top of the cheesecake is light-golden brown.<br>Refrigerate completely before serving.', 108, '2003-02-20 14:52:17', NULL),
(92, 'Paolucci Pasta Salad', '', 'bow or rotini pasta - el dente (cooked)<br>2-3 tablespoons olive oil<br>lemon juice from 1/2 lemon<br>white wine vinegar<br>black olives<br>feta cheese<br>fresh basil<br>chives<br>1 zucchini<br>halved grape tomatoes', 'Give or take any vegetables you like as long as the ingredients are balanced in quantity.<br>Combine everything, and let it marinate for around 8 hours to allow the flavors to absorb into the vegetables and pasta.<br>Flavor to taste with salt.', 110, '2003-02-22 15:21:18', NULL),
(93, 'Green Onion Wheat Rolls', '', '1 pck. dry yeast (dissolved in 1/4 cup 85 degree water)<br>1 1/2 cup warm water<br>4 cups wheat flour<br>1 teaspoon sugar<br>1 teaspoon salt<br>1 tablespoon olive oil (shortening & margarine may also be used)<br>1 bunch chopped green onions', 'Combine ingredients and let rise for 2 hours.<br>Roll dough into balls and place on oiled baking sheet.<br>Glaze tops of balls with olive oil, and sprinkle with sesame seeds.<br>Bake at 400 degrees for 15 minutes, then at 350 degrees for another 30 minutes.', 109, '2003-02-22 15:30:40', NULL),
(94, 'Almond and Orange Salad', '', '1 head red leaf lettuce<br>1 can mandarin oranges, drained and rinsed<br>sliced almonds<br>sliced carrots<br>sliced yellow pepper<br>sliced red onion', 'Toss ingredients in a large bowl and serve fresh.', 110, '2003-02-22 15:37:54', NULL),
(95, 'Vegan Chili', '', '1 whole sweet onion<br>1 green pepper<br>1 red pepper<br>5 garlic cloves<br>2 cans kidney beans<br>1 can tomato sauce<br>1 can black beans<br>1 can stewed tomatoes<br>chili powder<br>garlic powder<br>cumin<br>Ms. Dash seasoning', 'Saut? onions, garlic, and peppers until golden brown<br>Add beans, tomatoes, and sauce, stirring occasionaly.<br>Season to taste with salt, pepper, and other spices.', 119, '2003-02-22 15:42:18', NULL),
(96, 'Cheesecake Bars', '', '3/4 cups crushed vanilla wafers<br>1/3 cup sugar<br>1 egg equivalent (egg substitute/replacer)<br>1 tsp vanilla<br>1 8 oz package of tofutti cream cheese<br>1/2 cup tofutti sour cream<br>1/2 cup oil', 'Preheat oven to 350 degrees.<br>In a bowl, mix wafers and oil.<br>Press evenly onto ungreased 8 inch square pan.<br>Set aside.<br>In another bowl, mix together cream cheese and sugar.<br>Beat at medium speed until smooth.<br>Add remaining ingredients.<br>Beat at medium speed until well blended.<br>Spread evenly over crust.<br>Bake 50-55 minutes or until light golden brown.<br>Cool completely and serve.<br>Keep refrigerated.', 114, '2003-02-24 17:55:31', NULL),
(97, 'Roasted Red Potatoes with Wild Mushroom Sauce', '', '2 cups wild mushroom stock (see recipe on this site)<br>2 tsp. dijon mustard<br>1 tsp. tomato sauce<br>flour<br>for potatoes:<br>10 baby red potatoes<br>2 leaves basil, chopped<br>2 cloves garlic, minced<br>4 tbsp. olive oil<br>1 tbsp. oregano, chopped<br>1 tsp. rosemary, chopped<br>pinch of black pepper', 'Heat olive oil in frying pan.<br>Saute herbs, garlic, pepper, and cook over low heat for 5-10 minutes.<br>Cut potatoes into 1/2 inch cubes.<br>Grease baking pan and preheat oven to 400 degrees.<br>Coat potatoes with oil mixture<br>Spread potatoes in baking pan<br>Bake potatoes approx. 30 minutes or until tender.<br>For the sauce, combine the mushroom stock, mustard, and tomato sauce in a saucepan, and whisk until blended.<br>Heat mixture to boiling, stirring often.<br>Add flour 1 tbsp. at a time, and whisk until smooth. Continue adding flour until the sauce thickens.', 113, '2003-02-28 12:57:47', NULL),
(98, 'Wild Mushroom Stock', '', '9 cups water<br>1 cup scallions, chopped<br>2 basil leaves, chopped<br>1/2 oz. dried porcini mushrooms<br>3 large portabella mushroom caps.<br>1 cup madeira wine<br>2 tbsp. olive oil<br>1 tbsp. rosemary, chopped', 'Soak porcini mushrooms to hydrate.<br>Slice all the mushrooms and chop scallions.<br>Add olive oil to large cooking pot and saute mushrooms and scallions in the olive oil.<br>Add the water and the madeira wine to the pot, and heat to boiling.<br>Add the chopped basil and rosemary, and boil to reduce liquid. Continue boiling until liquid is reduced to 2-3 cups.<br>Remove from heat, and strain it to remove all solids.<br>Cover and refrigerate. Use for soup or sauce.', 119, '2003-02-28 13:07:50', NULL),
(99, 'Curry Rice', '', 'Steamed rice<br>3 tbsp. peanut butter<br>1 tbsp. orange juice concentrate<br>3 tbsp. brown sugar<br>1 1/2 cups soy milk<br>2 tbsp. pataks curry paste', 'Melt the curry, peanut butter, orange juice concentrate, and sugar in simmering soy milk.<br>Once combined, simmer chopped veggies of your choice until just soft.<br>Pour the sauce over steamed rice.', 116, '2003-03-10 21:09:13', NULL),
(100, 'Apple Cider Vegetables', '', '2 cups asparagus pieces<br>1 cup artichoke hearts<br>2 cups carrots, sliced<br>1-2 cups apple cider<br>pinch of sea salt<br>2 tsp. apple cider vinegar', 'Combine apple cider and apple cider vinegar in a frying pan.<br>Steam vegetables until tender.<br>Add vegetables to cider and vinegar, heat over high heat.<br>Add sea salt to taste.', 113, '2003-03-10 21:39:10', NULL),
(101, 'Rhubarb Dessert', '', '1 cup margarine<br>2 cups flour<br>4 tbsp. sugar<br>Egg substitute = 6 tbsp. ground flax seed and 1 cup water<br>2 cups sugar<br>5 to 6 cups cut up rhubarb<br>4 tbsp. flour<br>1 cup soy milk<br>2 tbsp. vanilla', 'To make the crust, mix margarine, 2 cups flour, and 2 tablespoons sugar in the bottom of a 9 x 13 cake pan, and bake for 5 minutes at 350 degrees.<br>Mix half of the egg substitute, 2 cups sugar, rhubarb, 4 tablespoons flour, soy milk, and pinch of salt.<br>Pour mixture over the crust, and bake for 45 minutes at 350 degrees.<br>To make the topping, mix the other half of the egg substitute with 2 tablespoons of sugar and 2 tablespoons of vanilla with an electric mixer. Then pour the topping over the rhubarb dessert and bake for another 10 minutes, or until the center of the toppi', 108, '2003-03-10 21:42:46', NULL),
(102, 'Lemon and Avocado Pasta', '', '1/3 cup lemon juice<br>1/2 cup canola oil<br>1/2 tsp. paprika<br>1 clove garlic<br>1/4 cup parsley<br>1 sliced avocado<br>1/2 pound mushrooms', 'Mix the lemon juice, oil, and paprika together.<br>Mince 1 clove garlic and parsley and add to the oil mixture along with the sliced avocado.<br>Slice mushrooms and add to the mixture.<br>May be served over hot or cold pasta.', 101, '2003-03-10 21:57:33', NULL),
(103, 'Vegetarian Chili', 'Quick, easy and economical.', '1 tbsp. oil<br>1 chopped onion<br>1 1 lbs. 3 oz. can of meatless vege-burger<br>1 14.5 oz. can of whole tomatoes<br>2 15.5 oz. cans of chili beans<br>1 15.5 oz. can of black beans<br>1 15.5 oz. can of red beans<br>1 15.5 oz. can of kidney beans<br>1 15 oz. can of tomato sauce<br>1/2 1.25 oz. packet of hot chili seasoning mix', 'In a large pot, over medium heat, cook onion in oil.<br>Add Vegetarian Burger and brown slightly.<br>Then add the remaining ingredients, heat thoroughly, and serve!', 105, '2003-03-10 22:03:06', NULL),
(104, 'Pav-Bhaji Spicy Bread Spread', '', 'Margarine<br>2 tsp. garlic paste<br>2 chopped onions<br>2 chopped tomatoes<br>3 cups cooked vegetables such as potatoes, green peas, green bell peppers, and cauliflower<br>1 tbsp. pav-bhaji masala,  which is available at an Indian foods store<br>2 tbsp. oil', 'Shallow fry 2 tbsp. garlic paste and chopped oinon in oil until soft.<br>Add tomatoes, pav-bhaji masala, and a pinch of salt.<br>Add cooked vegetables. Cook for 5 to 10 minutes. Then mash the vegetables for 2-3 minutes.<br>Add a blob of margarine.', 99, '2003-03-10 22:11:03', NULL),
(105, 'Spinach Strawberry Salad', '', '1 bag fresh spinach<br>thinly sliced onion<br>mandarin oranges<br>washed, dried, and cut strawberries<br>1/2 cup oil<br>1/4 tsp. garlic powder<br>1/4 tsp. salt<br>1/4 tsp. dry mustard<br>1/4 cup red wine vinegar<br>1/4 cup (scant) honey<br>1/4 tsp. onion powder<br>1/4 tsp. pepper', 'In a covered container, mix and shake the oil, garlic powder, salt, dry mustard, red wine vinegar, honey, onion powder, and pepper.<br>Pour the mixture over the spinach, onion, mandarin oranges, and strawberries and toss gently.<br>Optional nuts:<br><br>In a pan, melt butter (margarine) and whatever nuts or seeds that you prefer, and brown them. Cool them before tossing them in with the salad.', 110, '2003-04-20 20:02:47', NULL),
(106, 'Ginger Bread', 'Ginger is known for its healing properties and spicy taste. It turns this already dynamic loaf into a Spice Capade!', '3 cups flour<br>2 1/2 tsp. baking powder<br>1/2 tsp. baking soda<br>1/2 tsp. salt<br>1 tsp. allspice<br>egg replacer (to equal 2 eggs)<br>1/2 cup oil<br>1/2 cup molasses<br>1 cup soy milk<br>1 tsp. vinegar<br>3 to 6 tbsp. fresh ginger, grated<br>1/2 cup crystallized ginger, chopped (optional)<br>1/2 cup walnuts', 'Preheat oven to 350 degrees Fahrenheit.<br>In a large bowl, sift together the flour, baking powder, baking soda, salt, and allspice.<br>Add the egg replacer, oil, molasses, milk, vinegar, ginger, optional crystallized ginger, and nuts.<br>Mix together gently until "just mixed."<br>Spoon the batter into a lightly oiled loaf pan and bake for 50 minutes.<br>Test with a knife to see if done.<br>Let cool for 10 minutes before slicing and serving.', 109, '2003-04-20 20:10:25', NULL),
(107, 'Vegan Spaghetti', '', '1 box 16 oz. spaghetti noodles<br>2 jars 26 oz. Five Brother Bertolli Summer Vegetable Sauce<br>2 cloves garlic, chopped<br>1/2 package lightlife smart ground', 'Prepare spaghetti noodles according to the directions on the box.<br>Add the heated spaghetti sauce, smart ground, and garlic and stir.', 101, '2003-04-20 20:18:01', NULL),
(108, 'Vegan Wild Rice Soup', '', '1 cup wild rice, or one 12 oz. pkg pre-cooked wild rice<br>4 cups salted water (omit if using pre-cooked rice)<br>1 large onion, chopped (or 3 heaping tbsp. dried flakes)<br>2 cloves garlic, crushed (or 1/4 tsp. dried garlic)<br>1-2 carrots, chopped<br>1 cup broccoli florets<br>1 cup cashews blended + 1 cup water to form a cream<br>2 cups water<br>1/8 tsp oregano<br>1/8 tsp thyme<br>1/8 tsp marjoram<br>salt to taste', 'Saut? onion and garlic in 1 tbsp. olive oil.<br>Add rice to the 4 cups of salted water and bring to a boil.<br>Let simmer for 45 minutes, until the rice is cooked.<br>Then mix the 1 cup blended cashews, 2 cups water, Braggs amino acids, fake chicken seasoning, oregano, thyme, marjoram, and salt.<br>Add the cooked rice, vegetables, and saut?ed ingredients.', 119, '2003-04-20 20:26:28', NULL),
(109, 'Bread Pudding', '', '4 cups bread chunks<br>2 cups soy milk<br>1/2 cup raisins<br>1 teaspoon cinnamon<br>1/2 cup sugar', 'Preheat oven to 350 degrees Fahrenheit.<br>Combine all ingredients in a deep, glass, bake-safe container and bake for about 30 minutes.', 108, '2003-04-21 15:54:46', NULL),
(110, 'Handvo Indian Spice Cake', '', '1/4 cup oil<br>3 cups rice<br>1 cup split chick peas<br>1 cup tuvar dal<br>1 cup spinach<br>2 tbsp. cilantro<br>1 tbsp. sugar<br>1 tsp. salt<br>2 tbsp. plain yoghurt<br>1 tbsp. lemon juice<br>1 tbsp. sesame seeds<br>1/2 tsp. chili powder<br>1/2 tsp. tumeric powder<br>1 tsp. mustard seeds<br>2 cloves of garlic<br>1 tsp. ginger', 'Soak the rice seperately for 4-5 hours in water.<br>Blend the rice after soaked, but not too smooth.<br>Also blend the Tuvar dal.<br>Add everything to the mixture except for the sesame seeds, mustard seeds, oil, and baking powder.<br>Heat the oil and then add it to the mixture including the sesame seeds, mustard seeds, and baking powder.<br>Mix it all together with a spoon.<br>Spray a glass baking pan with cooking spray and pour the mixture into it.<br>Put everything in the oven for 1/2 hour on 350 degrees. Let the bread cool before eating it. Try using ketchup.', 109, '2003-04-29 17:32:58', NULL),
(111, 'Banana-Bean Stew', '', '6 green-tipped bananas<br>1 cup pinto beano pepper<br>1 chopped jalapeno<br>1 onion, chopped<br>1 tablespoon vegetable oil<br>one 14 oz. can of stewed tomatoes', 'Peel the bananas, boil them for 10 minutes or until they begin to get soft; slice into bite-size chunks.<br>Heat oil in a large frying pan and saute onion and jalapeno for a few minutes.<br>Add beans and banana chunks, continuing to saute until they are coated in oil.<br>Pour the stewed tomatoes over the bananas and beans.<br>Add enough water to cover the whole mixture and simmer for 40 minutes or until the bananas are tender.<br>Serve hot.', 119, '2003-04-29 18:07:48', NULL),
(112, 'Sprouted Lentil Salad', '', 'raw sprouted green lentils<br>chopped yellow onion<br>red onion<br>fresh lemon juice<br>Udos Choice Oil Omega 3, 6, 9<br>fresh garlic<br>curry powder<br>chopped orange bell pepper<br>spinach<br>sliced roma tomatoes', 'Toss all ingredients gently and enjoy!', 110, '2003-04-29 21:52:39', NULL),
(113, 'Aunt Yvonne''s Rhubarb Bread', '', '1 1/2 cups light brown sugar<br>2/3 cup veg. oil<br>1/4 cup silken tofu<br>1 cup soy milk mixed with 1 tbsp. lemon juice - let stand 10 min<br>1 tsp. baking soda<br>1 tsp. salt<br>1 tsp. vanilla<br>2 1/2 cups flour<br>1 1/2 cups diced rhubarb<br>1/2 cup chopped pecans<br>1/3 cup white sugar<br>1 tbsp. margarine, melted', 'Preheat the oven to 350 degrees.<br>In a large bowl, combine the brown sugar, veg. oil and tofu and mix it with an electric mixer until smooth.<br>In another bowl, combine the soy milk, baking soda, salt, and vanilla.<br>Alternate adding the soy milk mixture and the flour to the sugar mixture, beating well after each addition.<br>Fold in the rhubarb and the pecans.<br>Pour the batter into a lightly greased and floured loaf pan.<br>Stir the white sugar and melted margarine, then sprinkle over the top of the loaf.<br>Bake for 50-60 minutes or until a toothpick inserted in the center comes out clean.', 109, '2003-04-29 22:41:24', NULL),
(114, 'Meatless Taco Salad', '', '1 head of lettuce torn into pieces<br>1 head of cauliflour finely sliced<br>1 bunch of green onions, diced<br>1 small chopped tomato<br>1 small can sliced black olives<br>1 ripe avocado cut into small pieces<br>Dressing - 1 1/2 cup vegenaise mixed with 1 package of taco seasoning from taco bell', 'Mix all ingredients gently.<br>Just before serving, stir the dressing into the salad along with 1/2 package of tortilla chips.', 110, '2003-04-29 22:54:26', NULL),
(115, 'Chocolaty Peanut Butter Krispies', '', '1 cup sugar<br>1 cup corn syrup<br>1 cup peanut butter<br>6 cups crispy rice cereal<br>2 cups chocolate chips', 'Cook the sugar and corn syrup in a medium saucepan over medium heat until bubbly.<br>Remove from heat and add the peanut butter. Pour over the cereal and mix well.<br>Spread the mixture in a 9 x 13 inch pan.<br>In a double boiler, melt the chocolate chips and pour over the ceral mixture.<br>Chill until firm and cut into squares.', 108, '2003-04-30 18:05:14', NULL),
(116, 'Falafels', 'Middle Eastern, Deep-fried, spicy chick pea batter.', '1 1/3 cups dried chickpeas<br>6 spring onions<br>2 tsp. coriander seeds<br>2 tsp. cumion seeds<br>1 clove garlic<br>2 tsp. chopped parsley<br>1 tsp. sea salt<br>1 tsp. baking soda<br>oil for deepfrying', 'Cover chickpeas with cold water and leave to soak overnight.  Drain well and grind in a food processor, liquidizer, or mincer.<br>Chop the scallions finely.  Grind the coriander and cumin.  Crush the garlic.<br>Combine all remaining ingredients with the chickpeas in a large bowl.  Mix thoroughly.<br>Form the mixture into small balls, the size of a walnut.  Deepfry them in oil which has been heated to 350-375F/180-190C until they are golden.  Drain thoroughly on paper towels.', 114, '2003-08-20 22:30:07', NULL),
(117, 'Hummus and Cucumber Pita Sandwiches', 'Sandwich with a Middle Eastern Flare', 'Pitas<br>Hummus<br>Cucumber<br>Other veggies (optional)', 'Warm the pitas.  Cut into 4 sections.<br>Spread the hummus into each section.<br>Slice the cucumbers and other veggies and add them to each section.<br>Serve.', 114, '2003-08-20 22:40:28', NULL),
(118, 'Almond Butter Cookies', 'Peanut Buttercookies adapted.', '2 cups almond butter<br>sugar<br>1 tsp vanilla<br>flour<br>baking powder<br>1 tsp. salt', 'whip together almond butter, sugar, and vanilla.<br>Sift flour with baking powder and salt.<br>Add dry ingredients to the wet ingredients and mix together.<br>Bake at 375F for 15 minutes.', 104, '2003-08-20 22:49:36', NULL),
(119, 'Popeye Mousse Pie', 'Raw and vegan.', '203 cups almonds, soaked 8-12 hrs<br>1 Tbs. Bragg Liquid Aminos<br>2-4 Tbs. Water or Lemon Juice<br>1 Tbs. Psyllium Powder<br>1 tsp. garlic hearb bread seasoning (spice hunter)<br>5 cups coarsely chopped spinach<br>1/2 cups raw pine nuts<br>1/3 - 1/2 cup lemon juice<br>1 Tbs. water<br>1/2 cup firm tofu<br>1 Tbs. red onion, chopped<br>1 Tbs. freshly chopped dill, or 1 1/2 tsp. deliciously dill spice (spice hunter)<br>1 stalk celery, coarsely chopped<br>2 tsp. psyllium powder', 'For the crust, process the almonds in your food processor until they are uniformly fine.<br>Add the liquid aminos and pulse-chop.<br>gradually add the water until m ixture holds together.<br>Finally, sprinkle the psyllium and seasoning while the processor is running.  Press into a 9-inch pan and set aside.<br>For the mousse, put in the food processor the spinach, lemon juice, Liquid Aminos, and water, and process until smooth.<br>Add the tahini, onion, and dill.<br>Process until the mixture is a thick puree.<br>Gradually sprinkle in the psyllium while the machine is running.<br>Press the pate into the pie crust immediately.<br>Refrigerate for at least 30 minutes or up to 24 hours before eating.', 100, '2003-08-20 22:54:00', NULL),
(120, 'Golden Cornbread', 'Adapted to make vegan.', '1 cup cornmeal<br>1 cup flour<br>1/2 tsp. salt<br>4 tsp. baking powder<br>2 Tbsp. sugar<br>1 egg (replacer)<br>1 cup soymilk<br>1/4 cup vegetable oil', 'Sift dry ingredients together in a bowl.<br>Add egg replacer, soymilk, and oil.  Beat until smooth.<br>Bake in 8-inch square pan for 20-25 minutes at 425F.<br>Serve warm.', 109, '2003-08-20 23:03:54', NULL),
(121, 'Zesty Cheese Spread', '', '1 small red pepper, chopped<br>1 Tbsp. olive oil<br>1 1/2 cups cashews<br>1/4 cup sesame seeds<br>1/2 cup water<br>1/4 cup lemon juice<br>1/4 cup olive oil', 'Saute the red pepper in the oil until soft.<br>Blend everything in a food processor.<br>Add 2/3 cup nutritional yeast and stir in.', 114, '2003-08-20 23:07:52', NULL),
(122, 'Greek Salad', '', '3/4 cup feta, cubed or crumbled<br>6 ripe, firm tomatoes<br>1/2 cucumber, cut into chunks<br>1 red onion, finely sliced<br>1/4 cup pitted kalamata olives<br>salt and pepper to taste<br>4 tbsp. olive oil<br>4 tbsp. fresh lemon juice<br>4 tbsp. red wine vinegar<br>1 tbsp. oregano<br>1 clove garlic, crushed', 'Mix together the last 6 ingredients and chill for an hour.<br>Pour the dressing over the salad and toss.<br>Serve immediately.', 110, '2003-08-20 23:11:53', NULL),
(123, 'Maple Walnut Pecan Milk', '', '1/2 cup walnuts<br>1/2 cup pecans<br>9 cups hot water<br>1/4 cup maple syrup<br>1/2 tsp. xanthum gum', 'Blend all ingredients.<br>Strain out nut meal.<br>Chill before serving.', 102, '2003-09-24 15:37:24', NULL),
(124, 'Cereal Bars', '', '1 cup brown sugar<br>1 cup karo syrup<br>1 cup peanut butter<br>6 cups rice krispies<br>12 oz. dark chocolate', 'Cook first 3 ingredients in a sauce pan until just boiling(do not overcook.)<br>Add the rice krispies and mix.<br>Pat in a dish.<br>Melt chocoalte and spread on top.<br>Let set before serving.', 108, '2003-09-24 15:41:13', NULL),
(125, 'Quinoa', '', '2 cups water<br>1 cup quinoa', 'Boil the water.<br>Add the quinoa.<br>Reduce temperature to low and let simmer for 15 minutes, covered.', 113, '2003-09-24 15:45:21', NULL),
(126, 'Oriental Salad', '', '1 bag Coleslaw Mix<br>1 tsp olive oil<br>1 pack noodles<br>1/2 cup chopped almonds<br>1-2 tbsp. sesame seeds<br>1 garlic clove, diced<br>3 green onions, chopped', 'Heat the oil in a pan.<br>Saute all the ingredients until lightly browned.<br>Top with dressing when ready to serve.', 110, '2003-09-24 15:47:32', NULL),
(127, 'Oriental Salad Dressing', '', '1/4 cup oil<br>1/4 cup or less of vinegar<br>1 tbsp. soysauce<br>1/4 cup honey or sugar to taste', 'Whisk together.<br>Top over the oriental salad when ready to serve.', 110, '2003-09-24 15:51:05', NULL),
(128, 'AsparaZincado Soup', 'From the Book:  Rejuvenating Recipes to Alkalize and Energize for Life!<br><br>"This great soup is rich in zinc and has a rich tomatoeeee flavor!"', '12 stalks medium Asparagus (or 17 thin stalks)<br>1 avocado<br>5-6 large tomatoes<br>1 cup fresh parsley<br>3-5 sun-dried tomatoes (bottled in olive oil)<br>1/4 cup dried onion<br>4 cloves fresh garlic<br>1 red bell pepper<br>bragg liquid aminos to taste<br>1-2 tsp. spice hunter herbes de provence<br>2 tsp. spice hunters deliciously dill<br>2 lemons or limes, cut in thin slices', 'Trim and dice the tips from the asparagus and set aside for a garnish.<br>In a food processor or vita-mix, blend the asparagus and red tomatoes, parsley, dried tomatoes, spices, garlic, onion, and red bell pepper.<br>Blend in the avocado until soup is smooth and creamy.<br>Warm in an electric skillet and garnish with lemon or lime slices on top.<br>Season with braggs to tast or serve cold in the summertime.<br>Sprinkle diced asparagus tips on top of soup just before serving.', 119, '2003-09-24 15:55:57', NULL),
(129, 'Basic Bread Recipe', 'From the book:  The New Enchanted Broccoli Forest', '2 cups wrist-temperature water<br>1 package active dry yeast<br>drop of molasses<br>1 1/2 cups whole wheat bread flour<br>4 tbs. olive oil<br>1/3 cup molasses<br>1 tbs. salt<br>3 more cups whle wheat bread flour<br>4 cups unbleached white flour<br>a little olive oil for the bowl and the pans', 'Place the water in a large bowl and sprinkle in the yeast.  Add the drop of molasses and let it stand for about a minute or two.<br>Beat in 1 1/2 cups whole what bread flour with a whisk, cover the bowl with a clean tea towel, and put it in a warm place to rise for 35-40 minutes.<br>Beat in the mix.<br>Add the additional flour 1 cup at a time, graduating from wooden spoon to floured hand as the dough thickens.  When all the flour is added, turn out the dough onto a clean, floured surface.<br>Knead the dough for about 10-15 minutes, adding extra flour, as necessary, to combat stickiness.<br>Oil the bowl, and roll the kneaded dough in it so its surface gets nicely coated.  Cover with a towel, and let it rise until its bulk has doubled.  (This will take aobut 1 1/2 - 2 hours.)<br>Punch down the risen dough, return it to the floured surface, and knead for another 5-10 minutes, adding flour if necessary.  Divide in half and form 2 loaves.  Oil 2 bread pans or baking trays, place the loaves in or on them, and cover with the towel.  L<br>If desired, brush the loaves with water or soymilk for various effects on the crust.  Bake for about 40 minutes, or until the loaves sound hollow when tapped resolutely on the bottom.  Remove the breads from the pans or tray right away, and cool on a rack<br>As an option, add 1 cup of dried fruit, nuts or cooked grains to the mix.', 109, '2003-09-24 16:05:00', NULL),
(130, 'Samosa', 'Pastry filled with potatoes, peas, and spices', '1/3 cup oil<br>1 tsp. mustard seed<br>1 tsp. cumin seed<br>1/2 tsp. asofoteda<br>1 large onion, diced<br>3 large potatoes, diced, uncooked<br>1 tsp. red chili powder<br>1/2 tsp. cumin powder<br>1/2 tsp. coriander powder<br>1 cup peas, frozen<br>1 tbsp. lemon juice<br>1 tbsp. sugar<br>salt to taste 2 cups chickpea (gram) flour 1 tsp salt 1 tbsp oil warm water', 'For the Filling:<br><br>Heat oil in large pot.  Throw in mustard seed.  Add cumin seed once the mustard seed starts to pop.  Add asofoteda.<br>Add the onion and cook for 5 minutes.<br>Add spices and mix well.  Cook for 5 minutes.<br>Add the peas and salt and cook til the potatoes are tender.<br>Let the mixture cool.<br>To make the pastry:  Place flour in a large mixing bowl.  Add the salt and mix well into the flour.<br>Make a well and add the oil.  Mix together.<br>Add enough warm water to form a soft yet somewhat sticky dough.  Knead for about 5 minutes.<br>Pull apart into 24 balls.  Roll each ball into a very thin round shape.  Use flour if necessary.<br>Wet the round with some water.  Place a little filling in the middle of the round.<br>Fold ends until filling is secured and the shape is triangular.<br>Place in a preheated deepfryer (375 degrees) for 5 minutes or until it is golden.<br>Serve warm.', 114, '2003-10-17 16:01:18', NULL),
(131, 'Fudge Brownies', '', '6 squares Bakers unsweetened baking chocolate<br>1 cup soy margarine<br>2 cups sugar, white<br>1 cup turbinado sugar<br>1 package of firm silken tofu, pureed<br>1 1/2 tsp. chocolate extract<br>1 1/2 cups flour<br>1 cup coarsely chopped macadamia nuts', 'Heat oven to 350 F (325 F for glass baking dish)<br>Oil a baking dish.<br>Microwave chocolate and margarine in large microwavable bowl on high 2 minutes until margarine is melted.  Stir until chocolate is completely melted.<br>Stir sugar into chocolate mixture until well blended.<br>Mix in pureed tofu and chocolate extract.  Stir in flour and nuts until well blended.<br>Spread in prepared pan.<br>Bake 30-35 minutes or until toothpick inserted in center comes out with fudgy crumbs.  Serve warm.', 108, '2003-10-17 16:19:43', NULL),
(132, 'Apple Dip', '', '16 oz. Better than cream cheese<br>1 1/2 cup brown sugar<br>2 tsp. vanilla', 'Melt everything together.  Serve warm or cold with apple wedges.', 114, '2003-10-17 16:28:08', NULL),
(133, 'Sundried Tomato Hummus', 'Raw', 'chickpeas, sprouted<br>garlic<br>olive oil<br>sundried tomatoes<br>salt<br>gamashio (seaweed)<br>basil, freeze dried<br>garam masala<br>lemon<br>raw tahini', 'Not sure.', 114, '2003-10-17 16:30:47', NULL),
(134, 'Tofu Manicotti', '', '1 lb. manicotti<br>2 lbs. firm or soft tofu, patted dry and mashed<br>2 cloves garlic, minced<br>1/2 cup soy milk<br>2 tbsp. olive oil<br>2 tbsp. lemon juice<br>1 tbsp. sugar<br>salt and pepper to taste<br>2 tbsp. minced fresh parsley<br>1 cup chopped fresh spinach (optional)<br>4 cups homemade or commercial spaghetti sauce', 'Prepare the manicotti according to package directions.  Gently drain and rinse the noodles.<br>Preheat the oven to 350 degrees.<br>In a large mixing bowl, stir together the mashed tofu, garlic, soy milk, olive oil, lemon juice, sugar, salt, pepper, parsley, and spinach, if using.<br>Line a 9 x 13-inch baking pan with 2 cups of the spaghetti sauce.<br>Gently spoon the tofu mixture into each manicotti until they are all full.<br>Place the filled manicotti noodles in one layer on top of the spaghetti sauce.<br>Pour the remaining sauce over the stuffed noodles.  Cover the pan tightly with aluminium foil and bake for 30 minutes, or until the sauce bubbles.', 101, '2003-10-17 16:34:24', NULL),
(135, 'Broccoli Salad', '', '1 bunch broccoli<br>1 small red onion<br>1 cup sunflower seeds<br>1 cup raisins<br>dressing:<br>2 tbsp. sugar<br>2 tbsp. vinegar<br>1 cup veganaise', 'Cut broccoli and onion.  Mix in sunflower seeds and raisins.<br>Mix dressing ingredients together and add to salad right before serving.', 110, '2003-11-18 00:48:30', NULL),
(136, 'pumpkin pie', '', '1 lb. firm silken tofu<br>16 oz. fresh pumpkin puree<br>1 1/4 cup granulated sugar<br>1 tsp. cinnamon<br>1 tsp. vanilla<br>1/2 tsp. ginger<br>1/2 tsp. nutmeg<br>1/4 tsp. ground cloves<br>1/4 tsp. allspice<br>egg replacer, equivalent to 1 egg<br>For the crust:<br>2 cups unbleached all-purpose flour<br>1 tsp. salt<br>1/4 cup cold water<br>2/3 cup solid vegetable shortening', 'Preheat oven to 375 degrees.<br>Blend the tofu in a blender or food processor until creamy and smooth.<br>Add the remaining ingredients and blend well.<br>Pour into the crust and bake about 1 hour, or until a toothpick inserted in the center comes out almost clean.<br>For the crust:  <br>Stir the flour and salt together in a bowl.  Take out 1/3 cup of the flour mixture and mix with the cold water to make a paste.  Set this aside.<br>With a pastry cutter or fork, cut the vegetable shortening into the remaining flour mixture until the texture becomes"pebbly."  Add the paste to the flour-shortening mixture and mix until it can be shaped into a ball.  Divide into 2 parts.<br>Lightly flour your rolling surface and your rolling pin.  Roll one portion of the pie dough at a time.  Roll from the center out, lifting the roller at the end of the dough (rather than rolling back and forth.)  Roll to a 1/8 inch thickness.<br>Have an 8- or 9- inch pie pan ready.  The rolled dough circle should be at least 2 inches larger than your pie pan.  Loosen the pastry from the rolling surface, fold it in half, lift it and lay it in the center of the pie pan.  Unfold the pastry, gently w<br>Fill with the pumpkin mixture.', 108, '2003-11-18 00:53:50', NULL),
(137, 'Holiday Loaf', '', NULL, NULL, 103, '2003-11-18 01:07:58', NULL),
(138, 'Apple Crisp', '', '6 apples, peeled and sliced<br>3/4 cup of oatmeal, uncooked<br>3/4 c. brown sugar<br>1/2 c. flour<br>1/2 c. margarine', 'Place apples in an 8 x 8 pan.<br>Mix margarine, sugar, flour, oatmeal until crumbly.<br>Place on top of apples.<br>Bake at 350 for 35 to 40 minutes.', 108, '2003-11-18 01:08:47', NULL),
(139, 'Garlic Mashed Potatoes', '', NULL, NULL, 113, '2003-11-18 01:09:24', NULL),
(140, 'Gravy', '', '2 1/2 tbsp. soy margarine<br>1/4 c. flour, wondra<br>1 1/2 c. vegetable broth, imagine no-chicken flavor<br>2 tbsp. soy sauce, tamari<br>1/4 tsp. black pepper<br>1/8 c. dried parsley', 'Melt margarine in a small sauce pan over medium heat.<br>Add flour and whisk together about 30 seconds; then add broth slowly while whisking.<br>Cook over medium heat for 2 minutes.<br>Add soy sauce and pepper. Continue cooking until gravy is thickened.', 101, '2003-11-18 01:10:05', NULL),
(141, 'Creamed Corn', '', NULL, NULL, 113, '2003-11-18 01:10:40', NULL),
(142, 'Harvest Nut Roast (Holiday Loaf)', '', '1 1/2 c. chopped onions<br>3 tbsp. water<br>2 tbsp. oil<br>2 1/2 c. finely chopped celery<br>3/4 c. chopped walnuts<br>3/4 c. ground pecans or sunflower seeds<br>1 1/2 tsp. salt<br>2 c. soy milk<br>1 1/4 tsp. basil<br>1/2 tsp. sage or 1 1/4 tsp. thyme<br>3 c. whole grain bread crumbs<br>1/4 c. firm silken tofu<br>oats', 'Saute onions in water and oil until clear.  Put into bowl and add remaining ingredients, omitting bread crumbs.<br>Stir together well.  Fold in bread crumbs.<br>Add blended tofu.  Add the rolled oats until desired firmness.<br>Pour into oiled 8" x 8" baking dish.  Bake at 350 for 60 minutes.  To prevent overbrowning on top, may need to cover with foil near end of baking.  Delicious served with country style gravy.', 103, '2003-11-21 16:47:47', NULL),
(143, 'Stuffing', '', '2 c. diced onions<br>2 c. diced celery<br>2 tbsp. sesame oil<br>2 bags of pepperidge farm stuffing - herbed seasoning<br>2 tsp. dried parslely<br>2 tsp. poultry seasoning<br>4 c. vegetable broth (imagine brand, no- chicken flavor)', 'Saute onion and celery in oil.<br>Mix cubes, seasoning, sauteed vegetables, in large bowl until well coated.<br>Place mixture in a 9 x 9 cake pan and bake at 350 until lightly browned.', 113, '2003-11-21 17:01:51', NULL),
(144, 'vegan chicken pasta salad', '', 'onions<br>celery<br>wheat meat :white wave:<br>veganaise', 'chop the onions and celery.<br>mix all ingredients together.<br>chill before serving.', 110, '2004-01-05 10:54:42', NULL),
(145, 'Cinnamon Almonds', '', '4 cups almonds, soaked 8 hrs to germinate<br>1 lb. medjool dates<br>juice of 2 oranges, fresh and un-pasteurized<br>1-2 tsp. vanilla extract<br>a lot of ground cinnamon<br>liquid aminos and real salt, to taste<br>a little of your favorite oil, optional', 'Blend everything other than the almonds in a food processor until smooth.<br>Mix with almonds and dehydrate until crunchy.', 114, '2004-01-05 10:56:53', NULL),
(146, 'Tomato Avocado Salad', '', 'One portion:<br>tomatoes, chopped<br>avocados, chopped<br>Equal portion:<br>broccoli stem, chopped<br>cucumber, chopped<br>kale, chopped<br>yellow/orange bell pepper, chopped<br>Dressing:<br>oil<br>lemon juice<br>liquid aminos<br>onion powder<br>garlic powder<br>cumin<br>cayenne<br>basil<br>gomasio(sesame seeds, sea salt, sea weed)', 'Toss veggies together.<br>Mix dressing ingredients together.<br>Mix the dressing into the veggies.<br>Serve immediately.', 110, '2004-01-05 11:00:08', NULL),
(147, 'Dolmades', '', '1 cup basmati rice, soaked in water for 30 minutes<br>1/4 cup currants, soaked in hot water for 30 minutes<br>1/4 cup pine nuts, toasted<br>3/4 cup olive oil<br>2 cups minced onion<br>1 tsp. salt<br>1 cup diced scallions<br>1 tsp. allspice<br>1 tsp. cinnamon<br>1/2 cup chopped tomatoes<br>1/2 cup flat parsley, chopped<br>1/4 cup mint or dill<br>3/4 cup hot water<br>fresh ground pepper<br>36 grape leaves in brine<br>2 cups boiling water<br>fresh lemon juice', 'Heat 1/2 cup of the olive oil.<br>Add the onions to the oil and fry for about 5 minutes.<br>Add the salt and fry for another 5 minutes.<br>Add the scallions and fry for 5 minutes.<br>Add the pine nuts and spices and cook for another 10 minutes.<br>Place 1 tbsp. of filling on each grape leaf and roll up.<br>Pour 2 cups of boiling water and 1/4 cup of the olive oil over the dolmades.  Simmer for 45 minutes with a plate to hold down the dolmades.<br>Sprinkle the lemon juice over the dolmades and let cool before serving.', 114, '2004-01-05 11:06:18', NULL),
(148, 'Potato Vegetable Hot-dhish', '', '8 potatoes, cooked and mashed<br>1 large onion, chopped<br>2 stalks celery, chopped<br>4 large carrots, chopped<br>2 cups mixed frozen vegetable<br>1/2 stick soy margarine<br>1/2 cup flour<br>2 tsp. vegetable base<br>1 cup water<br>1 cup vegetable juice(saved from cooking)<br>1/2 cup soy milk<br>1 package vegetable soup mix<br>1 tbsp. sweet dried peppers<br>1/4 tsp. marjoram<br>1/4 tsp. thyme<br>1/4 tsp. white pepper<br>1/8 tsp. oregano<br>salt, to taste', 'Cook the vegetables until done.  Save the liquid.<br>Melt the margarine; add the flour and cook for several minutes.<br>Add the water, saved vegetable juice, soymilk, and spices.  Cook until thickened.<br>Mix the cooked vegetables with gravy and place in casserole dish.  Top with the mashed potatoes and sprinkle with paprika.<br>Cover and heat at 350 for 30 minutes.<br>Uncover and cook additional 15 minutes or until heated through.<br>NOTE:  vegetables available may be substituted as desired.', 103, '2004-01-05 11:17:04', NULL),
(149, 'Mock Chili Con Queso', '', 'For the queso spread:<br>1 15-oz can great northern beans (about 1 1/2 cups), rinsed well and drained<br>1/2 cup pimento pieces, drained<br>6 tbsp. nutritional yeast flakes<br>3 tbsp. fresh lemon juice<br>2-3 tbsp. tahini<br>1/2 tsp. onion granules<br>1/2 tsp. prepared yellow mustard<br>1/2 tsp. salt<br>1/2 tsp. garlic powder<br>1 or 2 10-oz cans diced tomatoes and chilies, drained<br>For the chili:<br>3 1/2 cups water<br>1 6.4-oz box fantastic foods vegetarian chili<br>2 15-oz cans (2 1/2 cups) kidney, pinto, or red beans, drained and rinsed, or 2 1/2 cups cooked beans<br>1 14-oz can diced or stewed tomatoes', 'Queso Spread:<br>Place all the ingredients except canned tomatoes in a blender, and process until completely smooth.<br>Stir in a can or more of the tomatoes, depending on taste.  (Drain first, reserve the liquid to add later in case you want to thin the chili);  choose the spicy variety if you want spicy chili.<br>Put aside while you prepare the chili.<br>For the chili:<br>Bring water to a boil.  Add the chili mix and stir well.  Add beans and tomatoes.<br>Reduce heat and simmer, uncovered, for 25 minutes.  Stir often, because the chili has a tendency to stick to the bottom of the pan.<br>Fold the "queso" spread into the cooked chili and heat through.<br>NOTE:  Best if prepared a day ahead of time so that the flavors can blend.', 103, '2004-01-12 14:02:41', NULL),
(150, 'Marinated Pea Salad', '', '3/4 cup distilled white vinegar<br>3/4 cup sugar<br>1 tbsp. water<br>1 15-17 oz can petite peas, drained<br>1 16-oz can corn kernels, drained<br>1 cup chopped celery<br>1 cup chopped onions', 'Combine the vinegar, sugar, and water in a small sauce pan.  Bring to a boil over medium heat and let boil for 5 minutes.<br>Remove from the heat and cool completely.<br>In a medium bowl, combine the remaining ingredients.<br>Pour the cooled vinegar mixture over the vegetables and chill 4 hours.', 110, '2004-02-01 19:00:33', NULL),
(151, 'Carrot Cake Muffins', '', '1 cup whole wheat pastry flour<br>1 cup sucanat (or other sugar)<br>2 tsp. egg replacer<br>1/2 cup applesauce<br>1 tsp. vanilla<br>1/2 tsp. baking soda<br>1/2 tsp. baking powder<br>1/4 cup pecans (or walnuts)<br>1 carrot, grated<br>1/2 cup organic orange juice', 'Preheat oven to 350 F.<br>Mix all the ingredients together.<br>Bake for 30 minutes, or until a fork inserted in the center comes out clean.<br>NOTE:  For 36 mini-muffins, bake for 10-15 minutes.', 109, '2004-02-01 19:05:03', NULL),
(152, 'Avocado Mango Salad', '', '1 avocado, diced<br>1 mango, diced<br>1 red bell pepper, diced<br>1 onion, diced<br>1-2 tbsp. lime juice<br>dash of cayenne<br>1-2 tbsp. liquid aminos', 'Combine all the ingredients together in a bowl and mix well.  Serve immediately.', 110, '2004-02-01 19:09:40', NULL),
(153, 'Caramelized Cabbage and Pasta', '', '1 red bell pepper<br>1/4 cup soy butter or margarine<br>1 large onion, thinly sliced<br>1 garlic clove, chopped<br>1 small green cabbage (about 1-1/4 lbs.)<br>1 tbsp. brown sugar<br>1 cup dried shell pasta<br>salt and black pepper, to taste<br>chopped fresh parsley, to garnish', 'Preheat oven to 400F (205C).<br>Under hot broiler, roast bell pepper 20 minutes.<br>Place in a plastic bag and leave until cool enough to handle.  Peel, seed, and cut flesh into thin strips.<br>Ina a large nonstick skillet, melt butter.  Add onion and garlic; cook 10 minutes or until lightly browned.<br>Trim outer leaves off cabbage.  Cut cabbage into quarters and discard central core.  Roughly shred cabbage; stir into onion mixture with sugar.<br>Stir well, cover and cook over very low heat 15 minutes, stirring occasionally, or until cabbage is golden and just tender.<br>In a pan of lightly salted, boiling water, cook pasta 10 minutes or until tender but still firm to the bite.  Drain well.<br>Stir into cabbage with roasted pepper, salt and black pepper.<br>Serve at once, garnished with chopped parsley.', 113, '2004-02-01 19:13:16', NULL),
(154, 'Tiger Balls', '', '2 cups vegan cookie crumbs or graham cracker crumbs<br>1/2-1 cup peanut butter (creamy or crunchy)<br>1 cup soy margarine, melted<br>1 cup semisweet chocolate chips (or carob)', 'In a large mixing bowl, combine the crumbs, peanut butter, sugar, and margarine and mix thoroughly with a wooden spoon.<br>Roll this mixture into 1-inch balls, place on the cookie sheet, and chill in the refrigerator.<br>Meanwhile, place the chocolate chips in a small plastic sandwich bag and melt carefully (do not overheat) in a microwave. (if you prefer, melt the chips in a small bowl over hot water, then pour the melted chocolate into the sandwich bag.)<br>Snip off a tiny corner (about 1/16 inch) of the baggie and squeeze chocolate from this corner, drizzling thin "tiger stripes" of chocolate over the chilled cookies.<br>Return cookies to the refrigerator and chill until the chocolate is firm, about 30 minutes.', 108, '2004-02-01 19:20:47', NULL),
(155, 'Coconut Orange Balls', '', '1 1/2 cups vegan cookie crumbs (or graham cracker crumbs)<br>1/2 cup margarine, melted<br>3/4 cup orange juice concentrate, thawed<br>1 cup chopped nutes (optional)<br>3/4 cup flaked or shredded coconut', 'In a large mixing bowl, combine the cookie crumbs and the confectioners sugar.<br>Add the margarine and orange juice.  Mix thoroughly and add the nuts, if using.<br>Shape the mixture into 1-inch balls.  Roll in the coconut, place on a cookie sheet, and chill for 1 hour.', 108, '2004-02-01 19:27:15', NULL),
(156, 'Scalloped Potatoes', '', '2 tbsp minced garlic<br>1 tsp dried rosemary<br>2 tbsp olive oil<br>10 medium red potatoes, cooked and sliced thinly<br>salt and pepper to taste', 'Mix together garlic, rosemary, and olive oil.<br>Place potatoes evenly in a baking dish.<br>Drizzle oil mixture over the potatoes and bake at 375 degrees for 30-45 minutes.', 113, '2004-02-25 15:17:04', NULL),
(157, 'Rosey Quinoa', '', 'quinoa, cooked according to package directions<br>parsley, chopped<br>sunflower seeds<br>beets<br>maple syrup<br>salt, to taste', 'Mix everything together and serve.', 113, '2004-02-25 15:20:41', NULL),
(158, 'Raw Carrot Cake', '', '1 tsp. cinnamon<br>1/4 tsp. chinese 5-spice powder<br>1/2 tsp. garam masala<br>1 pinch nutmeg<br>1 pinch ground cloves<br>1 pinch real salt<br>2 cups sprouted kamut<br>2 cups pitted dates<br>1/2 cup soaked(20 minutes) dried apricots<br>1 1/2 cups soaked cashews "raw"<br>1/2 cup soaked (20 minutes) raisins, chopped<br>2 cups soaked walnuts, chopped<br>4 cups of carrot pulp (use juicer to extract pulp)<br>2 cups soaked cashews "raw"<br>1/2 cup young coconut<br>1/4 cup maple syrup<br>2 cups soaked cashew "raw"', 'Mix together the first 6 ingredients and add to carrot pulp.<br>Blend, at will, the next 6 ingredients in a food processor.<br>Blend the two mixtures together and form cake.<br>For the frosting, blend together until very smooth and spread over the cake.', 108, '2004-02-25 15:23:15', NULL),
(159, 'Mushroom-Artichoke Lasagna', '', '2 tsp. olive oil<br>1/4 tsp. crushed red pepper<br>4 cloves garlic, minced<br>3/4 cup sliced scallions<br>1/2 cup chopped red bell pepper<br>6 oz. portobello mushrooms, diced<br>8 oz. white mushrooms, sliced<br>1 13 1/4 oz. can quartered artichoke hearts, drained and diced<br>4 tbsp. tomato paste<br>1/4 cup mariot or vegetable stock<br>1/4 cup nutritional yeast<br>1/4 cup chopped flat-leaf parsley<br>1/2 tbsp. dried basil<br>1/2 tbsp. dried oregano<br>For the Tofu Ricotta Mixture:<br>3 12.3-oz pkg lite silken tofu, drained<br>3 cloves garlic, minced<br>1 cup chopped scallions<br>4 tbsp. mellow white miso<br>1/2 cup dry vermouth or vegetable stock<br>1/3 cup soy parmesan cheese<br>1/2 cup nutritional yeast<br>1 tsp. dried thyme<br>1/4 tsp. coarsely ground black pepper<br>1 1/2 25-oz. jars roasted red pepper tomato sauce<br>1 9-oz. pkg. no-boil lasagna noodles', 'Preheat oven to 375.<br>To make the Mushroom-Artichoke Mixture:<br>Heat oil and crushed red pepper in 10-inch skillet over medium-high heat about 1 minute.  Add garlic, scallions and bell peppers and saute for 3 minutes.<br>Add mushrooms and artichokes, and cook mixture 5 minutes, stirring occasionally.<br>Reduce heat to low, and add tomato paste and merlot, stirring to blend.  Add yeast, parsley, basil and oregano.  Mix thoroughly, cook 10 minutes and set aside.<br>To make tofu ricotta mixture:<br>Mash tofu with potato masher.  Add garlic and scallions.<br>Combine miso and vermouth in small bowl, blending with fork.  Add mixture to tofu.<br>Add soy parmesan cheese, yeast, thyme and black pepper; mix thoroughy and set aside.<br>Spread layer of tomato sauce evenly on bottom of 9 x 13-inch baking pan.  Top with layer of uncooked noodles.  Add broken noodles around edges for even fit.<br>Spoon tofu ricotta mixture evenly over noodles.  Top with another layer of noodles and cover noodles with tomato sauce.  Layer with mushroom-artichoke mixture, cover with layer of noodles and top with remaining tomato sauce.<br>Sprinkle generously with soy parmesan cheese.  Cover lasagna with foil and bake for 30 minutes.<br>Remove foil and bake 15 minutes more.<br>Remove from oven, and set aside for at least 15 minutes before serving.', 103, '2004-02-25 15:33:21', NULL),
(160, 'Tofu Rancheros', '', 'firm tofu<br>1 onion, diced<br>1/2-1 bell pepper<br>1 can diced tomatoes<br>1 can corn<br>1 can black beans<br>1/4 cup nutrintional yeast<br>1 tbsp. turmeric<br>1 tbsp. garlic granules<br>salt and pepper, to taste', 'Mix everything together until smooth and serve cold.', 114, '2004-04-29 12:17:03', NULL),
(161, 'Lentil Soup', '', '2 cups lentils<br>2 1/2 qts. water<br>1 cup medium barley<br>1/2 cup oil<br>1 large onion, chopped<br>2 large stalks celery with leaves, chopped coarse<br>1 large carrot, diced<br>1 large potato, diced fine<br>3 tbsp. minced parsley<br>16 oz. can tomatoes, cut up<br>3 tsp. salt', 'Place all ingredients in kettle; bring to boil.<br>Reduce heat, cover and simmer 1 hour or until lentils and barley are tender, stirring occasionally.<br>Add more water if too thick.  Freezes well.', 119, '2004-04-29 12:21:06', NULL),
(162, 'Marinated Chick Peas', '', 'Chick peas<br>red onion, diced<br>garlic, minced<br>fresh ginger, minced<br>apple cider vinegar<br>olive oil<br>balsamic vinegar<br>salt, to taste', 'Mix all the ingredients together and chill before serving.', 110, '2004-04-29 12:24:30', NULL),
(163, 'Pesto Pasta Salad', '', 'Orzo, cooked<br>olive oil<br>pine nuts<br>basil, chopped<br>garlic, minced<br>lemon<br>baby spinach<br>vegan mazzarella<br>red bell pepper, chopped<br>zucchini, shredded<br>ren onion, diced<br>artichoke hearts<br>sun dried tomato<br>white miso<br>real salt, to taste<br>white onion powder<br>black pepper', 'Mix everything together and serve.', 110, '2004-04-29 12:26:27', NULL),
(164, 'Macaroni Salad', '', 'macaroni, cooked<br>peas<br>celery, diced<br>onions, diced<br>veganize', 'Mix everything together and serve chilled.', 110, '2004-04-29 12:30:05', NULL),
(165, 'Meatballs', '', '2 1/2 cup ritz crackers, crushed<br>1 tsp. salt<br>1 tsp. garlic<br>6 tbsp. parsley, chopped<br>1 1/2 cup ground nuts, extra fine<br>1 large onion, chopped fine<br>1 1/2 cup grated soy cheese<br>egg replacer for 8 eggs', 'Combine al ingredients and mix well.  Shape into balls.<br>Put in baking dish and cover with sauce(recipe below).<br>Bake at 350 degrees F for 30 minutes.  Serve immediately.<br>NOTE  if you use a glass pan and no dairy, do not cook as long.', 112, '2004-04-29 12:31:48', NULL),
(166, 'Meatballs Sauce', '', '1/2 cup hickory bbq sauce<br>1/2 cup catsup<br>1 cup brown sugar<br>1 tbsp. soy sauce<br>1/2 cup water<br>1 1/2 tsp. curry powder<br>1 tbsp. lemon juice', 'Combine all ingredients and mix well.', 112, '2004-04-29 12:36:51', NULL),
(167, 'Sweet Italian Sausage Pasta', '', '1 package turtle river brand sweet italian sausage<br>1 24 oz. jar spaghetti sauce<br>1 lb. fettuccine', 'Chop sausage into 1/4 rounds or ovals.  Brown in lightly oiled pan.<br>Add spaghetti sauce and simmer.<br>Cook and drain fettuccine.<br>Serve sauce over pasta.', 101, '2004-04-29 12:39:36', NULL),
(168, 'Green Bean and Cashew Salad', '', 'brown rice<br>green beans<br>cashews<br>sesame<br>tamari<br>tahini<br>rice vinegar', 'Mix everything together and serve.', 110, '2004-04-29 12:42:05', NULL),
(169, 'Zuchinni Alfredo', '', 'zuchinni. cut long and thin<br>parsley, chopped<br>olive oil<br>onion powder<br>real salt, to taste<br>lemon juice', 'Toss everything together and mix in the alfredo sauce(recipe below).', 101, '2004-04-29 12:43:39', NULL),
(170, 'Alfredo Sauce', '', 'cashews, soaked<br>water<br>nutritional yeast<br>real salt, to taste<br>black pepper, to taste<br>white miso<br>onion powder', 'Blend everything together until smooth and creamy.  Serve over the zuchinne pasta.', 101, '2004-04-29 12:45:58', NULL),
(171, 'Vegan Coleslaw', '', '1 pkg. (16-oz), ready to serve, shredded cabbage and carrots<br>1 1/2 c. veganaise<br>1/4 c. sugar<br>1/4 c. vinegar<br>2 tbsp. dijon mustard', 'Mix everything together and chill before serving.', 110, '2004-05-29 18:23:45', NULL),
(172, 'Mango Lassi', '', '12 oz. wildwood soy yogurt<br>2 32-oz soymilk<br>4 cups frozen mango<br>1/2 cup lemon juice<br>3/4 cup sugar', 'Place all ingredients in blender and blend until smooth.  Serve chilled.', 102, '2004-05-29 18:26:25', NULL),
(173, 'Strawberry Spinach Salad', '', '2 bunches torn baby spinach<br>1 pint fresh strawberries, hulled and sliced<br>1/2 cup sugar<br>2 tbsp. sesame seeds<br>1 tbsp. poppy seeds<br>1 1/2 tsp. minced onion<br>1/4 tsp. Worcestershire sauce<br>1/4 tsp. paprika<br>1/2 c. vegetable oil<br>1/4 cup cider vinegar', 'Arrange spinach and strawberries in a bowl.<br>Place next 6 ingredients in blender running.<br>Add oil and vinegar slowly, thoroughly mixing until thickened.<br>Pour over salad and serve immediately.', 110, '2004-05-29 18:28:38', NULL),
(174, 'Banana Bread', '', '12 oz. silken tofu<br>2 c. flour<br>1/2 tsp. baking soda<br>1/2 tsp. baking powder<br>1/4 tsp. salt<br>1 c. sugar<br>1/4 c. vegetable oil<br>1 tsp. vanilla<br>1 c. ripe banana, mashed', 'Preheat oven to 350.<br>Blend tofu until smooth.<br>Place in large bowl with rest of ingredients and mix well.<br>Pour into an oiled loaf pan and bake for 1 hr or until toothpick inserted comes out clean.', 109, '2004-05-29 18:32:53', NULL);
INSERT INTO `recipes` (`id`, `title`, `description`, `ingredients`, `instructions`, `category_id`, `created_at`, `updated_at`) VALUES
(175, 'Tofu Salad', '', '3/4 lb. soft tofu<br>3/4 lb. firm tofu<br>1/2 medium onion, chopped fine<br>2 medium carrots, chopped fine<br>1/3 c. nutritional yeast<br>2 tsp. soy sauce<br>1 1/2 tsp. garlic powder<br>1 1/2 tsp. salt<br>dash pepper<br>2 tbsp. vegetable oil<br>dash paprika<br>red leaf lettuce<br>tomato slices', 'Crumble tofu with fork.  Add ingredients as listed, stiring in oil last.<br>Sprinkle with paprika.  Serve on a bed of red leaf lettuce surrounded by tomatoes.', 110, '2004-05-29 18:37:20', NULL),
(176, 'Lentil Salad Provencal', '', '1 1/2 c. dried lentils<br>2 c. water<br>2 c. low sodium vegetable broth<br>1/2 c. chopped yellow onion<br>2 cloves garlic, minced<br>2 bay leaves<br>2 large ripe tomatoes, chopped<br>1/2 c. chopped red bell pepper<br>1/2 c. chopped red onion<br>1/2 c. chopped celery<br>3 tbsp. chopped fresh parsely<br>Dressing:<br>4 tbsp. lemon juice<br>1 tbsp. olive oil<br>1 clove garlic, minced<br>1 1/2 tsp. herbes de provence<br>1/2 tsp. black pepper<br>1/4 tsp. cayenne pepper<br>1/4 tsp. cumin', 'Combine lentils, water, and brown.  Bring to simmer.  Add yellow onion, garlic, and bay leaves.  Cover and continue to simmer for 20 minutes.  Remove from heat and remove bay leaves. Cool and drain excess liquid.<br>In large bowl, combine lentils, tomatoes, bell pepper, red onion, celery, and parsely.<br>In small bowl, whisk together dressing ingredients.<br>Combine and serve chilled.', 110, '2004-05-29 18:41:23', NULL),
(177, 'Walnut Balls with Bechamel Sauce', '', '<b>For the walnut balls:</b><br>1 1/2 c. toasted ground walnuts<br>1/4 c. bread crumbs<br>1/2 c. wheat germ<br>3 tbsp. chopped parsley<br>1/2 c. minced onion<br>6 oz. silken tofu<br>1/4 c. + 1 tbsp. soymilk<br>1/4 c. whole wheat flour<br>3 cloves of garlic<br>1/4 c. toasted nutritional yeast flakes<br>1/2 tsp. prepared mustard<br>1/2 tsp. salt<br>1 tsp. lemon juice<br>freshly ground pepper to taste<br> <b>For the bechamel sauce:</b><br>3 tbsp. canola oil or other light unflavored oil<br>3 tbsp. whole wheat pastry flour<br>3 c. hot but not boiling plain soymilk<br>1 tsp. peppercorns<br>1/2 tsp. thyme<br>1 small bay leaf<br>a pinch of nutmeg, freshly grated if possible<br>salt to taste<br>dash of cayenne', '<b>For the walnut balls:</b><br>In a large bowl, combine the ground walnuts, bread crumbs, wheat germ, parsley, and minced onion.<br>Combine the remaining ingredients in a food processor until smooth.   Mix into the walnut mixture.<br>The mixture should be moist but able to hold its shape.  Roll the mixture into walnut size balls and place onto an oiled baking sheet.<br>Bake at 350 degrees for about 30-40 minutes.  The bottoms of the balls should be lightly browned.  Now make the bechamel sauce while the walnut balls bake.<br><b>For the Bechamel Sauce:</b><br>Heat the oil over medium heat until  hot.  Turn the heat to medium-low, add the onion, and saute for 3-4 minutes.  Add the flour and stir it in.  It will immediately clump up.  Allow the mixture to cook for a few minutes<br>Add the soy milk slowly into the flour mixture, sitring with a whisk as you do.  At first it will thicken as soon as the liquid is added; watch for lumps and beat them out with your whisk.  Slowly, as more liquid is added, it will thin out, but it will th<br>When all of the liquid has been stirred in, add peppercorns, thyme, the bay leaf, nutmeg, and salt.  Let the sauce cook slowly for 10-15 minutes, sitring once in a while.<br>Pour it into its serving bowl using a sieve to elimiinate the surprise of peppercorns and bay leaf.  If you don''t want to be bothered with a sieve, retrieve those elusive peppercorns and the bay leaf with a spoon.  The sauce should be thickened, creamy, a<br>Remove the walnut balls from the oven, place in a serving dish, and pour the bechamel sauce over them.  Serve piping hot!', 103, '2004-05-30 12:52:24', NULL),
(178, 'Akasha''s Chocolate Chip Cookies', '', '1 c. unsalted butter or organic shortening<br>1/2 cup brown sugar<br>1/2 cup sugar<br>1/4 cup plain silk soymilk<br>1 tsp. vanilla<br>2 1/4 c. unbleached flour<br>1/2 tsp. salt<br>1 tsp. baking soda<br>12 oz. semi-sweet chocolate chips', 'Preheat oven to 350 degrees.<br><br>Cream butter and sugars until light and fluffy.  Slowly add Silk.  Cream well, then add vanilla.  Cmbine the dry ingredients in a mixing bowl.  Add the dry ingredients to the creamed mixture, then fold in the chocolate chips.<br>Drop by teaspoons on parchment lined cookie sheets.  Bake for 8-10 minutes.  Serve with ice-cold glasses of Silk.', 104, '2004-05-30 13:09:23', NULL),
(179, 'The Best Scone Recipe In The World', '', '1 tbsp. apple cider vinegar<br>approximately 1 c. soy milk<br>1 1/2 c. unbleached all-purpose flour<br>1 1/2 c. spelt flour or whole wheat pastry flour<br>3/8 c. sucanat or other sweetner<br>3 tsp. baking powder<br>3/4 tsp. baking soda<br>3/4 tsp salt<br>1/2 c. spectrum spread or other soy margarine<br>3 tsp. vanilla extract<br>3/4 cup walnuts, coarsely chopped<br>3/4 cup dried cherries', 'Place the rack in the middle of the oven.<br>Preheat the oven to 425 degrees.  Lightly mist a nonstick cookie sheet with vegetable oil cooking spray or line with parchment paper.<br>Put apple cider vinegar into a 1-cup measuring cup and add enough soy milk to bring it level to 1 cup.  Set aside.  The mixture will be clabbered, like buttermilk.<br>In a large mixing bowl, mix together the dry ingredients.  Add the spectrum spread to the dry ingredients, and cut it in using a pastry blender or two knives or your fingers.  The mixture will be crumbly now.<br>Add the walnuts and cherries to the bowl and mix them in.<br>Add the vanilla to the vinegar and soy milk mixture and pour almost all of this mixture into the dry ingredients.<br>Stir quickly with a spatula only until the mixture forms a soft dough.  You don''t want a gooey mess, so add more soy milk only if the dough still seems crumbly rather than doughy.<br>Turn the dough onto the cookie sheet in 4 equal parts.  Shape each part into a thick circle about 5-7 inches in diameter.  Using a sharp knife, score the top of each circle, dividing it into quarters.  (For smaller scones, divide the dough into 6 wedges.)<br>Bake for 12 minutes.  A toothpick stuck into the middle of each scone should come out clean, and the bottoms will be lightly browned.  Don''t let them bake too long, but they may need a few more minutes.  Transfer them to a wire rack and enjoy.', 109, '2004-06-27 18:35:09', NULL),
(180, 'baba ganoug', '', '4 small or 2 large eggplants<br>3 cloves garlic<br>2 tbsp. tahini<br>juice of 2 lemons<br>salt, to taste<br>as required freshly ground black pepper<br>3 tbsp. finely chopped parsley', 'Prick the eggplants all over with a fork.  Place them under a hot grill and grill them, turning when necessary, until they are thoroughly charred on all sides.  An alternative method is to bake them in a very hot oven at 450F/230C/gas mark 8 for about an<br>Rinse the eggplants under cold water and peel the charred skins off.  (This does not have to be done immediately;  if preferred, they can be left to cool first.)<br>Chop the eggplant flesh.  Chop the garlic.  Put both into the liquidizer along with the tahini, lemon juice, salt and pepper.  Blend thoroughly.<br>Stir the parsley in last.  Serve either chilled or at room temperature.', 114, '2004-08-01 19:33:52', NULL),
(181, 'Amaranth', '', '1 cup grain<br>2 1/2 cups water<br>salt, if desired', 'Boil the water.  Add the grain.  Simmer for 20-25 minutes.  Serve at room temperature or chilled.', 114, '2004-08-01 19:39:54', NULL),
(182, 'Boundary Waters Fry Bread', '', '4 1/2 c. flour<br>2 tbsp. sugar<br>2 tbsp. baking powder<br>4 tsp. salt<br>2 tbsp. melted margarine<br>2 c. soy milk', 'Mix ingredients, kneed, and let stand 20 minutes in warm area.<br>Pinch off, pull apart, and fry.', 109, '2004-08-01 19:42:08', NULL),
(183, 'Stuffed Grape Leaves', '', '4 c. cooked white sushi rice<br>1/4 c. any nuts<br>handfull of raisins<br>1 tbsp. basil<br>1/4 c. lemon juice<br>1/4 c. olive oil', 'Mix everything together and allow to cool.<br>Roll in grape leaves.<br>Place in pan coated with olive oil.', 114, '2004-08-24 20:04:39', NULL),
(184, 'Cucumber Tomato Salad', '', '1 pkg. zesty italian powder<br>1/4c. vinegar<br>1/2 c. oil<br>cucumbers, soaked in salt<br>green onion<br>tomatoes<br>black olives', 'For the dressing:<br>Mix the vinegar, oil and the italian powder.<br>For the salad:<br>Cut the veggies and toss.<br>Pour the dressing over the salad and serve.', 110, '2004-08-24 20:07:18', NULL),
(185, 'Pasta Dish', '', 'whole wheat pasta, cooked<br>minced garlic<br>olive oil<br>fresh basil, chopped<br>walnuts, chopped<br>red pepper flakes, to taste<br>salt, to taste', 'Mix everything together and serve!', 101, '2004-08-24 20:10:14', NULL),
(186, 'Tofu Vegetable Casserole', '', '1 lb. tofu, sliced into 1/2 inch slices<br>fresh, frozen or cooked vegetables<br>1 c. mayonnaise<br>2 c. cream of mushroom soup<br>2 tsp. curry powder<br>2 tsp. lemon juice<br>salt and pepper to taste<br>1/2 c. parmesan cheese', 'Preheat oven to 350 degress.  Arrange slices of tofu with vegetables in an oiled 8 1/2 x 11 baking dish.<br>Mix mayonnaise, soup, curry powder, lemon juice, salt and pepper.  Blend well and pour over the mixture.<br>Sprinkle the cheese over top.  Bake for 30 minutes.', 105, '2004-08-24 20:12:06', NULL),
(187, 'Cheezy Macaroni Casserole', '', '1/2 c. nutritional yeast flakes<br>1/3 c. unbleached all-purpose flour<br>1 c. vegetable broth<br>up to 1 1/2 c. water<br>1 1/2 tbsp. soy sauce or tamari<br>1/2 tsp. garlic powder<br>1/4 tsp. paprika<br>1/4 tsp. dried basil<br>1/4 tsp. dried oregano<br>4 oz. tomato sauce<br>2 c. elbow macaroni, cooked', 'Preheat oven to 350 degrees.<br>Combine yeast and flour in medium saucepan.  Heat on low, stirring until toasted.<br>Slowly add broth, stirring to make thick batter.  Add water, 1/2 cup at a time until sauce is smooth and thick.<br>Add remaining ingredients except macaroni.  Stir well.<br>Place cooked macaroni in casserole dish and stir in sauce.  Bake for 30 minutes.', 105, '2004-08-24 20:15:59', NULL),
(188, 'Carob Confections', '', '1 c. almonds<br>1/2 c. coconut<br>1-1/2 c. carob powder<br>2 tbsp pine nuts or any other nut<br>1/4 c. plus 1 tbsp of maple syrup<br>1/4 c. plus 1 tbsp of water<br>Carob powder or coconut or ground almonds for decoration', 'In a food processor or blender, finely chop the almonds.  Add the carob, pine nutsm and coconut and process until mixed.<br>Mix the maple syrup and water together in a bowl and then slowly add to the almond mixture while the processor is still running.  Process until all the ingredients are mixed and a dough is formed.<br>Roll the dough into balls and cover with coconut or carob powder or ground almonds.  Serve chilled. Yeilds 24-30 pieces.', 108, '2004-08-24 20:21:41', NULL),
(189, 'Halvah - Raw', 'Halvah is a dessert popular in the middle east where it is usually made with ground sesame seeds.', '1-1/2 C. almonds<br>1/2 C. raw tahini<br>3 tbsp maple syrup<br>1 tsp vanilla<br>1 tbsp plus 1 tsp carob powder', 'Place the almonds in a food processor until finely ground.  Add tahini, maple syrup, and vanilla and process.  Place half the mixture in a bowl and set aside.<br>Add carob to the remaining mixture and process until mixed.   Press the plain mixture onto a pan until is is 1/4 inch thick.  Then pat the carob mixture so it is the same thickness and lay over the plain mixture.  Chill for 1 or more hours.  Cut into bite', 108, '2004-08-31 11:41:01', NULL),
(190, 'Dalwada', 'Instant Mix from India  Available in most international grocery stores.', 'Instant Mix<br>crushed green chillies<br>minced garlic', 'Follow package instructions.', 114, '2005-01-19 22:35:33', NULL),
(191, 'Whole Wheat Bread', '100 % whole wheat and fat free.', '8-9 oz. water<br>1 1/2 tsp. salt<br>1 1/2 tbsp. honey<br>1 1/2 tbsp. molasses<br>3 c. whole wheat<br>1 1/2 tbsp. vital gluten<br>2 tsp. active dry yeast', 'Set bread machine for 1 1/2 lbs and at setting of 4 or 5.<br>Place all ingredients in machine and press start.', 109, '2005-01-19 22:38:07', NULL),
(192, 'Blackbean and Corn Salad', '', 'black beans, soaked and cooked<br>corn kernels, cooked<br>yellow bell pepper, diced<br>green onions, diced<br>celery, diced<br>cucumber, diced<br>parsley, diced<br>applecider vinegar<br>Braggs liquid Aminos<br>olive oil<br>cumin powder<br>garlic powder<br>sundried tomatoes', 'Mix all ingredients together and serve.', 110, '2005-01-19 22:41:37', NULL),
(193, 'Ravioli', '', 'Ravioli<br>basil<br>1 can of northern white beans<br>2 cans diced tomatoes<br>1 bunch spinach, chopped<br>garlic, minced', 'Cook beans, tomatoes, spinach and garlic.<br>Cook ravioli according to package instructions.<br>Serve ravioli with the sauce and the basil, chopped, for the finishing touch.', 101, '2005-01-19 22:45:31', NULL),
(194, 'Party Mix', '', '8 c. cereal<br>1/4 c. earth balance margarine<br>2 tbsp. worchestershire sauce<br>1 c. pretzels<br>1 c. nuts<br>1 tsp. salt<br>1 tsp. garlic granules', 'Mix all ingredients together and place on cookie sheet.<br>Toast at 250 degrees for 1 hour, stirring every 15 minutes.', 114, '2005-01-19 22:52:34', NULL),
(195, 'Basmati Rice and Brussel Sprouts', '', '1 c. basmati rice, cooked<br>3 c. brussel sprouts, halved<br>curry powder<br>garlic salt<br>sea salt, to taste', 'Cook the brussel sprouts until tender.  Mix in the curry powder, garlic salt and sea salt.  Serve with the basmati rice.', 116, '2005-01-19 22:56:25', NULL),
(196, 'Lentil Salad', '', '2 c. of lentils, cooked<br>basil, chopped<br>garlic, minced<br>sea salt, to taste', 'Mix everything together and serve!', 110, '2005-01-19 22:59:14', NULL),
(197, 'Vegetable Curry', '', '1 tbsp. curry powder<br>1 medium potato, peeled and diced<br>1 bag (16oz) frozen mixed broccoli, cauliflower and carrots<br>1 can (15oz) chickpeas, rinsed and drained<br>1 can (14.5oz) stewed tomatoes with no added salt<br>2 tbsp. cornstarch<br>1 can (14.5oz) reduced sodium vegetable broth', 'Stir curry powder in a large skillet over high heat for about 30 seconds or until fragrant.  Add broth and potato, reserving 1/2 c. broth to use later.<br>Bring to a boil and simmer for 5 minutes.<br>Add frozen vegetables, chickpeas and tomatoes to potato mixture and simmer for 7 minutes.<br>In a separate bowl, blend remaining broth with cornstarch, then stir into vegetables.  Simmer for an additional 2 minutes until the sauce is thickened.  Serve over brown rice.<br>Add some olive oil and salt for more flavor.', 103, '2005-01-19 23:02:24', NULL),
(198, 'Simple Pickled Beets', '', '1 can cut beets<br>sugar<br>vinegar', 'Empty beets and juice from can into plastic or glass container with lid. Add a little vinegar and some sugar to taste. No real recipe, just however, you like it.<br>Chill and serve.', 115, '2005-01-19 23:11:33', NULL),
(199, 'Cranberry Raisin Pie', 'This is a creation of Jim''s and the ingredients are approximate.', 'equal amounts of dried cranberries and raisins (enough to fill a pie shell)<br>1 cup water<br>1/4 cup sugar<br>4 Tablespoons flour', 'Boil dried fruit with water and sugar until fruit is plump.<br>Add abt 4 Tablespoons flour to a small amout of cold water and whisk until there are no lumps.<br><br>Add to fruit mixture and simmer until mixture has thickened like pie filling.<br>Bake in your favorite pie shell; with or without top shell. A lattice top is nice.<br><br><br>* Note this is a creation of Jim''s and the amount of ingredients are approximate. This pie is very delicious and the raisins and cranberries complement each other very well.', 100, '2005-08-27 20:32:06', NULL),
(200, 'Dill dip for fresh veggies', '', '1 cup Tofutti Better Than Sour Cream (not hydrogenated)<br>1 cup Veganaise (I used Grapeseed)<br>1 rounded Tablespoon dried minced onion<br>1 rounded Tablespoon dried parsley<br>1 rounded teaspoon Beau Monde seasoning<br>1 rounded teaspoon dried dill weed', 'Mix well. Chill overnight, if possible, before serving to blend flavors.', 110, '2005-08-27 20:45:52', NULL),
(201, 'Cabbage Soup', '', '2 TB vegetable oil<br>1 tsp kosher salt<br>1 tsp black pepper<br>2 small yellow onions (thinly sliced)<br>2 carrots, roughly chopped<br>2 parsnips, roughly chopped<br>2 TB Beef-like seasoning<br>4 large garlic cloves, roughly chopped<br>6 cups vegetable broth<br>4 cups water<br>4 cups green cabbage, roughly chopped<br>1   14 ounce can  drained Great Northern Beans<br>8 gingersnaps, finely crushed in food processor (scant 1/2 cup)<br>3 TB lemon juice<br>3 TB firmly packed brown sugar<br>1 Bay leaf<br>Tabasco sauce and vegan sour cream (for serving)', 'Heat oil in stockpot. Add onions, carrots, parsnips, salt & pepper. Cook stirring occasionally until veggies begin to carmelize (about 5 minutes).<br><br>Add Garlic & cook, stirring constantly for 1 minute.<br>Add broth, beef seaoning, water, tomatoes, cabbage, beans, gingersnaps, lemon juice, brown sugar and bay leaf. Whisk to dissolve gingersnaps.<br>Bring to a boil, then reduce heat to low and simmer for 1 1/2 hours; stirring occasionally.<br>Season with more salt, lemon juice and brown sugar to taste.<br><br>Add tabasco sauce/sour cream for serving.<br><br>Better on the 2nd Day. Freezes well.', 119, '2005-08-27 20:46:25', NULL),
(202, 'String Beans (Spicy)', 'Very delicately spiced with Indian Spices. Yummy!', '1 lb frozen french cut beans (thawed)<br>1/2 T. olive oil<br>1 inch cinnamon stick<br>3 cloves<br>1/2 t. ujmo (spice available at Indian store)<br>1/8 t. turmeric<br>1/16 t. red pepper<br>1 t. dhana geru (available in Indian store; a ground coriander and cumin mixture)<br>1 clove garlic minced<br>1/2 t. fresh ginger minced', 'Heat oil in saucepan with cinnamon and cloves until cinnamon and cloves are bubbling. (oil is hot)<br>Add ujmo, turmeric, and red pepper to oil and cook approximately 15 seconds.<br>Add string beans, dhana geru, garlic, ginger and salt. Cook until tender.<br>Measurements are approximate.', 115, '2005-10-16 12:04:03', NULL),
(203, 'Kidney Bean Risotto', '', '4 T. olive oil<br>1 onion, chopped<br>4 cloves garlic, crushed<br>1 1/2 cups cooked wild rice<br>1 1/2 cups cooked long grain rice<br>1 red bell pepper, chopped<br>2 celery stalks, chopped<br>10 medium shitake mushrooms, chopped<br>1 1/2 canned red kidney beans (drained and rinsed)<br>1/2 cup cashews<br>salt and pepper', 'Cook the rices in veggie stock. (may be cooked the night before)<br>Heat 2 T. of oil and cook onions and garlic 5 minutes.<br>Add celery and red pepper and rest of oil and cook 4-5 more minutes.<br>Stir in cooked rice, then add kidney beans and cashews.<br>Season to taste with salt and pepper.', 103, '2005-10-17 12:07:37', NULL),
(204, 'Vegetable - Lentil Curry', '', '2 t. olive oil<br>1 medium onion, finely chopped (abt 1 1/2 cups)<br>2 T. curry powder<br>2 medium sweet potatoes, peeled and cut into 1 inch chunks (abt 1 1/2 cups)<br>1 head cauliflower, stemmed & seperated into florets (abt 2 1/2 pounds)<br>1 cup brown lentils, rinsed<br>(2) 14.5 oz cans low-sodium diced tomatoes and juice<br>1 1/2 cups water<br>salt to taste', 'Heat oil in large saucepan over medium heat. Add onion and cook 5 minutes or until softened, stirring often.<br><br>Stir in curry powder and cook 1 minute, stirring constantly.<br>Add sweet potatoes, cauliflower, lentils, tomatoes and juice and 1 1/2 water. Season with salt.<br>Bring mixture to boil. Reduce heat, cover and simmer 30 minutes or until lentils and sweet potatoes are tender.<br>PER SERVING (6)<br><br>250 calories<br>13 grams protein<br>2.5 grams total fat (0.5 grams sat fat)<br>47 grams carbohydrate<br>0 mg chol<br>0.43 mg sodium<br>15 grams fiber<br>10 grams sugars', 103, '2005-10-17 14:22:54', NULL),
(205, '4 Bean Casserole', '', '1 28 oz. can HyVee vegetarian baked beans<br>1 15 oz. can Butter Beans<br>2 14.5 oz. cans French style green beans<br>1 16 oz. can Dark Red Kidney Beans<br>3/4 cup packed brown sugar<br>1 1/8 cups catsup<br>1 1/2 T. Worchestershire sauce (vegan)<br>1 or 2 very large onions<br>salt & pepper (if desired)', 'Brown onion in vegetable oil. Add to slow cooker with all other ingredients. Mix. Cook on low heat 6 to 8 hours.<br>Option 2*** Add all ingredients to casserole dish and mix and bake at 350 degrees F for one hour.', 103, '2005-10-18 15:42:24', NULL),
(206, 'Craisin Tossed Salad', '', 'fresh spinach leaves<br>craisins<br>mandarin oranges<br>slivered almonds<br>sliced apples lightly dusted with cinnamon<br>yellow bell peppers, sliced', 'Add ingredients in the proportions that you think you would like.<br><br>Toss and top with your favorite salad dressing. (Hmm...wonder how raspberry vinegarette would taste)', 110, '2005-11-03 19:53:44', NULL),
(207, 'Banana Bread', 'From How It All Vegan by Tanya Barnard and Sarah Kramer', '3 ripe bananas, mashed<br>1 T lemon juice<br>1/2 cup oil<br>1/2 cup sweetner<br>3/4 cup chopped dates (I used raisins)<br>1 1/2 cups flour<br>1/2 cup wheat germ<br>1/2 t salt<br>1/2 t baking powder<br>1/2 t baking soda', 'Preheat oven to 375 degrees.<br>In a small bowl, mash bananas with fork until very mushy, then add the lemon juice, oil, sweetener,and dates and stir together. In a separate large bowl, stir together the flour, wheat germ, salt, baking powder, and baking soda. Add the banana mixture to', 109, '2005-11-15 09:42:14', NULL),
(208, 'Rice\\Spelt \\Cranberry\\Pecan Salad', '', '1 1/2 c. cooked brown rice<br>1/2 c. cooked spelt<br>1 to 2 cups pecans<br>1 to 2 cups craisens<br>abt 1/2 cup toasted sesame oil<br>abt 1/2 cup lemon juice<br>abt 1/2 cup apple cider vinegar', 'Pressure cook spelt and rice seperately or may just cook on top of the stove until soft.<br>When grains are cool, add craisens and pecans and toss with sesame oil, lemon juice, cider vinager mixture.<br>Serve cold.', 110, '2005-11-25 15:31:46', NULL),
(209, 'Creamy (not a) Chicken Pasta Salad', '', '1/2 cup eggless mayonnaise<br>4 T. lemon juice<br>4 cups cooked noodles<br>8 green onions, sliced<br>1 red pepper, diced<br>1 - 14 oz. jar of Artichoke hearts, drained and sliced<br>1 - 7 oz "Veat" Vegetarian Breast, diced<br>3 T. basil<br>1 t. salt', 'Stir the eggless mayonnaise and lemon juice into the noodles.<br><br>Add the green onions, red pepper, artichoke hearts, vegetarian breast, basil, salt and mix well.<br>If too dry, add mayonnaise and/or lemon juice.', 110, '2005-12-01 14:23:20', NULL),
(210, 'Rolf''s Pancakes', '', '1 cup unbleached all-purpose flour<br>1 T. sugar<br>2 T. baking powder<br>1/8 t. salt<br>1 cup soy milk<br>2 T. vegetable oil<br>Add water for desired consistency.', 'Combine flour, sugar, baking powder and salt in a bowl and mix thoroughly.  Mix in the soy milk and oil. Beat until batter is smooth.  Add water as needed.<br>Cooked on hot oiled griddle.', 109, '2006-01-29 11:09:52', NULL),
(211, 'Lucinta Kale Salad', '', '2 bunches organic Lucinta Kale<br>1/3 cup smooth almond butter<br>1/3 cup extra virgin olive oil<br>2 small bell peppers (orange, red and/or yellow<br>3 1/2 cloves garlic', 'Slice Kale and peppers into thin strips. Blend the other ingredients and toss.<br>Comment by recipe coordinator; This is outstanding. Perhaps the best salad I have ever eaten. You gotta try this!', 110, '2006-01-30 11:14:12', NULL),
(212, 'Pappa''s Black Bean Dip', 'Tasty and very hot!', '1 can black beans (drained and strained)<br>1 can pinto beans (drained and strained)<br>1/4 cup tomato paste<br>1 serrano pepper, minced<br>1/4 cup minced onion<br>1/4 cup minced green pepper<br>2 T. lime juice<br>1/2 T. onion powder<br>1/2 T. garlic powder<br>1/2 T. mustard powder<br>2 t. cayenne pepper (or less if very hot)<br>1 t. black pepper<br>2 T. Tabasco Chipotle<br>2 t. red pepper flakes<br>1 t. cumin<br>1 t. coriander<br>3 t. minced fresh cilantro (optional)<br>1/4 cup black olives (optional)', 'Sweat onions, peppers, & (cilantro and black olives, if added)<br>Grind spices in mortar and pestle.<br>Blend all ingredients in food processor.<br>Add more chipotle, if desired, to taste.', 114, '2006-01-30 11:20:23', NULL),
(213, '"Cheesy" Vegan Pasta', '', 'Newman''s Own Mushroom Marinara<br>Gimme Lean Meatless Sausage Style<br>1 and 3/4 cup nutrtional yeast flakes<br>Pasta, cooked, your choice', 'Crumble cooked sausage in marinara sauce. Heat these 2 ingredients until very hot.  Add nutritional yeast and stir well.  Then add desired amount of cooked pasta.<br>Heat, if needed and serve.', 101, '2006-01-30 11:31:06', NULL),
(214, 'Ranch Dressing (Vegan)', '', '1 cup Veganaise (I used the one made from Grapeseed Oil)<br>1 T. oil<br>1 T. water<br>1 T. lemon juice or vinegar<br>1/4 cup (I use less) almond milk or soy milk to thin.<br>2 T. Saucy Ranch Seasoning *', 'Mix together, chill and serve.<br>*  is available from www.thevegetarianexpress.com', 110, '2006-01-30 11:36:45', NULL),
(215, 'Everyday Chocolate Brownies', '', '2 1/4 cups natural cane sugar<br>1 1/2 cups all-purpose flour<br>1 1/2 cups unsweetened cocoa powder<br>1 1/2 t. baking powder<br>1 1/2 t. baking soda<br>1/8 t. salt<br>1 cup unsweetened applesauce<br>1 cup soft tofu<br>3/4 cup chocolate soymilk<br>2 t. vanilla extract', 'Preheat oven to 350 degrees F.<br>Coat 9 X 13 inch baking dish with oooking spray. (or use a good non-stick pan)<br>Blend ingredients.<br>Bake until batter is set and top is dry, about 45 to 50 minutes.', 108, '2006-01-31 10:15:27', NULL),
(216, 'Butter Cup with Pablano and "Sausage"', '', '1/2 large or 1 small buttercup squash<br>1 tube Gimmelean sausage<br>1 small onion<br>1 small pablano pepper<br>2 t. dill<br>2 t. garlic powder<br>2 t. onion powder<br>1/4 t. Chinese 5 spice powder<br>salt to taste<br>pepper to taste<br>Braggs liquid aminos, to taste<br>1/4 cup oil<br>1/4 cup Earth Balance margarine<br>1 small red bell pepper', 'Bake squash whole for 1 1/2 hours at 350 degrees F.<br>Saute finely chopped onions in oil. Add chopped pablano pepper. Add margarine and sausage. Add red pepper, chopped. Add all seasonings.Add squash pureed or mashed or in chunks.<br>Spray baking dish with cooking spray. Bake at 350 for 20 minutes.', 115, '2006-02-10 10:36:36', NULL),
(217, 'Brocolli and  "Chicken" Casserole', '', 'abt 3 cups cooked white or brown rice<br>1/4 cup salted cashews<br>3 to 6 cups of water<br>1 heaping T. McKays chicken seasoning<br>pinch of nutmeg<br>2 pinches of white pepper<br>1 large chopped onion<br>1 or 2 cloves fresh garlic, minced<br>1 1b tofu (White Wave brand or equivilent) pressed ahead of time<br>about 1 bunch of brocolli, chopped', 'Cook rice.<br>Blend cashews in water until very smooth.  May take several minutes. Add chicken seasoning, nutmeg, white pepper.<br>In one pan saute onions and garlic.<br><br><br>Press tofu and cut in slices and then cubes.  Sprinkle with soy sauce and fry in oil 5 to 10 minutes on each side.<br>Add brocolli, sauted onion and garlic, fried tofu and cashew sauce.<br>Boil until sauce is thickened. May need to add a bit of cornstarch to thicken, if necessary.<br>In large rectangular glass pan add a layer of rice, then a layer of sauce, layer of rice, then sauce. Another layer of rice and another layer of sauce. Serve.<br>***Feel free to adapt the measurements of the ingredients as they are only approximate. This is very yummy hotdish! (D.N.)', 105, '2006-02-14 14:42:00', NULL),
(218, 'Chilled "Chicken" Pasta Salad', '', NULL, NULL, 110, '2006-06-14 14:07:22', NULL),
(219, 'Vegan Creamy Fruit Dip', '', '2 containers Tofutti cream cheese, plain<br>1 cup of sugar', 'Whip with blender until creamy.', 110, '2006-07-22 08:02:30', NULL),
(220, 'Julie''s Vegan Creamy Fruit Dip', '', NULL, NULL, 110, '2006-07-22 08:13:01', NULL),
(221, 'Three Bean Salad', '', '15 oz can cannellini beans, drained and rinsed.<br>15 oz. can chickpeas, drained and rinsed.<br>15 oz. can kidney beans, drained and rinsed.<br>2 stalks celery, finely chopped.<br>1/2 red onion, finely chopped.<br>1 cup fresh flat-leaf parsley leaves, finely chopped<br>2 T. finely chopped rosemary<br>3 T. fresh lemon juice<br>1/4 cup extra virgin olive oil<br>1 t. kosher salt', 'Mix well, chill and serve.', 110, '2006-07-22 08:24:44', NULL),
(222, 'Carob Almond Coconut Balls', 'A delicious live food gourmet treat!', '3 1/2 cups Germinated Almonds (raw almonds soaked 8 hours)<br>3/4 cup shreded coconut<br>1/2 cup raw pine nuts<br>3/4 cup raw macadamia nuts<br>1 3/4 cup carob powder<br>16 oz raw agave nectar<br>2 tsp liquid aminos<br>1 tsp miso<br>1 TBSP raw tahini', 'Process dry ingredients in food processor<br><br><br><br>Add other ingredients and mix. <br><br>Form into balls.<br>Roll balls in coconut or carob powder or oil and imbed almond in the middle', 108, '2006-07-22 17:38:35', NULL),
(223, 'testing', 'not made yet', 'asdfasdf<br>adsfadsf<br>adfadf<br>adsfasdf', NULL, 99, '2006-07-22 17:48:56', NULL),
(224, 'testing', 'not made yet', NULL, 'asdfasdfadsf<br>asdfasdfdsaf', 99, '2006-07-22 17:49:20', NULL),
(225, 'Kale Potatoe Brown Rice', 'Curry flavored basmati rice with potatoes and kale', '2 cups brown rice<br>1 cup potatoes<br>2 cloves garlic', NULL, 103, '2006-07-22 18:31:37', NULL),
(226, 'Asian Slaw', '', 'coleslaw<br>mandarin<br>Catalina<br>Miracle Whip<br>Soy sauce<br>peanuts', 'Toss coleslaw', 110, '2006-07-23 11:03:13', NULL),
(227, 'Macadamia Onion Dip w/ Flax Crackers', '', '1 cup raw macadamias<br>1 avocado<br>1 lemon<br>1/3 cup chopped onion (red, yellow)<br>Agave nectar to taste<br>1/2 teaspoon garlic powder<br>liquid aminos to taste<br>sun dried tomatoes (1/4 cup or so)<br>1 T. olive oil', 'Blend in food processor and serve on flax crackers.', 114, '2006-08-02 15:17:20', NULL),
(228, 'Papaya Salad', 'Raw.', '3 mostly unripe papaya, julienned into thin spagetti like slices<br>1 clove minced garlic<br>3 Roma tomatoes, coarsely chopped<br>1 cup green beans shredded in food processor<br>2 to 3 really hot red chili peppers', NULL, 110, '2006-09-12 14:46:12', NULL),
(229, 'Mock Chopped Liver', '1 T vegetable oil or water<br>1 large onion<br>1 lb. green beans, trimmed<br>1 lb soft tofu<br>1 tsp paprika<br>salt and pepper to taste<br><br>Heat the oil or water in a medium frying pan over medium heat. Cook the onion, stirring occasionally, until sof', NULL, NULL, 114, '2006-10-26 09:34:29', NULL),
(230, 'Sprouted Rye Crackers', '', '6 cups organic sprouted rye<br>3/4 cup first cold pressed olive oil<br>1.5 tbsp onion powder<br>1 tbsp liquid aminos<br>sea salt to taste', 'Soak rye for 6-8 hrs in water, then drain, spin and set for 1-3 days, rinse every day.<br>Process everything in food processor and spread very thinly on dehydrator sheets and dehydrate 12-24 hrs at 105-115 degrees F.', 114, '2006-10-26 10:16:50', NULL),
(231, 'Chopped Liver (Mock)', '', '1 Tbsp vegetable oil or water<br>1 large onion<br>1 lb. green beans, trimmed<br>1 lb. soft tofu<br>1 tsp paprika<br>salt and pepper to taste', 'Heat the oil or water in a medium frying pan over medium heat. Cook the onion, stirring occasionally, until soft, about 5 min.<br>Steam the green beans over boiling water until just tender, about 10 min.<br>Place the onion, beans and remaining ingredients in a food processor and puree until smooth.<br>Transfer to a serving dish and chill for 4 hours or overnight.<br>Serve with crackers or toast.', 114, '2006-10-26 16:11:21', NULL),
(232, 'Raw Macadamia sun dried tomato spread', '', '1.5 cup macadamia nuts<br>1/2 cup hulled sesame seeds<br>nutritional yeast<br>agave nectar<br>liquid aminos<br>1/2 cup olive oil or so<br>sea salt, onion and garlic powder<br>psyllium seed powder<br>5 sundried tomatoes<br>diced red onion to taste<br>1-2 tbsp dried parsley', 'Soak 1.5 cup macadamia nuts overnight and soak 1/2 cup hulled sesame seeds overnight, and 5 sundried tomatoes over night.<br>Blend in vita mix w/ soak water until smooth.<br>Add nutritonal yeast, agave nectar, liquid aminos, 1/2 cup olive oil or so, water if needed to allow blending, sea salt, onion and garlic powder to taste and psyllium seed powder if thickening is needed.<br>Pour the above into a clean container. Dice 5 sundried tomatoes (soaked over night) and mix.<br>Dice red onion and add to taste<br>Add 1-2 tbsp dried parsley.', 114, '2006-10-26 16:16:45', NULL),
(233, 'Pecan Zucchini Capellini', '', '1-2 cups pecans<br>2-3 cloves garlic<br>one sundried tomato<br>5 zucchinis<br>flax oil<br>spice hunter zip<br>cayenne', 'Process 1-2 cups pecans w/ 2-3 cloves garic and one sundried tomato.<br>Use spiralizer to cut 5 zucchinis into angel hair size threads.<br>Mix together and season w/ spice hunter zip or cayenne and flax oil.', 114, '2006-10-26 16:53:36', NULL),
(234, 'Zucchini Pecan Capellini', '', '1-2 cups pecans<br>2-3 cloves garlic<br>one sundried tomato<br>5 zucchinis<br>flax oil<br>cayenne or spice hunter zip', 'Process 1-2 cups of pecans w/ 2-3 cloves garlic and one sundried tomato<br>Use spiralizer to cut 5 zucchinis into angel hair size threads.', 114, '2006-10-26 16:57:17', NULL),
(235, 'Cashew coconut raisin pudding', '', '1.5 cups raw cashews<br>milk from one young coconut<br>1 small piece ginger (1/2 inch X 1/2 inch)<br>meat of 6 young coconuts (or 3 cups)<br>maple syrup<br>raw agave nectar<br>pinch of sea salt<br>ground clove<br>ground cinnamon<br>ginger powder<br>vanilla extract<br>1 tbsp psyllium seed<br>1 cup or more of rasins soaked in water for at least a few hours and then drained', 'Soak cashews overnight<br>Drain and puree cashews with coconut milk and piece of ginger<br>Add coconut meat, maple syrup, raw agave nectar, sea salt, grnd clove and cinnamon, ginger powder and vanilla extract to taste.<br>Add psyllium seed<br>Blend until smooth and creamy<br>Put in container or bowl, add the rasins and let stand over night to firm up.', 108, '2006-10-27 16:44:26', NULL),
(236, 'Quinoa Loaf (Holiday Loaf)', '', '1 cup uncooked quinoa<br>1.5 cup water<br>1 cup cashews, ground, recommend using food processor<br>1 cup grated carrots<br>1/2 cup chopped onions<br>4 tbsp. Braggs Liquid Amino<br>1/4 cup tahini<br>1 tsp. each sage, garlic powder, salt, and herb de province<br>1/2 cup dry quick oats<br>tofu (1 box 12.3 oz MORI-NU Silken Firm)<br>egg replacer (enough for 3 eggs)<br>dried parsley flakes', 'Bring water to a boil, add quinoa to boiling water, turn heat off, cover, and let sit until you are ready for it.<br>Blend tofu in a blender until smooth, trying to get rid of all little chunks. Then put it in a large bowl.<br>Add remaining ingredients (except quinoa, egg replacer and parsley). Blend very well.<br>Add quinoa, blend.<br>Add egg replacer (1 egg = 1.5 tsp egg replacer powder plus 2 tbsp warm water, mix thoroughly before adding to recipe)<br>Blend everything well, place in loaf pan sprayed w/ non stick spray, and sprinkle the top with parsley flakes.<br>Bake 400 degrees for 45 min. covered, then another 15 min. uncovered.<br>Let sit for 10 min. before serving so it will "set up". Helps to put a plate on top of loaf pan and flip over to sit loaf on plate, then slice.', 103, '2006-10-27 16:55:38', NULL),
(237, 'kimchi', 'Cabbage dish', 'recommend going to website for complete<br>directions and pictures<br>www.jasonunbound.com/kimchi.html', 'xxxxx', 115, '2007-01-02 16:34:38', NULL),
(238, 'Kimchi (cabbage)', '', 'see website<br>www.jasonunbound.com/kimchi.html', 'see website www.jasonunbound.com/kimchi.html<br>', 115, '2007-01-04 16:02:24', NULL),
(239, 'Vegan Sugar Cookies', '', '2 cups all purpose flour, plus more for rolling<br>1/2 tsp baking powder<br>1/4 tsp salt<br>1/2 cup non-hydrogenated margine (Smart Balance worked well)<br>1 cup sugar', NULL, 104, '2007-01-04 16:05:34', NULL),
(240, 'Sugar Cookies (vegan)', '', '2 cups all-purpose flour, plus more for rolling<br>1/2 tsp baking powder<br>1/4 tsp salt<br>1/2 cup non-hydrogenated margarine (Earth Balance worked well)<br>1 cup sugar', 'In a small bowl, sift flour, baking powder and salt. In a large bowl, cream margarine and sugar together until fluffy. Beat in applesauce and vanilla. With mixer on low, gradually add flour mixture. Beat until combined.<br>Divide dough in half; flatten into discs. Wrap each in plastic; freeze until firm, at least 20 minutes. May be frozen in plastic bag for up to three months (thaw in refrigerator overnight).<br>Preheat oven to 325 degrees. Line baking wheets w/parchment paper. Remove one dough disc; let stand 5-10minutes.<br>Dust the cookie cutters and spatula before using to prevent dough from sticking.<br>Roll dough out 1/8 inch thick between two sheets of floured parchment paper dusting dough as needed. cut shapes w/ cookie cutters. Using a spatula, transfer to prepared sheets. Reroll scraps; cut shapes.<br>Bake, rotating pan halfway through, until edges are golden, 10-18 minutes, depending on size. cool completely on wire racks.', 104, '2007-01-04 19:01:04', NULL),
(241, 'ICING for vegan sugar cookies', '', NULL, NULL, 104, '2007-01-04 19:16:24', NULL),
(242, 'ICING (for vegan sugar cookie recipe)', '', '1.5 cups confectioner''s sugar<br>3-4 Tbsp soy milk OR water OR lemon juice', 'Sift sugar into a bowl. Whisk in the liquid, one tbsp at a time, until smooth and thick enough to coat the back of a spoon.', 104, '2007-01-04 19:19:52', NULL),
(243, 'Icing (for vegan sugar cookies)', '', NULL, NULL, 104, '2007-01-04 19:26:48', NULL),
(244, 'Sugar Cookie ICING', '', NULL, NULL, 104, '2007-01-06 14:16:23', NULL),
(245, 'Coleslaw, Creamy/Vegan', '', '1 pre shredded package cabbage<br>3/4 cup vegenaise<br>2 tbsp vinegar<br>1/8 cup sugar', 'Mix and Serve', 110, '2007-03-24 19:15:10', NULL),
(246, 'Dreamacres Baked Northern Whites', 'baked beans', '1 lb. Northern white beans (soaked and cooked til soft)<br>Stewed tomatoes, 1 large can<br>2 onions<br>1/4 cup brown sugar<br>1/4 cup pure maple syrup<br>2 tbsp molasses<br>1 dry cayenne pepper<br>salt and pepper to taste', 'Bake on low, 200-300 degrees, at least 2 hours.', 113, '2007-03-24 19:22:52', NULL),
(247, 'Cucumber Curry Salad', 'RAW', '1/2 cup olive oil<br>1/3 cup honey<br>2 T curry powder<br>1 T salt<br>dash cayenne<br>juice 1 lemon<br>1/2 bunch cilantro, chopped<br>1/2 red onion, finely chopped<br>1 bunch spinach<br>2 cucumbers, sliced<br>1/2 cup cashews, chopped<br>1/2 red bell pepper', 'Mix first 6 ingredients in large bowl, then add chopped herbs and veggies and you''re done!', 110, '2007-07-19 08:18:53', NULL),
(248, 'Celery Slaw and Dressing', 'RAW', '1 large bunch celery<br>2 red bell peppers<br>3 or 4 tomatoes (or 2 large)<br>4 oz. fresh walnuts', 'Grate the celery and peppers and place in bowl.<br>Blend the tomatoes and walnuts and use as dressing.', 110, '2007-07-19 08:28:25', NULL),
(249, 'Chocolate Cake', '', '1/2 cup soft soy margarine<br>1 tbsp vinegar<br>1 cup soy milk<br>1 -2/3 cup white flour<br>2/3 cup unsweetened cocoa powder<br>1-1/2 cup sweetener (sugar)<br>1-1/2 tsp baking soda<br>1 tsp slt<br>2 tsp Ener-G Egg Replacer<br>1/4 cup water<br>1 tsp vanilla<br>1/2 cup water', 'Put vinegar in cup and add soy milk.<br>Preheat oven to 350 degrees.<br>Spray 2 round layer pans 8"x1.5" or 9x13" pan w/ non cook spray or lightly oil and flour.<br>Place flour,cocoa,sweetener,baking soda, and salt in large bowl and mix well w/ spoon.<br>Mix Ener-G Egg Replacer and 1/4 cup water until smooth.<br>Add margarine, vanilla, soured soy mlk, 1/2 c water, and mixed egg replacer to dry ingredients in bowl.<br>Beat w/ electric mixer for 3 minutes at medium speed, scraping bowl frequently.<br>Pour into prepared pans.<br>Bake for 30-35 minutes at 350 degrees, or until wooden toothpick inserted in center of cake comes out clean.<br>Remove from oven, let cool in pans for 5 minutes.<br>Remove from pans and cool on cake rack until cold.<br>Frost as desired.', 106, '2007-07-19 08:32:24', NULL),
(250, 'Asian Cabbage Salad', '', '1 head cabbage<br>1 bottle light Asian Toasted Sesame salad dressing<br>1.5 tbsp. black sesame seeds (bulk section Good Food Store)<br>1 cup butler soy curls (optional) (bulk section Good Food Store)', 'Chop cabbage, add salad dressing and sesame seeds.<br>Prepare soy curls according to directions and add to salad.', 110, '2007-08-16 10:47:39', NULL),
(251, 'Stuffed Mushrooms (RAW)', '', '1/3 cup pine nuts or nut of choice (ie.cashews or hazelnuts)<br>3 cloves garlic,minced<br>1/3 cup fresh cilantro, packed leaves, chopped<br>1/3 cup fresh basil, packed leaves, chopped<br>1 T lemon juice<br>1 cup tomato, chopped<br>2 T Braggs liquid aminos or to taste<br>Mushrooms (about 18 caps from mushrooms)', 'Put all ingredients into food processor, except the tomatoes.<br>Pulse/chop several times; stop to scrape down the sides and repeat.<br>Add the tomatoes and continue to pulse/chop until just blended.<br>Keep a texture to a pesto. It should not be puree.<br>Remove stems from mushrooms and stuff the filling into the cap of the mushrooms.<br>Place on a dehydrator sheet and dehydrate at 105 degrees for 2-4 hours.', 114, '2007-08-16 10:53:26', NULL),
(252, 'Spring Rolls', '', 'Chopped cabbage (about 1/2 of medium head)<br>Finely chopped carrots (about  1/2 cup)<br>minced garlic to taste<br>minced ginger to taste<br>spring rolls sheets (Asian Food Store) (will make about 12)<br>vegan sausage (crumbled), 1 pkg.<br>olive oil', 'Saute garlic,ginger, and "sausage" in generous amt olive oil.<br>Add cabbage and carrots, saute til they are soft but crunchy.<br>To soften,dip spring rolls one at at time into very hot water for 5 seconds. (Helps to have a large pan of water on stove that is close to but not boiling).<br>Place spring roll on a plate, spread out best as possible (they will be sticky).<br>Place filling into center of spring rolls and fold it together or roll it up.<br>If you find egg rolls w/o eggs (ie.just flour and water,no eggs), you can bake them and they get slightly crunchy, just brush them w/olive oil first. The spring rolls do not get crunchy when baked, they remain soft and sticky like.<br>You can eat the spring rolls hot or cold.<br>Serve w/ soy sauce and/or sweet&sour sauce.', 114, '2007-08-16 11:03:49', NULL),
(253, 'Apple Crisp', '', '4 cups diced apples<br>1/2 cup sugar<br>1 tbsp flour<br>1/2 tsp cinnamon<br>pinch salt<br>3/4 cup quick oatmeal<br>3/4 cup flour<br>3/4 cup brown sugar<br>1/4 tsp baking soda<br>1/3 cup melted vegan margarine', 'Mix together 1st five ingredients (apples, sugar, flour, cinnamon, salt) and put in 8X8 pan<br>Mix together remaining ingredients (oatmeal, flour, brown sugar, soda, margarine) and sprinkle over top.<br>Bake 40 minutes at 350 degrees', 108, '2007-11-12 08:52:26', NULL),
(254, 'Pumpkin  "Cream Cheese" Bars', '', '1/3 cup soy yogurt (plain/sweetened)<br>1/2 cup sugar<br>1 cup pumpkin puree<br>1/3 cup canola oil<br>1 cup flour<br>1 tsp baking powder<br>1/2 tsp baking soda<br>1 tsp cinnamon<br>1/2 tsp nutmeg<br>1/4 tsp ginger<br>1/4 tsp cloves<br>1/4 tsp salt<br>1/2 cup tofutti better than cream cheese<br>5 tbsp non hydrogenated vegan margarine<br>2 tbsp vegetable shortening<br>1 tsp vanilla<br>2 cups powdered sugar', 'Preheat oven to 350 degrees<br>In medium bowl, blend w/ electric mixer: soy yogurt, sugar, pumpkin, and oil.<br>In small bowl, sift together dry ingredients and add to the wet mixture.<br>Spread batter evenly in 8X8 pan and bake 25-30 min or until toothpick comes out clean when inserted into middle.<br>For frosting, blend cream cheese, margarine, shortening and vanilla. With electric mixer, slowly blend in powdered sugar.<br>Frost bars after completely cool and enjoy!', 108, '2007-11-12 08:58:55', NULL),
(255, 'Lefse', '', '5 lbs. peeled potatoes<br>1/2 cup vegan margarine<br>1/2 cup soy milk<br>2 tsp salt<br>2.5 cups flour', 'Boil potatoes until tender.<br>Rice potatoes.<br>Add margarine, soymilk and salt. Mix with potato masher.<br>Refrigerate overnight.<br>Add flour while mixing with hand.<br>Portion into balls, 1.5-2 inches.<br>Roll balls into thin sheets.<br>Cook on lefse grill until lightly browned.', 109, '2007-11-14 15:37:46', NULL),
(256, 'Gravy', 'Gravy for stuffing or mashed potatoes.', '2.5 tbsp. soy margarine<br>1/4 cup wondra flour (or regular flour)<br>1.5 cups vegetable broth<br>2 tbsp. tamari<br>1/4 tsp black pepper<br>1/8 cup dried parsley', 'Melt margarine in small saucepan over medium heat; add flour and whisk 30 seconds.<br>Slowly add broth while whisking. Cook over medium heat for 2 minutes, whisking occasionally.<br>Add tamari and pepper; cook until gravy is thickened. Add parsley.', 115, '2007-11-14 15:43:48', NULL),
(257, 'Mashed Potatoes', '', NULL, NULL, 115, '2007-11-14 15:50:12', NULL),
(258, 'Potatoes, mashed', '', 'Potatoes<br>soy milk, unsweetened<br>soy margarine<br>salt and pepper to taste', 'Peel and boil potatoes.<br>Mash potatoes; add soy milk, margarine and salt and pepper to taste and blend.', 115, '2007-11-14 15:51:18', NULL),
(259, 'Stuffing', '', '2 cups diced onion<br>2 cups diced celery<br>2 tbsp. sesame oil<br>2 bags dried bread cubes (1 seasoned, 1 unseasoned)<br>2 tsp dried parsley<br>2 tsp poultry seasoning<br>4 cups vegetable broth', 'Saute onion and celery in oil<br>Mix bread cubes, seasonings, sauteed vegetables and broth in large bowl until bread cubes are well coated.<br>Place mixture in cake pan and bake at 350 degrees until lightly browned, 20-30 minutes.', 109, '2007-11-14 15:55:41', NULL),
(260, 'Carrots, glazed', '', '2 cups sliced carrots<br>1 medium onion diced<br>1/4 cup packed light brown sugar<br>2 tbsp (1/4) stick vegan margarine, melted<br>1/4 tsp ground cinnamon', 'Steam the carrots in small amount water until tender, about 8 minutes. Drain thoroughly.<br>In medium saucepan, combine carrots, onion, brown sugar, margarine and cinnamon.<br>Simmer, stirring occasionally for 15 minutes or until tender.', 115, '2007-11-14 16:03:17', NULL),
(261, 'Broccoli Salad (Raw)', '', '5 cups broccoli chopped<br>1 cup sunflower seeds<br>1/2 cup onion, chopped<br>1/2 cup raisins, soaked until soft<br>1 cup cashews<br>3 tbsp agave nectar<br>2 tbsp raw apple cider vinegar<br>1/4 tsp sea salt<br>1/4 cup water', 'Mix together the broccoli, sunflower seeds, onion, and raisins.<br>Blend til smooth the cashews, agave nectar, vinegar, salt and water.<br>Mix all together well.', 110, '2007-11-27 16:05:43', NULL),
(262, 'Kale, Marinated, (Raw)', '', '1 bunch fresh kale, torn in small pieces<br>1 red sweet onion, thin julienne slices<br>1 avocado, diced into 1/2" cubes<br>1 cup cherry tomatoes, cut in halves<br>1/2 cup slivered almonds or pine nuts<br>Marinade:<br>1/2 cup olive oil<br>2 tbsp lemon juice, fresh<br>2 tbsp Nama Shoyu or Braggs Liquid Aminos<br>fresh garlic<br>fresh ginger<br>fresh cayenne', 'Tear kale off stalk into bite size pieces.<br>Blend ingredients for marinade in blender til creamy, adding as much or as little garlic, ginger, and cayenne as you desire. We like 2 cloves garlic, 1 inch of ginger and 1 inch of cayenne.<br>Pour marinade over kale and bruise by pounding it with a bamboo or wood utensil.<br>Add onion slices and toss.<br>Let marinade at least overnight.<br>When ready to serve, add cubed avocado and halved cherry tomatoes.<br>A delicious way to get your greens into your everyday diet!<br>Serves 3-4 depending on the bunch size of the kale and the sizes of the veggies.', 110, '2007-11-27 16:14:45', NULL),
(263, 'Apple Butternut Fusion Soup, (Raw)', '', '1/2 cup raw almonds<br>2 cups pure water<br>1 medium sized butternut squash<br>10 sweet apples<br>2 oranges<br>1 lemon<br>1 small red onion<br>1 cup raw pumpkin seeds<br>1 bunch fresh parsley<br>1 tbsp tarragon<br>1 tsp cloves or pumpkin pie spice<br>1/4 tsp sea salt<br>pinch cayenne', 'To make the almond milk base, soak the almonds in water about 8 hours and then blend in high speed blender w/ 2 cups fresh pure water. Filter the pulp out with a milk bag or cheese cloth.<br>Wash chop and core the apples.<br>Juice the lemon and oranges.<br>Wash and chop the onion and parsley.<br>Peel, seed and chop the squash.<br>Blend all the ingredients with the almond milk in blender til smooth.<br>Serve chilled or at room temperature with apple and lemon slices.', 119, '2007-11-27 16:33:01', NULL),
(264, 'Vegetable Eggplant Curry', '', '<ul><li>2 eggplants, cubed </li><li>4 celery stalks</li><li>8 carrots</li><li>olive oil</li><li>1 can coconut milk</li><li>3 Tbsp veg. broth powder</li><li>1 cup water</li><li>1Tbsp Thai green curry paste</li><li>1 Tbsp cumin</li><li>2 Tbsp maple syrup</li><li>salt and pepper to taste</li></ul>', '<ol><li>Saute celery and carrots in olive oil</li><li>Steam eggplant 10 mins</li><li>Mix remaining ingredients and add cooked vegetables</li></ol>', 103, '2008-08-03 21:10:15', '2008-08-03 21:10:15'),
(265, 'Stuffed Celery', 'A different spin on ''ants on a log''. The salty-sweet filling inside of the celery stalks is very flavorful.', '<ul><li>2/3 cup peanut butter</li><li>1 Tbsp soy milk</li><li>1 Tbsp soy sauce</li><li>1/4 tsp ground ginger</li><li>1/4 cup toasted sesame seeds</li><li>celery stalks </li></ul>', '<ol><li>Mix all ingredients and fill celery stalks with mixture</li></ol>', 114, '2008-08-03 21:20:20', '2008-08-03 21:21:55'),
(266, 'Fresh tomato salad', 'A sweet diced tomato salad. The agave provides the sweetness with a low glycemic index. ', '<ul><li>tomatoes</li><li>basil</li><li>olive oil</li><li>sea salt</li><li>agave sweetener </li></ul>', '', 110, '2008-10-14 19:45:38', '2008-10-16 10:20:38');
INSERT INTO `recipes` (`id`, `title`, `description`, `ingredients`, `instructions`, `category_id`, `created_at`, `updated_at`) VALUES
(267, 'Vegan Pizza Cheese', 'Sick of vegan cheese that doesn''t melt? Topped with SmartDeli vegan pepperoni on O''neill''s vegan pizza crust this cheese really works! My 5 year old has enjoyed it many times and is always excited when I make it.', ' 12oz package organic firm silken tofu<br />1/3 cup ground flax seeds (use coffee grinder)<br />1/3 cup ground sesame seeds (use coffee grinder)<br />3TBSP (heaping) nutritional yeast<br />1tsp real salt<br />1/4 cup extra virgin olive oil<br />2tsp apple cider vinegar', 'Process all the cheese ingredients in a food processor or blender.<p><font size="2"><strong>For pepperoni pizza:</strong></font><br /><br />Use <a href="../posts/9">O''neill''s pizza sauce and vegan pizza dough</a>.<br />Hand toss pizza dough and spread pizza sauce thinly.  Dollop cheese evenly over the sauce and spread very carefully with a fork.  </p><p>Then add generous portions of <a href="http://www.lightlife.com/product_detail.jsp?p=smartdelipepperoni">SmartDeli vegan pepperoni</a>.</p><p>Bake at 500 for about 10 minutes. </p>', 103, '2008-10-16 10:14:41', '2008-10-16 10:16:21'),
(268, 'Sweet Potato and Cranberry Hash', 'A slightly sweet dish with sweet potatoes, cranberries, and apple that was served at Vigor''s Thanskgiving dinner.', '<p>3 orange fleshed sweet ptatoes (about 2 lbs)</p><p>3 Tbsp unsalted butter (or vegan substitute)</p><p>1 Fuji apple, peeled, cored, and cut into 1/2&quot; cubes</p><p>1/2 C sliced green spring onions</p><p>1 C cranberries, coarsely chopped</p><p>1/4 tsp ground cinnamon</p><p>pinch of allspice</p><p>Kosher salt</p><p>fresh ground pepper&nbsp;</p>', '<p>Place a rack in the middle of the oven and preheat to 350.&nbsp; Set the sweet potatoes directly on the rack and bake until they feel slightly firm when pressed, 50-55 min.&nbsp; Remove from the oven and let cool to room temperature.&nbsp; Place the sweet potatoes on a plat, cover loosely, and refrigerate overnight.&nbsp; Chilling them firms the flesh, making it hold together better in the hash.&nbsp; The next day, peel the sweet potatoes and cut them into 1&quot; pieces.&nbsp; Set aside.</p><p>In a nonstick frying pan over medium-high heat, melt 2 Tbsp of the butter.&nbsp; Add the apple cubes and saute, stirring occasionally, until the butter browns and the apple cubes start to caramelize and brown around the edges, about 5 min.&nbsp; Add the remaining butter.&nbsp; When it melts, stir in the green onion and cranberries and cook until the green onion wilts, about 1 min.&nbsp; Stir in the cinnamon and allspice, add the sweet potatoes and cook, stirring frequently until the potatoes are heated through, about 4 min.&nbsp; Add salt and pepper to taste and server hot.&nbsp;</p>', 113, '2008-11-18 21:46:45', '2008-11-18 21:46:45'),
(269, 'Basic Hummus', 'A basic hummus recipe w/ chickpeas, tahini, garlic, and lemon juice', '<ul><li>14oz can chickpeas w/ some liquid reserved</li><li>1/3 C tahini</li><li>2 cloves garlic</li><li>juice of 1 lemon</li><li>1/4 tsp cayenne pepper</li><li>red bell pepper (optional)</li></ul>', 'Blend all ingredients until smooth in a blender or food processor.&nbsp; Garnish w/ fresh parsley and serve w/ pita bread or cut veggies.', 113, '2009-09-09 23:10:46', '2009-09-09 23:10:46'),
(270, 'Orzo Cucumber Salad', 'A fresh Summer-time pasta and cucumber salad.', '<ul><li>3/4 C orzo pasta (2 C cooked), cooked &amp; drained</li><li>1/2 med. cucumber, halved lengthwise &amp; sliced</li><li>3/4 C chopped mushrooms</li><li>3/4 C chopped orange bell pepper</li><li>1 med. green onion</li><li>2 Tbs fresh dill</li><li>1/3 C extra virgin olive oil</li><li>1/2 tsp grated lemon peel</li><li>2 Tbs lemon juice</li><li>3/4 tsp salt</li></ul>', 'Cook and drain the orzo pasta, chop veggies, and mix all ingredients.', 110, '2009-09-09 23:22:02', '2009-09-09 23:22:02'),
(271, 'Smokey Black-bean Dip', 'A Tex-Mex black bean dip', '<ul><li>15 oz can black beans</li><li>3 Tbs chopped fresh cilantro</li><li>1/2 C onion</li><li>2 garlic cloves</li><li>1 pinch cayenne</li><li>2 Tbs lime juice (about 1 lime)</li><li>1/2 tsp liquid smoke OR 1 Tbs chopped chipotles in adobo sauce</li><li>salt &amp; pepper to taste</li><li>1/4 C unsalted, hulled pumpkin seeds (optional)</li></ul>', '<ol><li>Drain &amp; rinse black beans</li><li>Mince cilantro, onion, garlic, and chipotles in a food processor.&nbsp; Add the black beans, cayenne, lime juice, and salt &amp; pepper.&nbsp; Puree the mixture.</li><li>Put bean mixture into a serving bowl and sprinkle with the toasted pumpkin seeds. </li></ol>', 114, '2009-09-09 23:35:07', '2009-09-09 23:35:07'),
(272, 'Red Lentil Soup', 'Has an Indian flavor to it, good with chipatis or tortillas.', '<p>2 1/2 cups dry red lentils (they are orange in color before cooking, then turn yellow once cooked.</p><p>2 tsp turmeric powder</p><p>1 Tbsp cumin seeds</p><p>1 tsp black mustard seeds </p><p>4 cloves garlic minced</p><p>1/2 bunch fresh cilantro diced </p><p>1/4 cup Earth Balance margarin </p><p>2 Tbsp tamarind paste or lemon juice. </p><p>green or tai chilis to taste (optional)</p><p>sea salt to taste </p><p>1 block extra firm tofu cubed (optional) </p>', '<p>Rinse lentils very thouroughly and soak for about 15 minutes or more. Rinse again and bring to boil with about 4 cups of water or enough to cover well.&nbsp; Boil for 20 minutes and stir periodically.&nbsp; Add more water and turn down heat if needed.&nbsp; Once the lentils fall apart and blend together turn heat down to a simmer and add turmeric powder.&nbsp;&nbsp; </p><p>Heat the cumin and mustard until hot but don''t burn (if the mustard seed pops it''s hot).&nbsp; Add the other ingredients except for the lentils, turmeric, tamarind or lemon juice and saute until cilantro is cooked.&nbsp; Add the saute to the lentils and simmer for a while.&nbsp; Then add the tamarind and lemon juice.&nbsp; Taste and add extra lemon, tamarind, salt, cumin powder, garlic powder or anything else you want to adjust the flavor.&nbsp; Enjoy!&nbsp; It''s good served with chipatis or tortillas. </p>', 119, '2012-10-25 14:51:18', '2012-10-25 14:55:34');
